tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","2","8.556","Chapter 5","And he opened his mouth and taught them, saying: \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","3","11.689","Chapter 5","\\u201cBlessed are the poor in spirit, for theirs is the kingdom of heaven. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","4","17.331","Chapter 5","\\u201cBlessed are those who mourn, for they shall be comforted. \\n\\t\\t\\t","5","Matthew","5")');
