tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","6","25.675","Chapter 5","\\u201cBlessed are those who hunger and thirst for righteousness, for they shall be satisfied. \\n\\t\\t\\t","5","Matthew","5")');
