tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","8","37.199","Chapter 5","\\u201cBlessed are the pure in heart, for they shall see God. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","9","42.252","Chapter 5","\\u201cBlessed are the peacemakers, for they shall be called sons of God. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","10","47.397","Chapter 5","\\u201cBlessed are those who are persecuted for righteousness\\u2019 sake, for theirs is the kingdom of heaven. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","11","53.556","Chapter 5","\\u201cBlessed are you when others revile you and persecute you and utter all kinds of evil against you falsely on my account. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","12","61.503","Chapter 5","Rejoice and be glad, for your reward is great in heaven, for so they persecuted the prophets who were before you. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","13","70.238","Chapter 5","\\u201cYou are the salt of the earth, but if salt has lost its taste, how shall its saltiness be restored? It is no longer good for anything except to be thrown out and trampled under people\\u2019s feet. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","14","85","Chapter 5","\\u201cYou are the light of the world. A city set on a hill cannot be hidden. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","15","90.291","Chapter 5","Nor do people light a lamp and put it under a basket, but on a stand, and it gives light to all in the house. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","16","98","Chapter 5","In the same way, let your light shine before others, so that they may see your good works and give glory to your Father who is in heaven. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","17","108.291","Chapter 5","\\u201cDo not think that I have come to abolish the Law or the Prophets; I have not come to abolish them but to fulfill them. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","18","116.305","Chapter 5","For truly, I say to you, until heaven and earth pass away, not an iota, not a dot, will pass from the Law until all is accomplished. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","19","126.397","Chapter 5","Therefore whoever relaxes one of the least of these commandments and teaches others to do the same will be called least in the kingdom of heaven, but whoever does them and teaches them will be called great in the kingdom of heaven. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","20","140.079","Chapter 5","For I tell you, unless your righteousness exceeds that of the scribes and Pharisees, you will never enter the kingdom of heaven. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","21","149.291","Chapter 5","\\u201cYou have heard that it was said to those of old, \\u2018You shall not murder; and whoever murders will be liable to judgment.\\u2019 \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","22","157","Chapter 5","But I say to you that everyone who is angry with his brother will be liable to judgment; whoever insults his brother will be liable to the council; and whoever says, \\u2018You fool!\\u2019will be liable to the hell of fire. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","23","172.411","Chapter 5","So if you are offering your gift at the altar and there remember that your brother has something against you, \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","24","179.675","Chapter 5","leave your gift there before the altar and go. First be reconciled to your brother, and then come and offer your gift. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","25","187.874","Chapter 5","Come to terms quickly with your accuser while you are going with him to court, lest your accuser hand you over to the judge, and the judge to the guard, and you be put in prison. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","26","198.662","Chapter 5","Truly, I say to you, you will never get out until you have paid the last penny. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","27","205.424","Chapter 5","\\u201cYou have heard that it was said, \\u2018You shall not commit adultery.\\u2019 \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","28","209.503","Chapter 5","But I say to you that everyone who looks at a woman with lustful intent has already committed adultery with her in his heart. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","29","217.503","Chapter 5","If your right eye causes you to sin, tear it out and throw it away. For it is better that you lose one of your members than that your whole body be thrown into hell. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","30","227.649","Chapter 5","And if your right hand causes you to sin, cut it off and throw it away. For it is better that you lose one of your members than that your whole body go into hell. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","31","238.609","Chapter 5","\\u201cIt was also said, \\u2018Whoever divorces his wife, let him give her a certificate of divorce.\\u2019 \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","32","245.331","Chapter 5","But I say to you that everyone who divorces his wife, except on the ground of sexual immorality, makes her commit adultery, and whoever marries a divorced woman commits adultery. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","33","258","Chapter 5","\\u201cAgain you have heard that it was said to those of old, \\u2018You shall not swear falsely, but shall perform to the Lord what you have sworn.\\u2019 \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","34","266.649","Chapter 5","But I say to you, Do not take an oath at all, either by heaven, for it is the throne of God, \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","35","272.768","Chapter 5","or by the earth, for it is his footstool, or by Jerusalem, for it is the city of the great King. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","36","279.503","Chapter 5","And do not take an oath by your head, for you cannot make one hair white or black. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","37","284.914","Chapter 5","Let what you say be simply \\u2018Yes\\u2019or \\u2018No\\u2019; anything more than this comes from evil. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","38","292.305","Chapter 5","\\u201cYou have heard that it was said, \\u2018An eye for an eye and a tooth for a tooth.\\u2019 \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","39","297.384","Chapter 5","But I say to you, Do not resist the one who is evil. But if anyone slaps you on the right cheek, turn to him the other also. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","40","305.371","Chapter 5","And if anyone would sue you and take your tunic, let him have your cloak as well. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","41","310.424","Chapter 5","And if anyone forces you to go one mile, go with him two miles. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","42","314.887","Chapter 5","Give to the one who begs from you, and do not refuse the one who would borrow from you. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","43","321.106","Chapter 5","\\u201cYou have heard that it was said, \\u2018You shall love your neighbor and hate your enemy.\\u2019 \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","44","326.596","Chapter 5","But I say to you, Love your enemies and pray for those who persecute you, \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","45","332.053","Chapter 5","so that you may be sons of your Father who is in heaven. For he makes his sun rise on the evil and on the good, and sends rain on the just and on the unjust. \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","46","343.437","Chapter 5","For if you love those who love you, what reward do you have? Do not even the tax collectors do the same? \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","47","351.887","Chapter 5","And if you greet only your brothers, what more are you doing than others? Do not even the Gentiles do the same? \\n\\t\\t\\t","5","Matthew","5")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","48","359.927","Chapter 5","You therefore must be perfect, as your heavenly Father is perfect. \\n\\t\\t\\n\\t\\t","5","Matthew","5")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","1","3.543","Chapter 6","\\u201cBeware of practicing your righteousness before other people in order to be seen by them, for then you will have no reward from your Father who is in heaven. \\n\\t\\t\\t","6","Matthew","6")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","2","13.742","Chapter 6","\\u201cThus, when you give to the needy, sound no trumpet before you, as the hypocrites do in the synagogues and in the streets, that they may be praised by others. Truly, I say to you, they have received their reward. \\n\\t\\t\\t","6","Matthew","6")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","3","27.464","Chapter 6","But when you give to the needy, do not let your left hand know what your right hand is doing, \\n\\t\\t\\t","6","Matthew","6")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","4","32.795","Chapter 6","so that your giving may be in secret. And your Father who sees in secret will reward you. \\n\\t\\t\\t","6","Matthew","6")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","5","40","Chapter 6","\\u201cAnd when you pray, you must not be like the hypocrites. For they love to stand and pray in the synagogues and at the street corners, that they may be seen by others. Truly, I say to you, they have received their reward. \\n\\t\\t\\t","6","Matthew","6")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","6","54.636","Chapter 6","But when you pray, go into your room and shut the door and pray to your Father who is in secret. And your Father who sees in secret will reward you. \\n\\t\\t\\t","6","Matthew","6")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","7","66","Chapter 6","\\u201cAnd when you pray, do not heap up empty phrases as the Gentiles do, for they think that they will be heard for their many words. \\n\\t\\t\\t","6","Matthew","6")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","8","74.477","Chapter 6","Do not be like them, for your Father knows what you need before you ask him. \\n\\t\\t\\t","6","Matthew","6")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","9","80","Chapter 6","Pray then like this: \\u201cOur Father in heaven, hallowed be your name. \\n\\t\\t\\t","6","Matthew","6")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","10","85.742","Chapter 6","Your kingdom come, your will be done, on earth as it is in heaven. \\n\\t\\t\\t","6","Matthew","6")');
