tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","21","159.344","Chapter 6","For where your treasure is, there your heart will be also. \\n\\t\\t\\t","6","Matthew","6")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","22","164.689","Chapter 6","\\u201cThe eye is the lamp of the body. So, if your eye is healthy, your whole body will be full of light, \\n\\t\\t\\t","6","Matthew","6")');
