tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","24","181.053","Chapter 6","\\u201cNo one can serve two masters, for either he will hate the one and love the other, or he will be devoted to the one and despise the other. You cannot serve God and money. \\n\\t\\t\\t","6","Matthew","6")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","25","193.702","Chapter 6","\\u201cTherefore I tell you, do not be anxious about your life, what you will eat or what you will drink, nor about your body, what you will put on. Is not life more than food, and the body more than clothing? \\n\\t\\t\\t","6","Matthew","6")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","26","207","Chapter 6","Look at the birds of the air: they neither sow nor reap nor gather into barns, and yet your heavenly Father feeds them. Are you not of more value than they? \\n\\t\\t\\t","6","Matthew","6")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","27","218.185","Chapter 6","And which of you by being anxious can add a single hour to his span of life? \\n\\t\\t\\t","6","Matthew","6")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","28","224.411","Chapter 6","And why are you anxious about clothing? Consider the lilies of the field, how they grow: they neither toil nor spin, \\n\\t\\t\\t","6","Matthew","6")');
