tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","31","250.291","Chapter 6","Therefore do not be anxious, saying, \\u2018What shall we eat?\\u2019or \\u2018What shall we drink?\\u2019or \\u2018What shall we wear?\\u2019 \\n\\t\\t\\t","6","Matthew","6")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","32","257.821","Chapter 6","For the Gentiles seek after all these things, and your heavenly Father knows that you need them all. \\n\\t\\t\\t","6","Matthew","6")');
