tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","1","3.53","Chapter 18","At that time the disciples came to Jesus, saying, \\u201cWho is the greatest in the kingdom of heaven?\\u201d \\n\\t\\t\\t","18","Matthew","18")');
