tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","4","23.159","Chapter 18","Whoever humbles himself like this child is the greatest in the kingdom of heaven. \\n\\t\\t\\t","18","Matthew","18")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","5","28.397","Chapter 18","\\u201cWhoever receives one such child in my name receives me, \\n\\t\\t\\t","18","Matthew","18")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","6","33","Chapter 18","but whoever causes one of these little ones who believe in me to sin, it would be better for him to have a great millstone fastened around his neck and to be drowned in the depth of the sea. \\n\\t\\t\\t","18","Matthew","18")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","7","46","Chapter 18","\\u201cWoe to the world for temptations to sin! For it is necessary that temptations come, but woe to the one by whom the temptation comes! \\n\\t\\t\\t","18","Matthew","18")');
