tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","19","149.662","Chapter 21","And seeing a fig tree by the wayside, he went to it and found nothing on it but only leaves. And he said to it, \\u201cMay no fruit ever come from you again!\\u201d And the fig tree withered at once. \\n\\t\\t\\t","21","Matthew","21")');
