tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","22","191.106","Chapter 21","And whatever you ask in prayer, you will receive, if you have faith.\\u201d \\n\\t\\t\\t","21","Matthew","21")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","23","198.517","Chapter 21","And when he entered the temple, the chief priests and the elders of the people came up to him as he was teaching, and said, \\u201cBy what authority are you doing these things, and who gave you this authority?\\u201d \\n\\t\\t\\t","21","Matthew","21")');
