tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","25","222.053","Chapter 21","The baptism of John, from where did it come? From heaven or from man?\\u201d And they discussed it among themselves, saying, \\u201cIf we say, \\u2018From heaven,\\u2019he will say to us, \\u2018Why then did you not believe him?\\u2019 \\n\\t\\t\\t","21","Matthew","21")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","26","236.795","Chapter 21","But if we say, \\u2018From man,\\u2019we are afraid of the crowd, for they all hold that John was a prophet.\\u201d \\n\\t\\t\\t","21","Matthew","21")');
