tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","28","254.411","Chapter 21","\\u201cWhat do you think? A man had two sons. And he went to the first and said, \\u2018Son, go and work in the vineyard today.\\u2019 \\n\\t\\t\\t","21","Matthew","21")');
