tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","37","337.079","Chapter 21","Finally he sent his son to them, saying, \\u2018They will respect my son.\\u2019 \\n\\t\\t\\t","21","Matthew","21")');
