tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","39","350.675","Chapter 21","And they took him and threw him out of the vineyard and killed him. \\n\\t\\t\\t","21","Matthew","21")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","40","355.159","Chapter 21","When therefore the owner of the vineyard comes, what will he do to those tenants?\\u201d \\n\\t\\t\\t","21","Matthew","21")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","41","361.781","Chapter 21","They said to him, \\u201cHe will put those wretches to a miserable death and let out the vineyard to other tenants who will give him the fruits in their seasons.\\u201d \\n\\t\\t\\t","21","Matthew","21")');
