tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","43","387.278","Chapter 21","Therefore I tell you, the kingdom of God will be taken away from you and given to a people producing its fruits. \\n\\t\\t\\t","21","Matthew","21")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","44","394.795","Chapter 21","And the one who falls on this stone will be broken to pieces; and when it falls on anyone, it will crush him.\\u201d \\n\\t\\t\\t","21","Matthew","21")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","45","403.53","Chapter 21","When the chief priests and the Pharisees heard his parables, they perceived that he was speaking about them. \\n\\t\\t\\t","21","Matthew","21")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","46","409.689","Chapter 21","And although they were seeking to arrest him, they feared the crowds, because they held him to be a prophet. \\n\\t\\t\\n\\t\\t","21","Matthew","21")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","1","4","Chapter 22","And again Jesus spoke to them in parables, saying, \\n\\t\\t\\t","22","Matthew","22")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","2","7.675","Chapter 22","\\u201cThe kingdom of heaven may be compared to a king who gave a wedding feast for his son, \\n\\t\\t\\t","22","Matthew","22")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","3","13","Chapter 22","and sent his servants to call those who were invited to the wedding feast, but they would not come. \\n\\t\\t\\t","22","Matthew","22")');
