tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","5","33.318","Chapter 22","But they paid no attention and went off, one to his farm, another to his business, \\n\\t\\t\\t","22","Matthew","22")');
