tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","7","43.914","Chapter 22","The king was angry, and he sent his troops and destroyed those murderers and burned their city. \\n\\t\\t\\t","22","Matthew","22")');
