tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","9","57.411","Chapter 22","Go therefore to the main roads and invite to the wedding feast as many as you find.\\u2019 \\n\\t\\t\\t","22","Matthew","22")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","10","63.755","Chapter 22","And those servants went out into the roads and gathered all whom they found, both bad and good. So the wedding hall was filled with guests. \\n\\t\\t\\t","22","Matthew","22")');
