tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","15","88.596","Chapter 23","Woe to you, scribes and Pharisees, hypocrites! For you travel across sea and land to make a single proselyte, and when he becomes a proselyte, you make him twice as much a child of hell as yourselves. \\n\\t\\t\\t","23","Matthew","23")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","16","88.596","Chapter 23","\\u201cWoe to you, blind guides, who say, \\u2018If anyone swears by the temple, it is nothing, but if anyone swears by the gold of the temple, he is bound by his oath.\\u2019 \\n\\t\\t\\t","23","Matthew","23")');
