tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","20","137.225","Chapter 23","So whoever swears by the altar swears by it and by everything on it. \\n\\t\\t\\t","23","Matthew","23")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","21","145.318","Chapter 23","And whoever swears by the temple swears by it and by him who dwells in it. \\n\\t\\t\\t","23","Matthew","23")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","22","151.662","Chapter 23","And whoever swears by heaven swears by the throne of God and by him who sits upon it. \\n\\t\\t\\t","23","Matthew","23")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","23","157.675","Chapter 23","\\u201cWoe to you, scribes and Pharisees, hypocrites! For you tithe mint and dill and cumin, and have neglected the weightier matters of the law: justice and mercy and faithfulness. These you ought to have done, without neglecting the others. \\n\\t\\t\\t","23","Matthew","23")');
