tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","25","187.331","Chapter 23","\\u201cWoe to you, scribes and Pharisees, hypocrites! For you clean the outside of the cup and the plate, but inside they are full of greed and self-indulgence. \\n\\t\\t\\t","23","Matthew","23")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","26","193.318","Chapter 23","You blind Pharisee! First clean the inside of the cup and the plate, that the outside also may be clean. \\n\\t\\t\\t","23","Matthew","23")');
