tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","29","229.742","Chapter 23","\\u201cWoe to you, scribes and Pharisees, hypocrites! For you build the tombs of the prophets and decorate the monuments of the righteous, \\n\\t\\t\\t","23","Matthew","23")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","30","239","Chapter 23","saying, \\u2018If we had lived in the days of our fathers, we would not have taken part with them in shedding the blood of the prophets.\\u2019 \\n\\t\\t\\t","23","Matthew","23")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","31","249.265","Chapter 23","Thus you witness against yourselves that you are sons of those who murdered the prophets. \\n\\t\\t\\t","23","Matthew","23")');
