tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","33","264.344","Chapter 23","You serpents, you brood of vipers, how are you to escape being sentenced to hell? \\n\\t\\t\\t","23","Matthew","23")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","34","268.132","Chapter 23","Therefore I send you prophets and wise men and scribes, some of whom you will kill and crucify, and some you will flog in your synagogues and persecute from town to town, \\n\\t\\t\\t","23","Matthew","23")');
