tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","36","287.331","Chapter 23","Truly, I say to you, all these things will come upon this generation. \\n\\t\\t\\t","23","Matthew","23")');
