tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","1","3.715","Chapter 24","Jesus left the temple and was going away, when his disciples came to point out to him the buildings of the temple. \\n\\t\\t\\t","24","Matthew","24")');
