tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","25","174.503","Chapter 24","See, I have told you beforehand. \\n\\t\\t\\t","24","Matthew","24")');
