tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","14","76.662","Chapter 25","\\u201cFor it will be like a man going on a journey, who called his servants and entrusted to them his property. \\n\\t\\t\\t","25","Matthew","25")');
