tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("55","Matt","23","155.119","Chapter 25","His master said to him, \\u2018Well done, good and faithful servant. You have been faithful over a little; I will set you over much. Enter into the joy of your master.\\u2019 \\n\\t\\t\\t","25","Matthew","25")');
