tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","33","280.371","Chapter 4","And in the synagogue there was a man who had the spirit of an unclean demon, and he cried out with a loud voice, \\n\\t\\t\\t","4","Luke","46")');
