tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","1","2.464","Chapter 5","On one occasion, while the crowd was pressing in on him to hear the word of God, he was standing by the lake of Gennesaret, \\n\\t\\t\\t","5","Luke","47")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","2","10.371","Chapter 5","and he saw two boats by the lake, but the fishermen had gone out of them and were washing their nets. \\n\\t\\t\\t","5","Luke","47")');
