tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","21","175.397","Chapter 5","And the scribes and the Pharisees began to question, saying, \\u201cWho is this who speaks blasphemies? Who can forgive sins but God alone?\\u201d \\n\\t\\t\\t","5","Luke","47")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","22","185.517","Chapter 5","When Jesus perceived their thoughts, he answered them, \\u201cWhy do you question in your hearts? \\n\\t\\t\\t","5","Luke","47")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","23","192.291","Chapter 5","Which is easier, to say, \\u2018Your sins are forgiven you,\\u2019or to say, \\u2018Rise and walk\\u2019? \\n\\t\\t\\t","5","Luke","47")');
