tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","25","210.358","Chapter 5","And immediately he rose up before them and picked up what he had been lying on and went home, glorifying God. \\n\\t\\t\\t","5","Luke","47")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","26","217.185","Chapter 5","And amazement seized them all, and they glorified God and were filled with awe, saying, \\u201cWe have seen extraordinary things today.\\u201d \\n\\t\\t\\t","5","Luke","47")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","27","227.318","Chapter 5","After this he went out and saw a tax collector named Levi, sitting at the tax booth. And he said to him, \\u201cFollow me.\\u201d \\n\\t\\t\\t","5","Luke","47")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","28","237.424","Chapter 5","And leaving everything, he rose and followed him. \\n\\t\\t\\t","5","Luke","47")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","29","240.556","Chapter 5","And Levi made him a great feast in his house, and there was a large company of tax collectors and others reclining at table with them. \\n\\t\\t\\t","5","Luke","47")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","30","248.914","Chapter 5","And the Pharisees and their scribes grumbled at his disciples, saying, \\u201cWhy do you eat and drink with tax collectors and sinners?\\u201d \\n\\t\\t\\t","5","Luke","47")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","31","259.318","Chapter 5","And Jesus answered them, \\u201cThose who are well have no need of a physician, but those who are sick. \\n\\t\\t\\t","5","Luke","47")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","32","266.159","Chapter 5","I have not come to call the righteous but sinners to repentance.\\u201d \\n\\t\\t\\t","5","Luke","47")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","33","270.57","Chapter 5","And they said to him, \\u201cThe disciples of John fast often and offer prayers, and so do the disciples of the Pharisees, but yours eat and drink.\\u201d \\n\\t\\t\\t","5","Luke","47")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","34","279.954","Chapter 5","And Jesus said to them, \\u201cCan you make wedding guests fast while the bridegroom is with them? \\n\\t\\t\\t","5","Luke","47")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","35","285.689","Chapter 5","The days will come when the bridegroom is taken away from them, and then they will fast in those days.\\u201d \\n\\t\\t\\t","5","Luke","47")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","36","292.146","Chapter 5","He also told them a parable: \\u201cNo one tears a piece from a new garment and puts it on an old garment. If he does, he will tear the new, and the piece from the new will not match the old. \\n\\t\\t\\t","5","Luke","47")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","37","303.331","Chapter 5","And no one puts new wine into old wineskins. If he does, the new wine will burst the skins and it will be spilled, and the skins will be destroyed. \\n\\t\\t\\t","5","Luke","47")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","38","313.358","Chapter 5","But new wine must be put into fresh wineskins. \\n\\t\\t\\t","5","Luke","47")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","39","317.079","Chapter 5","And no one after drinking old wine desires new, for he says, \\u2018The old is good.\\u2019\\u201d \\n\\t\\t\\n\\t\\t","5","Luke","47")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","1","2.649","Chapter 6","On a Sabbath, while he was going through the grainfields, his disciples plucked and ate some heads of grain, rubbing them in their hands. \\n\\t\\t\\t","6","Luke","48")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","2","10.901","Chapter 6","But some of the Pharisees said, \\u201cWhy are you doing what is not lawful to do on the Sabbath?\\u201d \\n\\t\\t\\t","6","Luke","48")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","3","16.344","Chapter 6","And Jesus answered them, \\u201cHave you not read what David did when he was hungry, he and those who were with him: \\n\\t\\t\\t","6","Luke","48")');
