tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","5","33.026","Chapter 6","And he said to them, \\u201cThe Son of Man is lord of the Sabbath.\\u201d \\n\\t\\t\\t","6","Luke","48")');
