tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","32","240.437","Chapter 6","\\u201cIf you love those who love you, what benefit is that to you? For even sinners love those who love them. \\n\\t\\t\\t","6","Luke","48")');
