tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","37","308.265","Chapter 11","While Jesus was speaking, a Pharisee asked him to dine with him, so he went in and reclined at table. \\n\\t\\t\\t","11","Luke","53")');
