tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","39","321.265","Chapter 11","And the Lord said to him, \\u201cNow you Pharisees cleanse the outside of the cup and of the dish, but inside you are full of greed and wickedness. \\n\\t\\t\\t","11","Luke","53")');
