tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","41","335.57","Chapter 11","But give as alms those things that are within, and behold, everything is clean for you. \\n\\t\\t\\t","11","Luke","53")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","42","343.093","Chapter 11","\\u201cBut woe to you Pharisees! For you tithe mint and rue and every herb, and neglect justice and the love of God. These you ought to have done, without neglecting the others. \\n\\t\\t\\t","11","Luke","53")');
