tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","44","363.291","Chapter 11","Woe to you! For you are like unmarked graves, and people walk over them without knowing it.\\u201d \\n\\t\\t\\t","11","Luke","53")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","45","370.397","Chapter 11","One of the lawyers answered him, \\u201cTeacher, in saying these things you insult us also.\\u201d \\n\\t\\t\\t","11","Luke","53")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","46","376.199","Chapter 11","And he said, \\u201cWoe to you lawyers also! For you load people with burdens hard to bear, and you yourselves do not touch the burdens with one of your fingers. \\n\\t\\t\\t","11","Luke","53")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","47","388.185","Chapter 11","Woe to you! For you build the tombs of the prophets whom your fathers killed. \\n\\t\\t\\t","11","Luke","53")');
