tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","49","402.066","Chapter 11","Therefore also the Wisdom of God said, \\u2018I will send them prophets and apostles, some of whom they will kill and persecute,\\u2019 \\n\\t\\t\\t","11","Luke","53")');
