tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","52","429.146","Chapter 11","Woe to you lawyers! For you have taken away the key of knowledge. You did not enter yourselves, and you hindered those who were entering.\\u201d \\n\\t\\t\\t","11","Luke","53")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","53","440.742","Chapter 11","As he went away from there, the scribes and the Pharisees began to press him hard and to provoke him to speak about many things, \\n\\t\\t\\t","11","Luke","53")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","54","448.185","Chapter 11","lying in wait for him, to catch him in something he might say. \\n\\t\\t\\n\\t\\t","11","Luke","53")');

