tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","5","41.437","Chapter 12","But I will warn you whom to fear: fear him who, after he has killed, has authority to cast into hell. Yes, I tell you, fear him! \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","6","51.742","Chapter 12","Are not five sparrows sold for two pennies? And not one of them is forgotten before God. \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","7","58.98","Chapter 12","Why, even the hairs of your head are all numbered. Fear not; you are of more value than many sparrows. \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","8","67.94","Chapter 12","\\u201cAnd I tell you, everyone who acknowledges me before men, the Son of Man also will acknowledge before the angels of God, \\n\\t\\t\\t","12","Luke","54")');
