tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","10","82.94","Chapter 12","And everyone who speaks a word against the Son of Man will be forgiven, but the one who blasphemes against the Holy Spirit will not be forgiven. \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","11","92.623","Chapter 12","And when they bring you before the synagogues and the rulers and the authorities, do not be anxious about how you should defend yourself or what you should say, \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","12","103.45","Chapter 12","for the Holy Spirit will teach you in that very hour what you ought to say.\\u201d \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","13","108.331","Chapter 12","Someone in the crowd said to him, \\u201cTeacher, tell my brother to divide the inheritance with me.\\u201d \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","14","114.821","Chapter 12","But he said to him, \\u201cMan, who made me a judge or arbitrator over you?\\u201d \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","15","121.278","Chapter 12","And he said to them, \\u201cTake care, and be on your guard against all covetousness, for one\\u2019s life does not consist in the abundance of his possessions.\\u201d \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","16","132.331","Chapter 12","And he told them a parable, saying, \\u201cThe land of a rich man produced plentifully, \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","17","137.715","Chapter 12","and he thought to himself, \\u2018What shall I do, for I have nowhere to store my crops?\\u2019 \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","18","143.94","Chapter 12","And he said, \\u2018I will do this: I will tear down my barns and build larger ones, and there I will store all my grain and my goods. \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","19","153.053","Chapter 12","And I will say to my soul, Soul, you have ample goods laid up for many years; relax, eat, drink, be merry.\\u2019 \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","20","162.94","Chapter 12","But God said to him, \\u2018Fool! This night your soul is required of you, and the things you have prepared, whose will they be?\\u2019 \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","21","172.503","Chapter 12","So is the one who lays up treasure for himself and is not rich toward God.\\u201d \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","22","178.914","Chapter 12","And he said to his disciples, \\u201cTherefore I tell you, do not be anxious about your life, what you will eat, nor about your body, what you will put on. \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","23","188.662","Chapter 12","For life is more than food, and the body more than clothing. \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","24","192.517","Chapter 12","Consider the ravens: they neither sow nor reap, they have neither storehouse nor barn, and yet God feeds them. Of how much more value are you than the birds! \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","25","205.57","Chapter 12","And which of you by being anxious can add a single hour to his span of life? \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","26","210.901","Chapter 12","If then you are not able to do as small a thing as that, why are you anxious about the rest? \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","27","217.636","Chapter 12","Consider the lilies, how they grow: they neither toil nor spin, yet I tell you, even Solomon in all his glory was not arrayed like one of these. \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","28","228.185","Chapter 12","But if God so clothes the grass, which is alive in the field today, and tomorrow is thrown into the oven, how much more will he clothe you, O you of little faith! \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","29","239.199","Chapter 12","And do not seek what you are to eat and what you are to drink, nor be worried. \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","30","244.53","Chapter 12","For all the nations of the world seek after these things, and your Father knows that you need them. \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","31","251.079","Chapter 12","Instead, seek his kingdom, and these things will be added to you. \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","32","256.887","Chapter 12","\\u201cFear not, little flock, for it is your Father\\u2019s good pleasure to give you the kingdom. \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","33","262.132","Chapter 12","Sell your possessions, and give to the needy. Provide yourselves with moneybags that do not grow old, with a treasure in the heavens that does not fail, where no thief approaches and no moth destroys. \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","34","276.212","Chapter 12","For where your treasure is, there will your heart be also. \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","35","280.662","Chapter 12","\\u201cStay dressed for action and keep your lamps burning, \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","36","284.795","Chapter 12","and be like men who are waiting for their master to come home from the wedding feast, so that they may open the door to him at once when he comes and knocks. \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","37","293.715","Chapter 12","Blessed are those servants whom the master finds awake when he comes. Truly, I say to you, he will dress himself for service and have them recline at table, and he will come and serve them. \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","38","306.066","Chapter 12","If he comes in the second watch, or in the third, and finds them awake, blessed are those servants! \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","39","312.821","Chapter 12","But know this, that if the master of the house had known at what hour the thief was coming, he would not have left his house to be broken into. \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","40","321.689","Chapter 12","You also must be ready, for the Son of Man is coming at an hour you do not expect.\\u201d \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","41","327.821","Chapter 12","Peter said, \\u201cLord, are you telling this parable for us or for all?\\u201d \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","42","334","Chapter 12","And the Lord said, \\u201cWho then is the faithful and wise manager, whom his master will set over his household, to give them their portion of food at the proper time? \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","43","343.728","Chapter 12","Blessed is that servant whom his master will find so doing when he comes. \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","44","348.781","Chapter 12","Truly, I say to you, he will set him over all his possessions. \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","45","353.252","Chapter 12","But if that servant says to himself, \\u2018My master is delayed in coming,\\u2019and begins to beat the male and female servants, and to eat and drink and get drunk, \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","46","364.026","Chapter 12","the master of that servant will come on a day when he does not expect him and at an hour he does not know, and will cut him in pieces and put him with the unfaithful. \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","47","374.927","Chapter 12","And that servant who knew his master\\u2019s will but did not get ready or act according to his will, will receive a severe beating. \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","48","383.424","Chapter 12","But the one who did not know, and did what deserved a beating, will receive a light beating. Everyone to whom much was given, of him much will be required, and from him to whom they entrusted much, they will demand the more. \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","49","397.967","Chapter 12","\\u201cI came to cast fire on the earth, and would that it were already kindled! \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","50","403.397","Chapter 12","I have a baptism to be baptized with, and how great is my distress until it is accomplished! \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","51","410.464","Chapter 12","Do you think that I have come to give peace on earth? No, I tell you, but rather division. \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","52","416.358","Chapter 12","For from now on in one house there will be five divided, three against two and two against three. \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","53","422.954","Chapter 12","They will be divided, father against son and son against father, mother against daughter and daughter against mother, mother-in-law against her daughter-in-law and daughter-in-law against mother-in-law.\\u201d \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","54","435.172","Chapter 12","He also said to the crowds, \\u201cWhen you see a cloud rising in the west, you say at once, \\u2018A shower is coming.\\u2019And so it happens. \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","55","444.967","Chapter 12","And when you see the south wind blowing, you say, \\u2018There will be scorching heat,\\u2019and it happens. \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","56","450.874","Chapter 12","You hypocrites! You know how to interpret the appearance of earth and sky, but why do you not know how to interpret the present time? \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","57","459.967","Chapter 12","\\u201cAnd why do you not judge for yourselves what is right? \\n\\t\\t\\t","12","Luke","54")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","58","463.967","Chapter 12","As you go with your accuser before the magistrate, make an effort to settle with him on the way, lest he drag you to the judge, and the judge hand you over to the officer, and the officer put you in prison. \\n\\t\\t\\t","12","Luke","54")');
