tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","6","41.066","Chapter 13","And he told this parable: \\u201cA man had a fig tree planted in his vineyard, and he came seeking fruit on it and found none. \\n\\t\\t\\t","13","Luke","55")');
