tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","14","99.675","Chapter 13","But the ruler of the synagogue, indignant because Jesus had healed on the Sabbath, said to the people, \\u201cThere are six days in which work ought to be done. Come on those days and be healed, and not on the Sabbath day.\\u201d \\n\\t\\t\\t","13","Luke","55")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","15","115.742","Chapter 13","Then the Lord answered him, \\u201cYou hypocrites! Does not each of you on the Sabbath untie his ox or his donkey from the manger and lead it away to water it? \\n\\t\\t\\t","13","Luke","55")');
