tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","18","143.384","Chapter 13","He said therefore, \\u201cWhat is the kingdom of God like? And to what shall I compare it? \\n\\t\\t\\t","13","Luke","55")');
