tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","20","160.146","Chapter 13","And again he said, \\u201cTo what shall I compare the kingdom of God? \\n\\t\\t\\t","13","Luke","55")');
