tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","25","191.94","Chapter 13","When once the master of the house has risen and shut the door, and you begin to stand outside and to knock at the door, saying, \\u2018Lord, open to us,\\u2019then he will answer you, \\u2018I do not know where you come from.\\u2019 \\n\\t\\t\\t","13","Luke","55")');
