tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","7","39.384","Chapter 14","Now he told a parable to those who were invited, when he noticed how they chose the places of honor, saying to them, \\n\\t\\t\\t","14","Luke","56")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","8","46.57","Chapter 14","\\u201cWhen you are invited by someone to a wedding feast, do not sit down in a place of honor, lest someone more distinguished than you be invited by him, \\n\\t\\t\\t","14","Luke","56")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","9","56.053","Chapter 14","and he who invited you both will come and say to you, \\u2018Give your place to this person,\\u2019and then you will begin with shame to take the lowest place. \\n\\t\\t\\t","14","Luke","56")');
