tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","11","78.437","Chapter 14","For everyone who exalts himself will be humbled, and he who humbles himself will be exalted.\\u201d \\n\\t\\t\\t","14","Luke","56")');
