tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","13","98.675","Chapter 14","But when you give a feast, invite the poor, the crippled, the lame, the blind, \\n\\t\\t\\t","14","Luke","56")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","14","104.212","Chapter 14","and you will be blessed, because they cannot repay you. For you will be repaid at the resurrection of the just.\\u201d \\n\\t\\t\\t","14","Luke","56")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","15","112.331","Chapter 14","When one of those who reclined at table with him heard these things, he said to him, \\u201cBlessed is everyone who will eat bread in the kingdom of God!\\u201d \\n\\t\\t\\t","14","Luke","56")');
