tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","17","126.358","Chapter 14","And at the time for the banquet he sent his servant to say to those who had been invited, \\u2018Come, for everything is now ready.\\u2019 \\n\\t\\t\\t","14","Luke","56")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","18","133.609","Chapter 14","But they all alike began to make excuses. The first said to him, \\u2018I have bought a field, and I must go out and see it. Please have me excused.\\u2019 \\n\\t\\t\\t","14","Luke","56")');
