tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","20","150.464","Chapter 14","And another said, \\u2018I have married a wife, and therefore I cannot come.\\u2019 \\n\\t\\t\\t","14","Luke","56")');
