tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","25","190.305","Chapter 14","Now great crowds accompanied him, and he turned and said to them, \\n\\t\\t\\t","14","Luke","56")');
