tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","27","207.715","Chapter 14","Whoever does not bear his own cross and come after me cannot be my disciple. \\n\\t\\t\\t","14","Luke","56")');
