tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","29","222.437","Chapter 14","Otherwise, when he has laid a foundation and is not able to finish, all who see it begin to mock him, \\n\\t\\t\\t","14","Luke","56")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","30","228.517","Chapter 14","saying, \\u2018This man began to build and was not able to finish.\\u2019 \\n\\t\\t\\t","14","Luke","56")');
