tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","17","118.252","Chapter 15","\\u201cBut when he came to himself, he said, \\u2018How many of my father\\u2019s hired servants have more than enough bread, but I perish here with hunger! \\n\\t\\t\\t","15","Luke","57")');
