tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","20","142.623","Chapter 15","And he arose and came to his father. But while he was still a long way off, his father saw him and felt compassion, and ran and embraced him and kissed him. \\n\\t\\t\\t","15","Luke","57")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","21","154.424","Chapter 15","And the son said to him, \\u2018Father, I have sinned against heaven and before you. I am no longer worthy to be called your son.\\u2019 \\n\\t\\t\\t","15","Luke","57")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","22","162.742","Chapter 15","But the father said to his servants, \\u2018Bring quickly the best robe, and put it on him, and put a ring on his hand, and shoes on his feet. \\n\\t\\t\\t","15","Luke","57")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","23","171.649","Chapter 15","And bring the fattened calf and kill it, and let us eat and celebrate. \\n\\t\\t\\t","15","Luke","57")');
