tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","26","193.146","Chapter 15","And he called one of the servants and asked what these things meant. \\n\\t\\t\\t","15","Luke","57")');
