tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","1","3.066","Chapter 16","He also said to the disciples, \\u201cThere was a rich man who had a manager, and charges were brought to him that this man was wasting his possessions. \\n\\t\\t\\t","16","Luke","58")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","2","13.781","Chapter 16","And he called him and said to him, \\u2018What is this that I hear about you? Turn in the account of your management, for you can no longer be manager.\\u2019 \\n\\t\\t\\t","16","Luke","58")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","3","23.45","Chapter 16","And the manager said to himself, \\u2018What shall I do, since my master is taking the management away from me? I am not strong enough to dig, and I am ashamed to beg. \\n\\t\\t\\t","16","Luke","58")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","4","35.636","Chapter 16","I have decided what to do, so that when I am removed from management, people may receive me into their houses.\\u2019 \\n\\t\\t\\t","16","Luke","58")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","5","43.702","Chapter 16","So, summoning his master\\u2019s debtors one by one, he said to the first, \\u2018How much do you owe my master?\\u2019 \\n\\t\\t\\t","16","Luke","58")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","6","51.318","Chapter 16","He said, \\u2018A hundred measures of oil.\\u2019He said to him, \\u2018Take your bill, and sit down quickly and write fifty.\\u2019 \\n\\t\\t\\t","16","Luke","58")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","7","58.927","Chapter 16","Then he said to another, \\u2018And how much do you owe?\\u2019He said, \\u2018A hundred measures of wheat.\\u2019He said to him, \\u2018Take your bill, and write eighty.\\u2019 \\n\\t\\t\\t","16","Luke","58")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","8","68.914","Chapter 16","The master commended the dishonest manager for his shrewdness. For the sons of this world are more shrewd in dealing with their own generation than the sons of light. \\n\\t\\t\\t","16","Luke","58")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","9","78.848","Chapter 16","And I tell you, make friends for yourselves by means of unrighteous wealth, so that when it fails they may receive you into the eternal dwellings. \\n\\t\\t\\t","16","Luke","58")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","10","89.159","Chapter 16","\\u201cOne who is faithful in a very little is also faithful in much, and one who is dishonest in a very little is also dishonest in much. \\n\\t\\t\\t","16","Luke","58")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","11","98.768","Chapter 16","If then you have not been faithful in the unrighteous wealth, who will entrust to you the true riches? \\n\\t\\t\\t","16","Luke","58")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","12","105.834","Chapter 16","And if you have not been faithful in that which is another\\u2019s, who will give you that which is your own? \\n\\t\\t\\t","16","Luke","58")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","13","112.517","Chapter 16","No servant can serve two masters, for either he will hate the one and love the other, or he will be devoted to the one and despise the other. You cannot serve God and money.\\u201d \\n\\t\\t\\t","16","Luke","58")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","14","125.344","Chapter 16","The Pharisees, who were lovers of money, heard all these things, and they ridiculed him. \\n\\t\\t\\t","16","Luke","58")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","15","130.715","Chapter 16","And he said to them, \\u201cYou are those who justify yourselves before men, but God knows your hearts. For what is exalted among men is an abomination in the sight of God. \\n\\t\\t\\t","16","Luke","58")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","16","142.596","Chapter 16","\\u201cThe Law and the Prophets were until John; since then the good news of the kingdom of God is preached, and everyone forces his way into it. \\n\\t\\t\\t","16","Luke","58")');
