tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","18","158.397","Chapter 16","\\u201cEveryone who divorces his wife and marries another commits adultery, and he who marries a woman divorced from her husband commits adultery. \\n\\t\\t\\t","16","Luke","58")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","19","167.728","Chapter 16","\\u201cThere was a rich man who was clothed in purple and fine linen and who feasted sumptuously every day. \\n\\t\\t\\t","16","Luke","58")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","20","175.066","Chapter 16","And at his gate was laid a poor man named Lazarus, covered with sores, \\n\\t\\t\\t","16","Luke","58")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","21","180.596","Chapter 16","who desired to be fed with what fell from the rich man\\u2019s table. Moreover, even the dogs came and licked his sores. \\n\\t\\t\\t","16","Luke","58")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","22","188.808","Chapter 16","The poor man died and was carried by the angels to Abraham\\u2019s side. The rich man also died and was buried, \\n\\t\\t\\t","16","Luke","58")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","23","197.49","Chapter 16","and in Hades, being in torment, he lifted up his eyes and saw Abraham far off and Lazarus at his side. \\n\\t\\t\\t","16","Luke","58")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","24","205.755","Chapter 16","And he called out, \\u2018Father Abraham, have mercy on me, and send Lazarus to dip the end of his finger in water and cool my tongue, for I am in anguish in this flame.\\u2019 \\n\\t\\t\\t","16","Luke","58")');
