tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","26","233.675","Chapter 16","And besides all this, between us and you a great chasm has been fixed, in order that those who would pass from here to you may not be able, and none may cross from there to us.\\u2019 \\n\\t\\t\\t","16","Luke","58")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","27","246.901","Chapter 16","And he said, \\u2018Then I beg you, father, to send him to my father\\u2019s house\\u2014 \\n\\t\\t\\t","16","Luke","58")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","28","252.848","Chapter 16","for I have five brothers\\u2014so that he may warn them, lest they also come into this place of torment.\\u2019 \\n\\t\\t\\t","16","Luke","58")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","29","259.49","Chapter 16","But Abraham said, \\u2018They have Moses and the Prophets; let them hear them.\\u2019 \\n\\t\\t\\t","16","Luke","58")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","30","266.662","Chapter 16","And he said, \\u2018No, father Abraham, but if someone goes to them from the dead, they will repent.\\u2019 \\n\\t\\t\\t","16","Luke","58")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","31","274","Chapter 16","He said to him, \\u2018If they do not hear Moses and the Prophets, neither will they be convinced if someone should rise from the dead.\\u2019\\u201d \\n\\t\\t\\n\\t\\t","16","Luke","58")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","1","3.106","Chapter 17","And he said to his disciples, \\u201cTemptations to sin are sure to come, but woe to the one through whom they come! \\n\\t\\t\\t","17","Luke","59")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","2","12.119","Chapter 17","It would be better for him if a millstone were hung around his neck and he were cast into the sea than that he should cause one of these little ones to sin. \\n\\t\\t\\t","17","Luke","59")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","3","22.238","Chapter 17","Pay attention to yourselves! If your brother sins, rebuke him, and if he repents, forgive him, \\n\\t\\t\\t","17","Luke","59")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","4","30.093","Chapter 17","and if he sins against you seven times in the day, and turns to you seven times, saying, \\u2018I repent,\\u2019you must forgive him.\\u201d \\n\\t\\t\\t","17","Luke","59")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","5","38.954","Chapter 17","The apostles said to the Lord, \\u201cIncrease our faith!\\u201d \\n\\t\\t\\t","17","Luke","59")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","6","44.252","Chapter 17","And the Lord said, \\u201cIf you had faith like a grain of mustard seed, you could say to this mulberry tree, \\u2018Be uprooted and planted in the sea,\\u2019and it would obey you. \\n\\t\\t\\t","17","Luke","59")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","7","56.424","Chapter 17","\\u201cWill any one of you who has a servant plowing or keeping sheep say to him when he has come in from the field, \\u2018Come at once and recline at table\\u2019? \\n\\t\\t\\t","17","Luke","59")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("57","Luke","8","66.265","Chapter 17","Will he not rather say to him, \\u2018Prepare supper for me, and dress properly, and serve me while I eat and drink, and afterward you will eat and drink\\u2019? \\n\\t\\t\\t","17","Luke","59")');
