tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","12","66.795","Chapter 5","They asked him, \\u201cWho is the man who said to you, \\u2018Take up your bed and walk\\u2019?\\u201d \\n\\t\\t\\t","5","John","70")');
