tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","16","97.596","Chapter 5","And this was why the Jews were persecuting Jesus, because he was doing these things on the Sabbath. \\n\\t\\t\\t","5","John","70")');
