tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","41","303.04","Chapter 5","I do not receive glory from people. \\n\\t\\t\\t","5","John","70")');
