tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","8","44.344","Chapter 6","One of his disciples, Andrew, Simon Peter\\u2019s brother, said to him, \\n\\t\\t\\t","6","John","71")');
