tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","10","54.649","Chapter 6","Jesus said, \\u201cHave the people sit down.\\u201d Now there was much grass in the place. So the men sat down, about five thousand in number. \\n\\t\\t\\t","6","John","71")');
