tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","14","89.623","Chapter 6","When the people saw the sign that he had done, they said, \\u201cThis is indeed the Prophet who is to come into the world!\\u201d \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","15","96.503","Chapter 6","Perceiving then that they were about to come and take him by force to make him king, Jesus withdrew again to the mountain by himself. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","16","104.715","Chapter 6","When evening came, his disciples went down to the sea, \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","17","109.411","Chapter 6","got into a boat, and started across the sea to Capernaum. It was now dark, and Jesus had not yet come to them. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","18","116.755","Chapter 6","The sea became rough because a strong wind was blowing. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","19","120.331","Chapter 6","When they had rowed about three or four miles, they saw Jesus walking on the sea and coming near the boat, and they were frightened. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","20","127.424","Chapter 6","But he said to them, \\u201cIt is I; do not be afraid.\\u201d \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","21","132.252","Chapter 6","Then they were glad to take him into the boat, and immediately the boat was at the land to which they were going. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","22","138.94","Chapter 6","On the next day the crowd that remained on the other side of the sea saw that there had been only one boat there, and that Jesus had not entered the boat with his disciples, but that his disciples had gone away alone. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","23","152.636","Chapter 6","Other boats from Tiberias came near the place where they had eaten the bread after the Lord had given thanks. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","24","158.397","Chapter 6","So when the crowd saw that Jesus was not there, nor his disciples, they themselves got into the boats and went to Capernaum, seeking Jesus. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","25","167.45","Chapter 6","When they found him on the other side of the sea, they said to him, \\u201cRabbi, when did you come here?\\u201d \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","26","173.954","Chapter 6","Jesus answered them, \\u201cTruly, truly, I say to you, you are seeking me, not because you saw signs, but because you ate your fill of the loaves. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","27","184.914","Chapter 6","Do not labor for the food that perishes, but for the food that endures to eternal life, which the Son of Man will give to you. For on him God the Father has set his seal.\\u201d \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","28","198.013","Chapter 6","Then they said to him, \\u201cWhat must we do, to be doing the works of God?\\u201d \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","29","203.45","Chapter 6","Jesus answered them, \\u201cThis is the work of God, that you believe in him whom he has sent.\\u201d \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","30","210.503","Chapter 6","So they said to him, \\u201cThen what sign do you do, that we may see and believe you? What work do you perform? \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","31","220.344","Chapter 6","Our fathers ate the manna in the wilderness; as it is written, \\u2018He gave them bread from heaven to eat.\\u2019\\u201d \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","32","226.887","Chapter 6","Jesus then said to them, \\u201cTruly, truly, I say to you, it was not Moses who gave you the bread from heaven, but my Father gives you the true bread from heaven. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","33","238.371","Chapter 6","For the bread of God is he who comes down from heaven and gives life to the world.\\u201d \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","34","243.98","Chapter 6","They said to him, \\u201cSir, give us this bread always.\\u201d \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","35","248.808","Chapter 6","Jesus said to them, \\u201cI am the bread of life; whoever comes to me shall not hunger, and whoever believes in me shall never thirst. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","36","258.94","Chapter 6","But I said to you that you have seen me and yet do not believe. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","37","264.053","Chapter 6","All that the Father gives me will come to me, and whoever comes to me I will never cast out. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","38","270.781","Chapter 6","For I have come down from heaven, not to do my own will but the will of him who sent me. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","39","277.278","Chapter 6","And this is the will of him who sent me, that I should lose nothing of all that he has given me, but raise it up on the last day. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","40","286.066","Chapter 6","For this is the will of my Father, that everyone who looks on the Son and believes in him should have eternal life, and I will raise him up on the last day.\\u201d \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","41","296.874","Chapter 6","So the Jews grumbled about him, because he said, \\u201cI am the bread that came down from heaven.\\u201d \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","42","303.609","Chapter 6","They said, \\u201cIs not this Jesus, the son of Joseph, whose father and mother we know? How does he now say, \\u2018I have come down from heaven\\u2019?\\u201d \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","43","314.026","Chapter 6","Jesus answered them, \\u201cDo not grumble among yourselves. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","44","318.424","Chapter 6","No one can come to me unless the Father who sent me draws him. And I will raise him up on the last day. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","45","325.768","Chapter 6","It is written in the Prophets, \\u2018And they will all be taught by God.\\u2019Everyone who has heard and learned from the Father comes to me\\u2014 \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","46","333.887","Chapter 6","not that anyone has seen the Father except he who is from God; he has seen the Father. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","47","340.252","Chapter 6","Truly, truly, I say to you, whoever believes has eternal life. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","48","345.503","Chapter 6","I am the bread of life. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","49","348.477","Chapter 6","Your fathers ate the manna in the wilderness, and they died. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","50","352.278","Chapter 6","This is the bread that comes down from heaven, so that one may eat of it and not die. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","51","357.901","Chapter 6","I am the living bread that came down from heaven. If anyone eats of this bread, he will live forever. And the bread that I will give for the life of the world is my flesh.\\u201d \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","52","369.795","Chapter 6","The Jews then disputed among themselves, saying, \\u201cHow can this man give us his flesh to eat?\\u201d \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","53","377.358","Chapter 6","So Jesus said to them, \\u201cTruly, truly, I say to you, unless you eat the flesh of the Son of Man and drink his blood, you have no life in you. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","54","387.94","Chapter 6","Whoever feeds on my flesh and drinks my blood has eternal life, and I will raise him up on the last day. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","55","395.106","Chapter 6","For my flesh is true food, and my blood is true drink. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","56","399.609","Chapter 6","Whoever feeds on my flesh and drinks my blood abides in me, and I in him. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","57","406.066","Chapter 6","As the living Father sent me, and I live because of the Father, so whoever feeds on me, he also will live because of me. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","58","415.437","Chapter 6","This is the bread that came down from heaven, not like the bread the fathers ate and died. Whoever feeds on this bread will live forever.\\u201d \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","59","424.821","Chapter 6","Jesus said these things in the synagogue, as he taught at Capernaum. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","60","429.093","Chapter 6","When many of his disciples heard it, they said, \\u201cThis is a hard saying; who can listen to it?\\u201d \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","61","436.013","Chapter 6","But Jesus, knowing in himself that his disciples were grumbling about this, said to them, \\u201cDo you take offense at this? \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","62","444.795","Chapter 6","Then what if you were to see the Son of Man ascending to where he was before? \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","63","449.901","Chapter 6","It is the Spirit who gives life; the flesh is no help at all. The words that I have spoken to you are spirit and life. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","64","458.954","Chapter 6","But there are some of you who do not believe.\\u201d (For Jesus knew from the beginning who those were who did not believe, and who it was who would betray him.) \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","65","469.119","Chapter 6","And he said, \\u201cThis is why I told you that no one can come to me unless it is granted him by the Father.\\u201d \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","66","476.318","Chapter 6","After this many of his disciples turned back and no longer walked with him. \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","67","481.146","Chapter 6","So Jesus said to the Twelve, \\u201cDo you want to go away as well?\\u201d \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","68","486.026","Chapter 6","Simon Peter answered him, \\u201cLord, to whom shall we go? You have the words of eternal life, \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","69","495.132","Chapter 6","and we have believed, and have come to know, that you are the Holy One of God.\\u201d \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","70","500.967","Chapter 6","Jesus answered them, \\u201cDid I not choose you, the Twelve? And yet one of you is a devil.\\u201d \\n\\t\\t\\t","6","John","71")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","71","508.318","Chapter 6","He spoke of Judas the son of Simon Iscariot, for he, one of the Twelve, was going to betray him. \\n\\t\\t\\n\\t\\t","6","John","71")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","1","3.106","Chapter 7","After this Jesus went about in Galilee. He would not go about in Judea, because the Jews were seeking to kill him. \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","2","10.543","Chapter 7","Now the Jews\\u2019 Feast of Booths was at hand. \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","3","13.609","Chapter 7","So his brothers said to him, \\u201cLeave here and go to Judea, that your disciples also may see the works you are doing. \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","4","20.477","Chapter 7","For no one works in secret if he seeks to be known openly. If you do these things, show yourself to the world.\\u201d \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","5","27.119","Chapter 7","For not even his brothers believed in him. \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","6","30.185","Chapter 7","Jesus said to them, \\u201cMy time has not yet come, but your time is always here. \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","7","37.013","Chapter 7","The world cannot hate you, but it hates me because I testify about it that its works are evil. \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","8","43.927","Chapter 7","You go up to the feast. I am not going up to this feast, for my time has not yet fully come.\\u201d \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","9","50.795","Chapter 7","After saying this, he remained in Galilee. \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","10","53.954","Chapter 7","But after his brothers had gone up to the feast, then he also went up, not publicly but in private. \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","11","60.371","Chapter 7","The Jews were looking for him at the feast, and saying, \\u201cWhere is he?\\u201d \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","12","65.662","Chapter 7","And there was much muttering about him among the people. While some said, \\u201cHe is a good man,\\u201d others said, \\u201cNo, he is leading the people astray.\\u201d \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","13","78.066","Chapter 7","Yet for fear of the Jews no one spoke openly of him. \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","14","82.053","Chapter 7","About the middle of the feast Jesus went up into the temple and began teaching. \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","15","86.371","Chapter 7","The Jews therefore marveled, saying, \\u201cHow is it that this man has learning, when he has never studied?\\u201d \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","16","93.199","Chapter 7","So Jesus answered them, \\u201cMy teaching is not mine, but his who sent me. \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","17","99.424","Chapter 7","If anyone\\u2019s will is to do God\\u2019s will, he will know whether the teaching is from God or whether I am speaking on my own authority. \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","18","107.742","Chapter 7","The one who speaks on his own authority seeks his own glory; but the one who seeks the glory of him who sent him is true, and in him there is no falsehood. \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","19","118.371","Chapter 7","Has not Moses given you the law? Yet none of you keeps the law. Why do you seek to kill me?\\u201d \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","20","125.702","Chapter 7","The crowd answered, \\u201cYou have a demon! Who is seeking to kill you?\\u201d \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","21","130.728","Chapter 7","Jesus answered them, \\u201cI did one work, and you all marvel at it. \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","22","136.49","Chapter 7","Moses gave you circumcision (not that it is from Moses, but from the fathers), and you circumcise a man on the Sabbath. \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","23","145.675","Chapter 7","If on the Sabbath a man receives circumcision, so that the law of Moses may not be broken, are you angry with me because on the Sabbath I made a man\\u2019s whole body well? \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","24","156.967","Chapter 7","Do not judge by appearances, but judge with right judgment.\\u201d \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","25","161.98","Chapter 7","Some of the people of Jerusalem therefore said, \\u201cIs not this the man whom they seek to kill? \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","26","168.291","Chapter 7","And here he is, speaking openly, and they say nothing to him! Can it be that the authorities really know that this is the Christ? \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","27","176.331","Chapter 7","But we know where this man comes from, and when the Christ appears, no one will know where he comes from.\\u201d \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","28","183.623","Chapter 7","So Jesus proclaimed, as he taught in the temple, \\u201cYou know me, and you know where I come from? But I have not come of my own accord. He who sent me is true, and him you do not know. \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","29","198.066","Chapter 7","I know him, for I come from him, and he sent me.\\u201d \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","30","202.94","Chapter 7","So they were seeking to arrest him, but no one laid a hand on him, because his hour had not yet come. \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","31","208.927","Chapter 7","Yet many of the people believed in him. They said, \\u201cWhen the Christ appears, will he do more signs than this man has done?\\u201d \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","32","216.543","Chapter 7","The Pharisees heard the crowd muttering these things about him, and the chief priests and Pharisees sent officers to arrest him. \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","33","224.066","Chapter 7","Jesus then said, \\u201cI will be with you a little longer, and then I am going to him who sent me. \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","34","231.291","Chapter 7","You will seek me and you will not find me. Where I am you cannot come.\\u201d \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","35","237.278","Chapter 7","The Jews said to one another, \\u201cWhere does this man intend to go that we will not find him? Does he intend to go to the Dispersion among the Greeks and teach the Greeks? \\n\\t\\t\\t","7","John","72")');
