tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","37","259.013","Chapter 7","On the last day of the feast, the great day, Jesus stood up and cried out, \\u201cIf anyone thirsts, let him come to me and drink. \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","38","270.159","Chapter 7","Whoever believes in me, as the Scripture has said, \\u2018Out of his heart will flow rivers of living water.\\u2019\\u201d \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","39","277.861","Chapter 7","Now this he said about the Spirit, whom those who believed in him were to receive, for as yet the Spirit had not been given, because Jesus was not yet glorified. \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","40","288.411","Chapter 7","When they heard these words, some of the people said, \\u201cThis really is the Prophet.\\u201d \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","41","293.887","Chapter 7","Others said, \\u201cThis is the Christ.\\u201d But some said, \\u201cIs the Christ to come from Galilee? \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","42","301.967","Chapter 7","Has not the Scripture said that the Christ comes from the offspring of David, and comes from Bethlehem, the village where David was?\\u201d \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","43","308.927","Chapter 7","So there was a division among the people over him. \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","44","312.464","Chapter 7","Some of them wanted to arrest him, but no one laid hands on him. \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","45","316.556","Chapter 7","The officers then came to the chief priests and Pharisees, who said to them, \\u201cWhy did you not bring him?\\u201d \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","46","323.384","Chapter 7","The officers answered, \\u201cNo one ever spoke like this man!\\u201d \\n\\t\\t\\t","7","John","72")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","47","328.252","Chapter 7","The Pharisees answered them, \\u201cHave you also been deceived? \\n\\t\\t\\t","7","John","72")');
