tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","49","336.199","Chapter 7","But this crowd that does not know the law is accursed.\\u201d \\n\\t\\t\\t","7","John","72")');
