tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","53","358.349","Chapter 7","[[They went each to his own house, \\n\\t\\t\\n\\t\\t","7","John","72")');

