tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","3","14.662","Chapter 8","The scribes and the Pharisees brought a woman who had been caught in adultery, and placing her in the midst \\n\\t\\t\\t","8","John","73")');
