tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","5","27.702","Chapter 8","Now in the Law Moses commanded us to stone such women. So what do you say?\\u201d \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","6","37.371","Chapter 8","This they said to test him, that they might have some charge to bring against him. Jesus bent down and wrote with his finger on the ground. \\n\\t\\t\\t","8","John","73")');
