tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","8","56.689","Chapter 8","And once more he bent down and wrote on the ground. \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","9","59.98","Chapter 8","But when they heard it, they went away one by one, beginning with the older ones, and Jesus was left alone with the woman standing before him. \\n\\t\\t\\t","8","John","73")');
