tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","11","76.834","Chapter 8","She said, \\u201cNo one, Lord.\\u201d And Jesus said, \\u201cNeither do I condemn you; go, and from now on sin no more.\\u201d]] \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","12","89.053","Chapter 8","Again Jesus spoke to them, saying, \\u201cI am the light of the world. Whoever follows me will not walk in darkness, but will have the light of life.\\u201d \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","13","101.914","Chapter 8","So the Pharisees said to him, \\u201cYou are bearing witness about yourself; your testimony is not true.\\u201d \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","14","108.742","Chapter 8","Jesus answered, \\u201cEven if I do bear witness about myself, my testimony is true, for I know where I came from and where I am going, but you do not know where I come from or where I am going. \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","15","124.305","Chapter 8","You judge according to the flesh; I judge no one. \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","16","128.106","Chapter 8","Yet even if I do judge, my judgment is true, for it is not I alone who judge, but I and the Father who sent me. \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","17","136.887","Chapter 8","In your Law it is written that the testimony of two people is true. \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","18","141.583","Chapter 8","I am the one who bears witness about myself, and the Father who sent me bears witness about me.\\u201d \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","19","147.662","Chapter 8","They said to him therefore, \\u201cWhere is your Father?\\u201d Jesus answered, \\u201cYou know neither me nor my Father. If you knew me, you would know my Father also.\\u201d \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","20","160.159","Chapter 8","These words he spoke in the treasury, as he taught in the temple; but no one arrested him, because his hour had not yet come. \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","21","168.185","Chapter 8","So he said to them again, \\u201cI am going away, and you will seek me, and you will die in your sin. Where I am going, you cannot come.\\u201d \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","22","178.543","Chapter 8","So the Jews said, \\u201cWill he kill himself, since he says, \\u2018Where I am going, you cannot come\\u2019?\\u201d \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","23","186.252","Chapter 8","He said to them, \\u201cYou are from below; I am from above. You are of this world; I am not of this world. \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","24","194.331","Chapter 8","I told you that you would die in your sins, for unless you believe that I am he you will die in your sins.\\u201d \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","25","203.199","Chapter 8","So they said to him, \\u201cWho are you?\\u201d Jesus said to them, \\u201cJust what I have been telling you from the beginning. \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","26","211.98","Chapter 8","I have much to say about you and much to judge, but he who sent me is true, and I declare to the world what I have heard from him.\\u201d \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","27","221.781","Chapter 8","They did not understand that he had been speaking to them about the Father. \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","28","226","Chapter 8","So Jesus said to them, \\u201cWhen you have lifted up the Son of Man, then you will know that I am he, and that I do nothing on my own authority, but speak just as the Father taught me. \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","29","237.927","Chapter 8","And he who sent me is with me. He has not left me alone, for I always do the things that are pleasing to him.\\u201d \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","30","246.57","Chapter 8","As he was saying these things, many believed in him. \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","31","250.331","Chapter 8","So Jesus said to the Jews who had believed in him, \\u201cIf you abide in my word, you are truly my disciples, \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","32","258.132","Chapter 8","and you will know the truth, and the truth will set you free.\\u201d \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","33","262.225","Chapter 8","They answered him, \\u201cWe are offspring of Abraham and have never been enslaved to anyone. How is it that you say, \\u2018You will become free\\u2019?\\u201d \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","34","271.967","Chapter 8","Jesus answered them, \\u201cTruly, truly, I say to you, everyone who commits sin is a slave to sin. \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","35","280.57","Chapter 8","The slave does not remain in the house forever; the son remains forever. \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","36","285.53","Chapter 8","So if the Son sets you free, you will be free indeed. \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","37","289.715","Chapter 8","I know that you are offspring of Abraham; yet you seek to kill me because my word finds no place in you. \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","38","297.093","Chapter 8","I speak of what I have seen with my Father, and you do what you have heard from your father.\\u201d \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","39","303.649","Chapter 8","They answered him, \\u201cAbraham is our father.\\u201d Jesus said to them, \\u201cIf you were Abraham\\u2019s children, you would be doing the works Abraham did, \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","40","314.464","Chapter 8","but now you seek to kill me, a man who has told you the truth that I heard from God. This is not what Abraham did. \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","41","322.821","Chapter 8","You are doing the works your father did.\\u201d They said to him, \\u201cWe were not born of sexual immorality. We have one Father\\u2014even God.\\u201d \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","42","335.503","Chapter 8","Jesus said to them, \\u201cIf God were your Father, you would love me, for I came from God and I am here. I came not of my own accord, but he sent me. \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","43","347.755","Chapter 8","Why do you not understand what I say? It is because you cannot bear to hear my word. \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","44","354.318","Chapter 8","You are of your father the devil, and your will is to do your father\\u2019s desires. He was a murderer from the beginning, and has nothing to do with the truth, because there is no truth in him. When he lies, he speaks out of his own character, for he is a liar and the father of lies. \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","45","373.675","Chapter 8","But because I tell the truth, you do not believe me. \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","46","377.848","Chapter 8","Which one of you convicts me of sin? If I tell the truth, why do you not believe me? \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","47","384.079","Chapter 8","Whoever is of God hears the words of God. The reason why you do not hear them is that you are not of God.\\u201d \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","48","391.781","Chapter 8","The Jews answered him, \\u201cAre we not right in saying that you are a Samaritan and have a demon?\\u201d \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","49","398.199","Chapter 8","Jesus answered, \\u201cI do not have a demon, but I honor my Father, and you dishonor me. \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","50","405.53","Chapter 8","Yet I do not seek my own glory; there is One who seeks it, and he is the judge. \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","51","411.662","Chapter 8","Truly, truly, I say to you, if anyone keeps my word, he will never see death.\\u201d \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","52","418.079","Chapter 8","The Jews said to him, \\u201cNow we know that you have a demon! Abraham died, as did the prophets, yet you say, \\u2018If anyone keeps my word, he will never taste death.\\u2019 \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","53","432.331","Chapter 8","Are you greater than our father Abraham, who died? And the prophets died! Who do you make yourself out to be?\\u201d \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","54","441.252","Chapter 8","Jesus answered, \\u201cIf I glorify myself, my glory is nothing. It is my Father who glorifies me, of whom you say, \\u2018He is our God.\\u2019 \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","55","452.026","Chapter 8","But you have not known him. I know him. If I were to say that I do not know him, I would be a liar like you, but I do know him and I keep his word. \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","56","462.199","Chapter 8","Your father Abraham rejoiced that he would see my day. He saw it and was glad.\\u201d \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","57","468.556","Chapter 8","So the Jews said to him, \\u201cYou are not yet fifty years old, and have you seen Abraham?\\u201d \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","58","475.146","Chapter 8","Jesus said to them, \\u201cTruly, truly, I say to you, before Abraham was, I am.\\u201d \\n\\t\\t\\t","8","John","73")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","59","483.742","Chapter 8","So they picked up stones to throw at him, but Jesus hid himself and went out of the temple. \\n\\t\\t\\n\\t\\t","8","John","73")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","1","3.106","Chapter 9","As he passed by, he saw a man blind from birth. \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","2","6.861","Chapter 9","And his disciples asked him, \\u201cRabbi, who sinned, this man or his parents, that he was born blind?\\u201d \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","3","13.371","Chapter 9","Jesus answered, \\u201cIt was not that this man sinned, or his parents, but that the works of God might be displayed in him. \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","4","21.781","Chapter 9","We must work the works of him who sent me while it is day; night is coming, when no one can work. \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","5","28.689","Chapter 9","As long as I am in the world, I am the light of the world.\\u201d \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","6","33.013","Chapter 9","Having said these things, he spat on the ground and made mud with the saliva. Then he anointed the man\\u2019s eyes with the mud \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","7","40.636","Chapter 9","and said to him, \\u201cGo, wash in the pool of Siloam\\u201d (which means Sent). So he went and washed and came back seeing. \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","8","49.596","Chapter 9","The neighbors and those who had seen him before as a beggar were saying, \\u201cIs this not the man who used to sit and beg?\\u201d \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","9","57.212","Chapter 9","Some said, \\u201cIt is he.\\u201d Others said, \\u201cNo, but he is like him.\\u201d He kept saying, \\u201cI am the man.\\u201d \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","10","68.079","Chapter 9","So they said to him, \\u201cThen how were your eyes opened?\\u201d \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","11","72.305","Chapter 9","He answered, \\u201cThe man called Jesus made mud and anointed my eyes and said to me, \\u2018Go to Siloam and wash.\\u2019 So I went and washed and received my sight.\\u201d \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","12","83.411","Chapter 9","They said to him, \\u201cWhere is he?\\u201d He said, \\u201cI do not know.\\u201d \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","13","89.808","Chapter 9","They brought to the Pharisees the man who had formerly been blind. \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","14","93.901","Chapter 9","Now it was a Sabbath day when Jesus made the mud and opened his eyes. \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","15","98.424","Chapter 9","So the Pharisees again asked him how he had received his sight. And he said to them, \\u201cHe put mud on my eyes, and I washed, and I see.\\u201d \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","16","107.623","Chapter 9","Some of the Pharisees said, \\u201cThis man is not from God, for he does not keep the Sabbath.\\u201d But others said, \\u201cHow can a man who is a sinner do such signs?\\u201d And there was a division among them. \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","17","120.742","Chapter 9","So they said again to the blind man, \\u201cWhat do you say about him, since he has opened your eyes?\\u201d He said, \\u201cHe is a prophet.\\u201d \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","18","131.887","Chapter 9","The Jews did not believe that he had been blind and had received his sight, until they called the parents of the man who had received his sight \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","19","139.623","Chapter 9","and asked them, \\u201cIs this your son, who you say was born blind? How then does he now see?\\u201d \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","20","148.689","Chapter 9","His parents answered, \\u201cWe know that this is our son and that he was born blind. \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","21","155","Chapter 9","But how he now sees we do not know, nor do we know who opened his eyes. Ask him; he is of age. He will speak for himself.\\u201d \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","22","165.861","Chapter 9","(His parents said these things because they feared the Jews, for the Jews had already agreed that if anyone should confess Jesus to be Christ, he was to be put out of the synagogue.) \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","23","176.781","Chapter 9","Therefore his parents said, \\u201cHe is of age; ask him.\\u201d \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","24","180.583","Chapter 9","So for the second time they called the man who had been blind and said to him, \\u201cGive glory to God. We know that this man is a sinner.\\u201d \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","25","189.185","Chapter 9","He answered, \\u201cWhether he is a sinner I do not know. One thing I do know, that though I was blind, now I see.\\u201d \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","26","197.675","Chapter 9","They said to him, \\u201cWhat did he do to you? How did he open your eyes?\\u201d \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","27","204.132","Chapter 9","He answered them, \\u201cI have told you already, and you would not listen. Why do you want to hear it again? Do you also want to become his disciples?\\u201d \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","28","214.768","Chapter 9","And they reviled him, saying, \\u201cYou are his disciple, but we are disciples of Moses. \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","29","221.318","Chapter 9","We know that God has spoken to Moses, but as for this man, we do not know where he comes from.\\u201d \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","30","227.45","Chapter 9","The man answered, \\u201cWhy, this is an amazing thing! You do not know where he comes from, and yet he opened my eyes. \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","31","236.04","Chapter 9","We know that God does not listen to sinners, but if anyone is a worshiper of God and does his will, God listens to him. \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","32","244.305","Chapter 9","Never since the world began has it been heard that anyone opened the eyes of a man born blind. \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","33","253.225","Chapter 9","If this man were not from God, he could do nothing.\\u201d \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","34","256.384","Chapter 9","They answered him, \\u201cYou were born in utter sin, and would you teach us?\\u201d And they cast him out. \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","35","264.371","Chapter 9","Jesus heard that they had cast him out, and having found him he said, \\u201cDo you believe in the Son of Man?\\u201d \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","36","271.57","Chapter 9","He answered, \\u201cAnd who is he, sir, that I may believe in him?\\u201d \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","37","277.093","Chapter 9","Jesus said to him, \\u201cYou have seen him, and it is he who is speaking to you.\\u201d \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","38","282.98","Chapter 9","He said, \\u201cLord, I believe,\\u201d and he worshiped him. \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","39","288.834","Chapter 9","Jesus said, \\u201cFor judgment I came into this world, that those who do not see may see, and those who see may become blind.\\u201d \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","40","298.079","Chapter 9","Some of the Pharisees near him heard these things, and said to him, \\u201cAre we also blind?\\u201d \\n\\t\\t\\t","9","John","74")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","41","304.119","Chapter 9","Jesus said to them, \\u201cIf you were blind, you would have no guilt; but now that you say, \\u2018We see,\\u2019your guilt remains. \\n\\t\\t\\n\\t\\t","9","John","74")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","1","2.556","Chapter 10","\\u201cTruly, truly, I say to you, he who does not enter the sheepfold by the door but climbs in by another way, that man is a thief and a robber. \\n\\t\\t\\t","10","John","75")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","2","12.795","Chapter 10","But he who enters by the door is the shepherd of the sheep. \\n\\t\\t\\t","10","John","75")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","3","17.371","Chapter 10","To him the gatekeeper opens. The sheep hear his voice, and he calls his own sheep by name and leads them out. \\n\\t\\t\\t","10","John","75")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","4","24.702","Chapter 10","When he has brought out all his own, he goes before them, and the sheep follow him, for they know his voice. \\n\\t\\t\\t","10","John","75")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","5","31.623","Chapter 10","A stranger they will not follow, but they will flee from him, for they do not know the voice of strangers.\\u201d \\n\\t\\t\\t","10","John","75")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","6","37.927","Chapter 10","This figure of speech Jesus used with them, but they did not understand what he was saying to them. \\n\\t\\t\\t","10","John","75")');
