tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","12","88.517","Chapter 15","\\u201cThis is my commandment, that you love one another as I have loved you. \\n\\t\\t\\t","15","John","80")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","13","93.384","Chapter 15","Greater love has no one than this, that someone lay down his life for his friends. \\n\\t\\t\\t","15","John","80")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","14","99.013","Chapter 15","You are my friends if you do what I command you. \\n\\t\\t\\t","15","John","80")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","15","102.954","Chapter 15","No longer do I call you servants, for the servant does not know what his master is doing; but I have called you friends, for all that I have heard from my Father I have made known to you. \\n\\t\\t\\t","15","John","80")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","16","115.45","Chapter 15","You did not choose me, but I chose you and appointed you that you should go and bear fruit and that your fruit should abide, so that whatever you ask the Father in my name, he may give it to you. \\n\\t\\t\\t","15","John","80")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","17","127.609","Chapter 15","These things I command you, so that you will love one another. \\n\\t\\t\\t","15","John","80")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","18","132.265","Chapter 15","\\u201cIf the world hates you, know that it has hated me before it hated you. \\n\\t\\t\\t","15","John","80")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","19","137.742","Chapter 15","If you were of the world, the world would love you as its own; but because you are not of the world, but I chose you out of the world, therefore the world hates you. \\n\\t\\t\\t","15","John","80")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","20","148.093","Chapter 15","Remember the word that I said to you: \\u2018A servant is not greater than his master.\\u2019If they persecuted me, they will also persecute you. If they kept my word, they will also keep yours. \\n\\t\\t\\t","15","John","80")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","21","161.702","Chapter 15","But all these things they will do to you on account of my name, because they do not know him who sent me. \\n\\t\\t\\t","15","John","80")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","22","168.199","Chapter 15","If I had not come and spoken to them, they would not have been guilty of sin, but now they have no excuse for their sin. \\n\\t\\t\\t","15","John","80")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","23","176.609","Chapter 15","Whoever hates me hates my Father also. \\n\\t\\t\\t","15","John","80")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","24","180.225","Chapter 15","If I had not done among them the works that no one else did, they would not be guilty of sin, but now they have seen and hated both me and my Father. \\n\\t\\t\\t","15","John","80")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","25","189.477","Chapter 15","But the word that is written in their Law must be fulfilled: \\u2018They hated me without a cause.\\u2019 \\n\\t\\t\\t","15","John","80")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","26","196.755","Chapter 15","\\u201cBut when the Helper comes, whom I will send to you from the Father, the Spirit of truth, who proceeds from the Father, he will bear witness about me. \\n\\t\\t\\t","15","John","80")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","27","206.927","Chapter 15","And you also will bear witness, because you have been with me from the beginning. \\n\\t\\t\\n\\t\\t","15","John","80")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","1","3.344","Chapter 16","\\u201cI have said all these things to you to keep you from falling away. \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","2","7.477","Chapter 16","They will put you out of the synagogues. Indeed, the hour is coming when whoever kills you will think he is offering service to God. \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","3","15.649","Chapter 16","And they will do these things because they have not known the Father, nor me. \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","4","20.477","Chapter 16","But I have said these things to you, that when their hour comes you may remember that I told them to you. \\u201cI did not say these things to you from the beginning, because I was with you. \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","5","32.132","Chapter 16","But now I am going to him who sent me, and none of you asks me, \\u2018Where are you going?\\u2019 \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","6","37.238","Chapter 16","But because I have said these things to you, sorrow has filled your heart. \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","7","41.517","Chapter 16","Nevertheless, I tell you the truth: it is to your advantage that I go away, for if I do not go away, the Helper will not come to you. But if I go, I will send him to you. \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","8","53.914","Chapter 16","And when he comes, he will convict the world concerning sin and righteousness and judgment: \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","9","60.093","Chapter 16","concerning sin, because they do not believe in me; \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","10","63.384","Chapter 16","concerning righteousness, because I go to the Father, and you will see me no longer; \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","11","68.225","Chapter 16","concerning judgment, because the ruler of this world is judged. \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","12","72.861","Chapter 16","\\u201cI still have many things to say to you, but you cannot bear them now. \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","13","78.106","Chapter 16","When the Spirit of truth comes, he will guide you into all the truth, for he will not speak on his own authority, but whatever he hears he will speak, and he will declare to you the things that are to come. \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","14","92.185","Chapter 16","He will glorify me, for he will take what is mine and declare it to you. \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","15","98.45","Chapter 16","All that the Father has is mine; therefore I said that he will take what is mine and declare it to you. \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","16","104.623","Chapter 16","\\u201cA little while, and you will see me no longer; and again a little while, and you will see me.\\u201d \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","17","111.04","Chapter 16","So some of his disciples said to one another, \\u201cWhat is this that he says to us, \\u2018A little while, and you will not see me, and again a little while, and you will see me\\u2019; and, \\u2018because I am going to the Father\\u2019?\\u201d \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","18","127.146","Chapter 16","So they were saying, \\u201cWhat does he mean by \\u2018a little while\\u2019? We do not know what he is talking about.\\u201d \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","19","134.715","Chapter 16","Jesus knew that they wanted to ask him, so he said to them, \\u201cIs this what you are asking yourselves, what I meant by saying, \\u2018A little while and you will not see me, and again a little while and you will see me\\u2019? \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","20","148.093","Chapter 16","Truly, truly, I say to you, you will weep and lament, but the world will rejoice. You will be sorrowful, but your sorrow will turn into joy. \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","21","158.728","Chapter 16","When a woman is giving birth, she has sorrow because her hour has come, but when she has delivered the baby, she no longer remembers the anguish, for joy that a human being has been born into the world. \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","22","170.848","Chapter 16","So also you have sorrow now, but I will see you again, and your hearts will rejoice, and no one will take your joy from you. \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","23","179.53","Chapter 16","In that day you will ask nothing of me. Truly, truly, I say to you, whatever you ask of the Father in my name, he will give it to you. \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","24","188.49","Chapter 16","Until now you have asked nothing in my name. Ask, and you will receive, that your joy may be full. \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","25","195.742","Chapter 16","\\u201cI have said these things to you in figures of speech. The hour is coming when I will no longer speak to you in figures of speech but will tell you plainly about the Father. \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","26","205.914","Chapter 16","In that day you will ask in my name, and I do not say to you that I will ask the Father on your behalf; \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","27","211.623","Chapter 16","for the Father himself loves you, because you have loved me and have believed that I came from God. \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","28","218.358","Chapter 16","I came from the Father and have come into the world, and now I am leaving the world and going to the Father.\\u201d \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","29","227","Chapter 16","His disciples said, \\u201cAh, now you are speaking plainly and not using figurative speech! \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","30","233.45","Chapter 16","Now we know that you know all things and do not need anyone to question you; this is why we believe that you came from God.\\u201d \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","31","243.159","Chapter 16","Jesus answered them, \\u201cDo you now believe? \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","32","246.914","Chapter 16","Behold, the hour is coming, indeed it has come, when you will be scattered, each to his own home, and will leave me alone. Yet I am not alone, for the Father is with me. \\n\\t\\t\\t","16","John","81")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","33","259.821","Chapter 16","I have said these things to you, that in me you may have peace. In the world you will have tribulation. But take heart; I have overcome the world.\\u201d \\n\\t\\t\\n\\t\\t","16","John","81")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","1","3.344","Chapter 17","When Jesus had spoken these words, he lifted up his eyes to heaven, and said, \\u201cFather, the hour has come; glorify your Son that the Son may glorify you, \\n\\t\\t\\t","17","John","82")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","2","15.04","Chapter 17","since you have given him authority over all flesh, to give eternal life to all whom you have given him. \\n\\t\\t\\t","17","John","82")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","3","21.636","Chapter 17","And this is eternal life, that they know you the only true God, and Jesus Christ whom you have sent. \\n\\t\\t\\t","17","John","82")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","4","28.609","Chapter 17","I glorified you on earth, having accomplished the work that you gave me to do. \\n\\t\\t\\t","17","John","82")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","5","34.172","Chapter 17","And now, Father, glorify me in your own presence with the glory that I had with you before the world existed. \\n\\t\\t\\t","17","John","82")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","6","41.556","Chapter 17","\\u201cI have manifested your name to the people whom you gave me out of the world. Yours they were, and you gave them to me, and they have kept your word. \\n\\t\\t\\t","17","John","82")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","7","50.94","Chapter 17","Now they know that everything that you have given me is from you. \\n\\t\\t\\t","17","John","82")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","8","54.384","Chapter 17","For I have given them the words that you gave me, and they have received them and have come to know in truth that I came from you; and they have believed that you sent me. \\n\\t\\t\\t","17","John","82")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","9","65.199","Chapter 17","I am praying for them. I am not praying for the world but for those whom you have given me, for they are yours. \\n\\t\\t\\t","17","John","82")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","10","73.424","Chapter 17","All mine are yours, and yours are mine, and I am glorified in them. \\n\\t\\t\\t","17","John","82")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","11","78.437","Chapter 17","And I am no longer in the world, but they are in the world, and I am coming to you. Holy Father, keep them in your name, which you have given me, that they may be one, even as we are one. \\n\\t\\t\\t","17","John","82")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","12","91.477","Chapter 17","While I was with them, I kept them in your name, which you have given me. I have guarded them, and not one of them has been lost except the son of destruction, that the Scripture might be fulfilled. \\n\\t\\t\\t","17","John","82")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","13","103.185","Chapter 17","But now I am coming to you, and these things I speak in the world, that they may have my joy fulfilled in themselves. \\n\\t\\t\\t","17","John","82")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","14","111.781","Chapter 17","I have given them your word, and the world has hated them because they are not of the world, just as I am not of the world. \\n\\t\\t\\t","17","John","82")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","15","118.702","Chapter 17","I do not ask that you take them out of the world, but that you keep them from the evil one. \\n\\t\\t\\t","17","John","82")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","16","123.477","Chapter 17","They are not of the world, just as I am not of the world. \\n\\t\\t\\t","17","John","82")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","17","126.874","Chapter 17","Sanctify them in the truth; your word is truth. \\n\\t\\t\\t","17","John","82")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","18","131.517","Chapter 17","As you sent me into the world, so I have sent them into the world. \\n\\t\\t\\t","17","John","82")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","19","135.649","Chapter 17","And for their sake I consecrate myself, that they also may be sanctified in truth. \\n\\t\\t\\t","17","John","82")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","20","141.728","Chapter 17","\\u201cI do not ask for these only, but also for those who will believe in me through their word, \\n\\t\\t\\t","17","John","82")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","21","147.901","Chapter 17","that they may all be one, just as you, Father, are in me, and I in you, that they also may be in us, so that the world may believe that you have sent me. \\n\\t\\t\\t","17","John","82")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","22","158.318","Chapter 17","The glory that you have given me I have given to them, that they may be one even as we are one, \\n\\t\\t\\t","17","John","82")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","23","164.344","Chapter 17","I in them and you in me, that they may become perfectly one, so that the world may know that you sent me and loved them even as you loved me. \\n\\t\\t\\t","17","John","82")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","24","174.609","Chapter 17","Father, I desire that they also, whom you have given me, may be with me where I am, to see my glory that you have given me because you loved me before the foundation of the world. \\n\\t\\t\\t","17","John","82")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","25","186.728","Chapter 17","O righteous Father, even though the world does not know you, I know you, and these know that you have sent me. \\n\\t\\t\\t","17","John","82")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","26","195.185","Chapter 17","I made known to them your name, and I will continue to make it known, that the love with which you have loved me may be in them, and I in them.\\u201d \\n\\t\\t\\n\\t\\t","17","John","82")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","1","3.291","Chapter 18","When Jesus had spoken these words, he went out with his disciples across the Kidron Valley, where there was a garden, which he and his disciples entered. \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","2","12.344","Chapter 18","Now Judas, who betrayed him, also knew the place, for Jesus often met there with his disciples. \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","3","19.265","Chapter 18","So Judas, having procured a band of soldiers and some officers from the chief priests and the Pharisees, went there with lanterns and torches and weapons. \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","4","28.609","Chapter 18","Then Jesus, knowing all that would happen to him, came forward and said to them, \\u201cWhom do you seek?\\u201d \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","5","36.079","Chapter 18","They answered him, \\u201cJesus of Nazareth.\\u201d Jesus said to them, \\u201cI am he.\\u201d Judas, who betrayed him, was standing with them. \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","6","48.384","Chapter 18","When Jesus said to them, \\u201cI am he,\\u201d they drew back and fell to the ground. \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","7","53.675","Chapter 18","So he asked them again, \\u201cWhom do you seek?\\u201d And they said, \\u201cJesus of Nazareth.\\u201d \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","8","61.477","Chapter 18","Jesus answered, \\u201cI told you that I am he. So, if you seek me, let these men go.\\u201d \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","9","68.675","Chapter 18","This was to fulfill the word that he had spoken: \\u201cOf those whom you gave me I have lost not one.\\u201d \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","10","75.464","Chapter 18","Then Simon Peter, having a sword, drew it and struck the high priest\\u2019s servant and cut off his right ear. (The servant\\u2019s name was Malchus.) \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","11","83.675","Chapter 18","So Jesus said to Peter, \\u201cPut your sword into its sheath; shall I not drink the cup that the Father has given me?\\u201d \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","12","91.344","Chapter 18","So the band of soldiers and their captain and the officers of the Jews arrested Jesus and bound him. \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","13","97.119","Chapter 18","First they led him to Annas, for he was the father-in-law of Caiaphas, who was high priest that year. \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","14","102.914","Chapter 18","It was Caiaphas who had advised the Jews that it would be expedient that one man should die for the people. \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","15","109.424","Chapter 18","Simon Peter followed Jesus, and so did another disciple. Since that disciple was known to the high priest, he entered with Jesus into the court of the high priest, \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","16","119.636","Chapter 18","but Peter stood outside at the door. So the other disciple, who was known to the high priest, went out and spoke to the servant girl who kept watch at the door, and brought Peter in. \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","17","131.305","Chapter 18","The servant girl at the door said to Peter, \\u201cYou also are not one of this man\\u2019s disciples, are you?\\u201d He said, \\u201cI am not.\\u201d \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","18","141.57","Chapter 18","Now the servants and officers had made a charcoal fire, because it was cold, and they were standing and warming themselves. Peter also was with them, standing and warming himself. \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","19","152.212","Chapter 18","The high priest then questioned Jesus about his disciples and his teaching. \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","20","156.57","Chapter 18","Jesus answered him, \\u201cI have spoken openly to the world. I have always taught in synagogues and in the temple, where all Jews come together. I have said nothing in secret. \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","21","168","Chapter 18","Why do you ask me? Ask those who have heard me what I said to them; they know what I said.\\u201d \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","22","174.596","Chapter 18","When he had said these things, one of the officers standing by struck Jesus with his hand, saying, \\u201cIs that how you answer the high priest?\\u201d \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","23","183.967","Chapter 18","Jesus answered him, \\u201cIf what I said is wrong, bear witness about the wrong; but if what I said is right, why do you strike me?\\u201d \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","24","194.424","Chapter 18","Annas then sent him bound to Caiaphas the high priest. \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","25","198.225","Chapter 18","Now Simon Peter was standing and warming himself. So they said to him, \\u201cYou also are not one of his disciples, are you?\\u201d He denied it and said, \\u201cI am not.\\u201d \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","26","210.119","Chapter 18","One of the servants of the high priest, a relative of the man whose ear Peter had cut off, asked, \\u201cDid I not see you in the garden with him?\\u201d \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","27","218.98","Chapter 18","Peter again denied it, and at once a rooster crowed. \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","28","223.914","Chapter 18","Then they led Jesus from the house of Caiaphas to the governor\\u2019s headquarters. It was early morning. They themselves did not enter the governor\\u2019s headquarters, so that they would not be defiled, but could eat the Passover. \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","29","236.954","Chapter 18","So Pilate went outside to them and said, \\u201cWhat accusation do you bring against this man?\\u201d \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","30","244.026","Chapter 18","They answered him, \\u201cIf this man were not doing evil, we would not have delivered him over to you.\\u201d \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","31","250.146","Chapter 18","Pilate said to them, \\u201cTake him yourselves and judge him by your own law.\\u201d The Jews said to him, \\u201cIt is not lawful for us to put anyone to death.\\u201d \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","32","261.384","Chapter 18","This was to fulfill the word that Jesus had spoken to show by what kind of death he was going to die. \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","33","267.887","Chapter 18","So Pilate entered his headquarters again and called Jesus and said to him, \\u201cAre you the King of the Jews?\\u201d \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","34","275.781","Chapter 18","Jesus answered, \\u201cDo you say this of your own accord, or did others say it to you about me?\\u201d \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","35","282.57","Chapter 18","Pilate answered, \\u201cAm I a Jew? Your own nation and the chief priests have delivered you over to me. What have you done?\\u201d \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","36","293.477","Chapter 18","Jesus answered, \\u201cMy kingdom is not of this world. If my kingdom were of this world, my servants would have been fighting, that I might not be delivered over to the Jews. But my kingdom is not from the world.\\u201d \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","37","308.384","Chapter 18","Then Pilate said to him, \\u201cSo you are a king?\\u201d Jesus answered, \\u201cYou say that I am a king. For this purpose I was born and for this purpose I have come into the world\\u2014to bear witness to the truth. Everyone who is of the truth listens to my voice.\\u201d \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","38","328.212","Chapter 18","Pilate said to him, \\u201cWhat is truth?\\u201d After he had said this, he went back outside to the Jews and told them, \\u201cI find no guilt in him. \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","39","340.57","Chapter 18","But you have a custom that I should release one man for you at the Passover. So do you want me to release to you the King of the Jews?\\u201d \\n\\t\\t\\t","18","John","83")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","40","351.94","Chapter 18","They cried out again, \\u201cNot this man, but Barabbas!\\u201d Now Barabbas was a robber. \\n\\t\\t\\n\\t\\t","18","John","83")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","1","3.384","Chapter 19","Then Pilate took Jesus and flogged him. \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","2","6.596","Chapter 19","And the soldiers twisted together a crown of thorns and put it on his head and arrayed him in a purple robe. \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","3","13","Chapter 19","They came up to him, saying, \\u201cHail, King of the Jews!\\u201d and struck him with their hands. \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","4","22.013","Chapter 19","Pilate went out again and said to them, \\u201cSee, I am bringing him out to you that you may know that I find no guilt in him.\\u201d \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","5","32.411","Chapter 19","So Jesus came out, wearing the crown of thorns and the purple robe. Pilate said to them, \\u201cBehold the man!\\u201d \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","6","41.98","Chapter 19","When the chief priests and the officers saw him, they cried out, \\u201cCrucify him, crucify him!\\u201d Pilate said to them, \\u201cTake him yourselves and crucify him, for I find no guilt in him.\\u201d \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","7","59.901","Chapter 19","The Jews answered him, \\u201cWe have a law, and according to that law he ought to die because he has made himself the Son of God.\\u201d \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","8","71.424","Chapter 19","When Pilate heard this statement, he was even more afraid. \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","9","76.119","Chapter 19","He entered his headquarters again and said to Jesus, \\u201cWhere are you from?\\u201d But Jesus gave him no answer. \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","10","84.238","Chapter 19","So Pilate said to him, \\u201cYou will not speak to me? Do you not know that I have authority to release you and authority to crucify you?\\u201d \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","11","96.874","Chapter 19","Jesus answered him, \\u201cYou would have no authority over me at all unless it had been given you from above. Therefore he who delivered me over to you has the greater sin.\\u201d \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","12","108.755","Chapter 19","From then on Pilate sought to release him, but the Jews cried out, \\u201cIf you release this man, you are not Caesar\\u2019s friend. Everyone who makes himself a king opposes Caesar.\\u201d \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","13","123.159","Chapter 19","So when Pilate heard these words, he brought Jesus out and sat down on the judgment seat at a place called The Stone Pavement, and in Aramaic Gabbatha. \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","14","133.093","Chapter 19","Now it was the day of Preparation of the Passover. It was about the sixth hour. He said to the Jews, \\u201cBehold your King!\\u201d \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","15","144.57","Chapter 19","They cried out, \\u201cAway with him, away with him, crucify him!\\u201d Pilate said to them, \\u201cShall I crucify your King?\\u201d The chief priests answered, \\u201cWe have no king but Caesar.\\u201d \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","16","162.901","Chapter 19","So he delivered him over to them to be crucified. So they took Jesus, \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","17","168.94","Chapter 19","and he went out, bearing his own cross, to the place called The Place of a Skull, which in Aramaic is called Golgotha. \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","18","177.252","Chapter 19","There they crucified him, and with him two others, one on either side, and Jesus between them. \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","19","183.94","Chapter 19","Pilate also wrote an inscription and put it on the cross. It read, \\u201cJesus of Nazareth, the King of the Jews.\\u201d \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","20","192.026","Chapter 19","Many of the Jews read this inscription, for the place where Jesus was crucified was near the city, and it was written in Aramaic, in Latin, and in Greek. \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","21","201.583","Chapter 19","So the chief priests of the Jews said to Pilate, \\u201cDo not write, \\u2018The King of the Jews,\\u2019but rather, \\u2018This man said, I am King of the Jews.\\u2019\\u201d \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","22","211.57","Chapter 19","Pilate answered, \\u201cWhat I have written I have written.\\u201d \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","23","215.662","Chapter 19","When the soldiers had crucified Jesus, they took his garments and divided them into four parts, one part for each soldier; also his tunic. But the tunic was seamless, woven in one piece from top to bottom, \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","24","229.821","Chapter 19","so they said to one another, \\u201cLet us not tear it, but cast lots for it to see whose it shall be.\\u201d This was to fulfill the Scripture which says, \\u201cThey divided my garments among them, and for my clothing they cast lots.\\u201d So the soldiers did these things, \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","25","249.093","Chapter 19","but standing by the cross of Jesus were his mother and his mother\\u2019s sister, Mary the wife of Clopas, and Mary Magdalene. \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","26","257.45","Chapter 19","When Jesus saw his mother and the disciple whom he loved standing nearby, he said to his mother, \\u201cWoman, behold, your son!\\u201d \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","27","270.318","Chapter 19","Then he said to the disciple, \\u201cBehold, your mother!\\u201dAnd from that hour the disciple took her to his own home. \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","28","281.795","Chapter 19","After this, Jesus, knowing that all was now finished, said (to fulfill the Scripture), \\u201cI thirst.\\u201d \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","29","292.662","Chapter 19","A jar full of sour wine stood there, so they put a sponge full of the sour wine on a hyssop branch and held it to his mouth. \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","30","301.437","Chapter 19","When Jesus had received the sour wine, he said, \\u201cIt is finished,\\u201d and he bowed his head and gave up his spirit. \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","31","317.318","Chapter 19","Since it was the day of Preparation, and so that the bodies would not remain on the cross on the Sabbath (for that Sabbath was a high day), the Jews asked Pilate that their legs might be broken and that they might be taken away. \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","32","330.874","Chapter 19","So the soldiers came and broke the legs of the first, and of the other who had been crucified with him. \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","33","337.609","Chapter 19","But when they came to Jesus and saw that he was already dead, they did not break his legs. \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","34","342.715","Chapter 19","But one of the soldiers pierced his side with a spear, and at once there came out blood and water. \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","35","349.543","Chapter 19","He who saw it has borne witness\\u2014his testimony is true, and he knows that he is telling the truth\\u2014that you also may believe. \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","36","358.689","Chapter 19","For these things took place that the Scripture might be fulfilled: \\u201cNot one of his bones will be broken.\\u201d \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","37","366.04","Chapter 19","And again another Scripture says, \\u201cThey will look on him whom they have pierced.\\u201d \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","38","372.437","Chapter 19","After these things Joseph of Arimathea, who was a disciple of Jesus, but secretly for fear of the Jews, asked Pilate that he might take away the body of Jesus, and Pilate gave him permission. So he came and took away his body. \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","39","388.689","Chapter 19","Nicodemus also, who earlier had come to Jesus by night, came bringing a mixture of myrrh and aloes, about seventy-five pounds in weight. \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","40","398.358","Chapter 19","So they took the body of Jesus and bound it in linen cloths with the spices, as is the burial custom of the Jews. \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","41","406.477","Chapter 19","Now in the place where he was crucified there was a garden, and in the garden a new tomb in which no one had yet been laid. \\n\\t\\t\\t","19","John","84")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","42","414.278","Chapter 19","So because of the Jewish day of Preparation, since the tomb was close at hand, they laid Jesus there. \\n\\t\\t\\n\\t\\t","19","John","84")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","1","2.874","Chapter 20","Now on the first day of the week Mary Magdalene came to the tomb early, while it was still dark, and saw that the stone had been taken away from the tomb. \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","2","12.026","Chapter 20","So she ran and went to Simon Peter and the other disciple, the one whom Jesus loved, and said to them, \\u201cThey have taken the Lord out of the tomb, and we do not know where they have laid him.\\u201d \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","3","23.954","Chapter 20","So Peter went out with the other disciple, and they were going toward the tomb. \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","4","28.517","Chapter 20","Both of them were running together, but the other disciple outran Peter and reached the tomb first. \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","5","34.04","Chapter 20","And stooping to look in, he saw the linen cloths lying there, but he did not go in. \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","6","39.57","Chapter 20","Then Simon Peter came, following him, and went into the tomb. He saw the linen cloths lying there, \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","7","45.967","Chapter 20","and the face cloth, which had been on Jesus\\u2019 head, not lying with the linen cloths but folded up in a place by itself. \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","8","53.636","Chapter 20","Then the other disciple, who had reached the tomb first, also went in, and he saw and believed; \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","9","60.093","Chapter 20","for as yet they did not understand the Scripture, that he must rise from the dead. \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","10","64.914","Chapter 20","Then the disciples went back to their homes. \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","11","68.132","Chapter 20","But Mary stood weeping outside the tomb, and as she wept she stooped to look into the tomb. \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","12","73.967","Chapter 20","And she saw two angels in white, sitting where the body of Jesus had lain, one at the head and one at the feet. \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","13","81.543","Chapter 20","They said to her, \\u201cWoman, why are you weeping?\\u201d She said to them, \\u201cThey have taken away my Lord, and I do not know where they have laid him.\\u201d \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","14","93.57","Chapter 20","Having said this, she turned around and saw Jesus standing, but she did not know that it was Jesus. \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","15","100.397","Chapter 20","Jesus said to her, \\u201cWoman, why are you weeping? Whom are you seeking?\\u201d Supposing him to be the gardener, she said to him, \\u201cSir, if you have carried him away, tell me where you have laid him, and I will take him away.\\u201d \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","16","117.954","Chapter 20","Jesus said to her, \\u201cMary.\\u201d She turned and said to him in Aramaic, \\u201cRabboni!\\u201d (which means Teacher). \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","17","127.702","Chapter 20","Jesus said to her, \\u201cDo not cling to me, for I have not yet ascended to the Father; but go to my brothers and say to them, \\u2018I am ascending to my Father and your Father, to my God and your God.\\u2019\\u201d \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","18","142.199","Chapter 20","Mary Magdalene went and announced to the disciples, \\u201cI have seen the Lord\\u201d\\u2014and that he had said these things to her. \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","19","151.212","Chapter 20","On the evening of that day, the first day of the week, the doors being locked where the disciples were for fear of the Jews, Jesus came and stood among them and said to them, \\u201cPeace be with you.\\u201d \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","20","164.517","Chapter 20","When he had said this, he showed them his hands and his side. Then the disciples were glad when they saw the Lord. \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","21","172.172","Chapter 20","Jesus said to them again, \\u201cPeace be with you. As the Father has sent me, even so I am sending you.\\u201d \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","22","181.318","Chapter 20","And when he had said this, he breathed on them and said to them, \\u201cReceive the Holy Spirit. \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","23","188.702","Chapter 20","If you forgive the sins of any, they are forgiven them; if you withhold forgiveness from any, it is withheld.\\u201d \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","24","197.066","Chapter 20","Now Thomas, one of the Twelve, called the Twin, was not with them when Jesus came. \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","25","203.053","Chapter 20","So the other disciples told him, \\u201cWe have seen the Lord.\\u201d But he said to them, \\u201cUnless I see in his hands the mark of the nails, and place my finger into the mark of the nails, and place my hand into his side, I will never believe.\\u201d \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","26","220.927","Chapter 20","Eight days later, his disciples were inside again, and Thomas was with them. Although the doors were locked, Jesus came and stood among them and said, \\u201cPeace be with you.\\u201d \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","27","234.225","Chapter 20","Then he said to Thomas, \\u201cPut your finger here, and see my hands; and put out your hand, and place it in my side. Do not disbelieve, but believe.\\u201d \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","28","247.411","Chapter 20","Thomas answered him, \\u201cMy Lord and my God!\\u201d \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","29","253.623","Chapter 20","Jesus said to him, \\u201cHave you believed because you have seen me? Blessed are those who have not seen and yet have believed.\\u201d \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","30","262.252","Chapter 20","Now Jesus did many other signs in the presence of the disciples, which are not written in this book; \\n\\t\\t\\t","20","John","85")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","31","268.808","Chapter 20","but these are written so that you may believe that Jesus is the Christ, the Son of God, and that by believing you may have life in his name. \\n\\t\\t\\n\\t\\t","20","John","85")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","1","3.291","Chapter 21","After this Jesus revealed himself again to the disciples by the Sea of Tiberias, and he revealed himself in this way. \\n\\t\\t\\t","21","John","86")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","2","11.146","Chapter 21","Simon Peter, Thomas (called the Twin), Nathanael of Cana in Galilee, the sons of Zebedee, and two others of his disciples were together. \\n\\t\\t\\t","21","John","86")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","3","21.45","Chapter 21","Simon Peter said to them, \\u201cI am going fishing.\\u201d They said to him, \\u201cWe will go with you.\\u201d They went out and got into the boat, but that night they caught nothing. \\n\\t\\t\\t","21","John","86")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","4","34.636","Chapter 21","Just as day was breaking, Jesus stood on the shore; yet the disciples did not know that it was Jesus. \\n\\t\\t\\t","21","John","86")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","5","41.278","Chapter 21","Jesus said to them, \\u201cChildren, do you have any fish?\\u201d They answered him, \\u201cNo.\\u201d \\n\\t\\t\\t","21","John","86")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","6","50.066","Chapter 21","He said to them, \\u201cCast the net on the right side of the boat, and you will find some.\\u201d So they cast it, and now they were not able to haul it in, because of the quantity of fish. \\n\\t\\t\\t","21","John","86")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","7","62.649","Chapter 21","That disciple whom Jesus loved therefore said to Peter, \\u201cIt is the Lord!\\u201d When Simon Peter heard that it was the Lord, he put on his outer garment, for he was stripped for work, and threw himself into the sea. \\n\\t\\t\\t","21","John","86")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","8","76.477","Chapter 21","The other disciples came in the boat, dragging the net full of fish, for they were not far from the land, but about a hundred yards off. \\n\\t\\t\\t","21","John","86")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","9","84.98","Chapter 21","When they got out on land, they saw a charcoal fire in place, with fish laid out on it, and bread. \\n\\t\\t\\t","21","John","86")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","10","91.252","Chapter 21","Jesus said to them, \\u201cBring some of the fish that you have just caught.\\u201d \\n\\t\\t\\t","21","John","86")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","11","96.225","Chapter 21","So Simon Peter went aboard and hauled the net ashore, full of large fish, 153 of them. And although there were so many, the net was not torn. \\n\\t\\t\\t","21","John","86")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","12","106.901","Chapter 21","Jesus said to them, \\u201cCome and have breakfast.\\u201d Now none of the disciples dared ask him, \\u201cWho are you?\\u201d They knew it was the Lord. \\n\\t\\t\\t","21","John","86")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","13","117.53","Chapter 21","Jesus came and took the bread and gave it to them, and so with the fish. \\n\\t\\t\\t","21","John","86")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","14","122.371","Chapter 21","This was now the third time that Jesus was revealed to the disciples after he was raised from the dead. \\n\\t\\t\\t","21","John","86")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","15","129.053","Chapter 21","When they had finished breakfast, Jesus said to Simon Peter, \\u201cSimon, son of John, do you love me more than these?\\u201d He said to him, \\u201cYes, Lord; you know that I love you.\\u201d He said to him, \\u201cFeed my lambs.\\u201d \\n\\t\\t\\t","21","John","86")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","16","146.702","Chapter 21","He said to him a second time, \\u201cSimon, son of John, do you love me?\\u201d He said to him, \\u201cYes, Lord; you know that I love you.\\u201d He said to him, \\u201cTend my sheep.\\u201d \\n\\t\\t\\t","21","John","86")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","17","163.834","Chapter 21","He said to him the third time, \\u201cSimon, son of John, do you love me?\\u201d Peter was grieved because he said to him the third time, \\u201cDo you love me?\\u201d and he said to him, \\u201cLord, you know everything; you know that I love you.\\u201d Jesus said to him, \\u201cFeed my sheep. \\n\\t\\t\\t","21","John","86")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","18","189.291","Chapter 21","Truly, truly, I say to you, when you were young, you used to dress yourself and walk wherever you wanted, but when you are old, you will stretch out your hands, and another will dress you and carry you where you do not want to go.\\u201d \\n\\t\\t\\t","21","John","86")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","19","203.954","Chapter 21","(This he said to show by what kind of death he was to glorify God.) And after saying this he said to him, \\u201cFollow me.\\u201d \\n\\t\\t\\t","21","John","86")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","20","213.199","Chapter 21","Peter turned and saw the disciple whom Jesus loved following them, the one who had been reclining at table close to him and had said, \\u201cLord, who is it that is going to betray you?\\u201d \\n\\t\\t\\t","21","John","86")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","21","224.026","Chapter 21","When Peter saw him, he said to Jesus, \\u201cLord, what about this man?\\u201d \\n\\t\\t\\t","21","John","86")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("58","John","22","229.596","Chapter 21","Jesus said to him, \\u201cIf it is my will that he remain until I come, what is that to you? You follow me!\\u201d \\n\\t\\t\\t","21","John","86")');
