tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","19","162.212","Chapter 17","And they took him and brought him to the Areopagus, saying, \\u201cMay we know what this new teaching is that you are presenting? \\n\\t\\t\\t","17","Acts","102")');
