tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","19","152","Chapter 18","And they came to Ephesus, and he left them there, but he himself went into the synagogue and reasoned with the Jews. \\n\\t\\t\\t","18","Acts","103")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","20","159.397","Chapter 18","When they asked him to stay for a longer period, he declined. \\n\\t\\t\\t","18","Acts","103")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","21","163.04","Chapter 18","But on taking leave of them he said, \\u201cI will return to you if God wills,\\u201d and he set sail from Ephesus. \\n\\t\\t\\t","18","Acts","103")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","22","172.305","Chapter 18","When he had landed at Caesarea, he went up and greeted the church, and then went down to Antioch. \\n\\t\\t\\t","18","Acts","103")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","23","178.834","Chapter 18","After spending some time there, he departed and went from one place to the next through the region of Galatia and Phrygia, strengthening all the disciples. \\n\\t\\t\\t","18","Acts","103")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","24","189","Chapter 18","Now a Jew named Apollos, a native of Alexandria, came to Ephesus. He was an eloquent man, competent in the Scriptures. \\n\\t\\t\\t","18","Acts","103")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","25","196.675","Chapter 18","He had been instructed in the way of the Lord. And being fervent in spirit, he spoke and taught accurately the things concerning Jesus, though he knew only the baptism of John. \\n\\t\\t\\t","18","Acts","103")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","26","207.927","Chapter 18","He began to speak boldly in the synagogue, but when Priscilla and Aquila heard him, they took him and explained to him the way of God more accurately. \\n\\t\\t\\t","18","Acts","103")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","27","217.755","Chapter 18","And when he wished to cross to Achaia, the brothers encouraged him and wrote to the disciples to welcome him. When he arrived, he greatly helped those who through grace had believed, \\n\\t\\t\\t","18","Acts","103")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","28","228.291","Chapter 18","for he powerfully refuted the Jews in public, showing by the Scriptures that the Christ was Jesus. \\n\\t\\t\\n\\t\\t","18","Acts","103")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","1","3.199","Chapter 19","And it happened that while Apollos was at Corinth, Paul passed through the inland country and came to Ephesus. There he found some disciples. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","2","11.887","Chapter 19","And he said to them, \\u201cDid you receive the Holy Spirit when you believed?\\u201d And they said, \\u201cNo, we have not even heard that there is a Holy Spirit.\\u201d \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","3","22.331","Chapter 19","And he said, \\u201cInto what then were you baptized?\\u201d They said, \\u201cInto John\\u2019s baptism.\\u201d \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","4","30.093","Chapter 19","And Paul said, \\u201cJohn baptized with the baptism of repentance, telling the people to believe in the one who was to come after him, that is, Jesus.\\u201d \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","5","41.093","Chapter 19","On hearing this, they were baptized in the name of the Lord Jesus. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","6","45.278","Chapter 19","And when Paul had laid his hands on them, the Holy Spirit came on them, and they began speaking in tongues and prophesying. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","7","52.755","Chapter 19","There were about twelve men in all. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","8","55.026","Chapter 19","And he entered the synagogue and for three months spoke boldly, reasoning and persuading them about the kingdom of God. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","9","62.04","Chapter 19","But when some became stubborn and continued in unbelief, speaking evil of the Way before the congregation, he withdrew from them and took the disciples with him, reasoning daily in the hall of Tyrannus. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","10","75.278","Chapter 19","This continued for two years, so that all the residents of Asia heard the word of the Lord, both Jews and Greeks. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","11","84.238","Chapter 19","And God was doing extraordinary miracles by the hands of Paul, \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","12","88.914","Chapter 19","so that even handkerchiefs or aprons that had touched his skin were carried away to the sick, and their diseases left them and the evil spirits came out of them. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","13","98.305","Chapter 19","Then some of the itinerant Jewish exorcists undertook to invoke the name of the Lord Jesus over those who had evil spirits, saying, \\u201cI adjure you by the Jesus whom Paul proclaims.\\u201d \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","14","111.437","Chapter 19","Seven sons of a Jewish high priest named Sceva were doing this. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","15","116.331","Chapter 19","But the evil spirit answered them, \\u201cJesus I know, and Paul I recognize, but who are you?\\u201d \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","16","126.119","Chapter 19","And the man in whom was the evil spirit leaped on them, mastered all of them and overpowered them, so that they fled out of that house naked and wounded. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","17","135.04","Chapter 19","And this became known to all the residents of Ephesus, both Jews and Greeks. And fear fell upon them all, and the name of the Lord Jesus was extolled. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","18","146.146","Chapter 19","Also many of those who were now believers came, confessing and divulging their practices. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","19","152.265","Chapter 19","And a number of those who had practiced magic arts brought their books together and burned them in the sight of all. And they counted the value of them and found it came to fifty thousand pieces of silver. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","20","164.252","Chapter 19","So the word of the Lord continued to increase and prevail mightily. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","21","169.079","Chapter 19","Now after these events Paul resolved in the Spirit to pass through Macedonia and Achaia and go to Jerusalem, saying, \\u201cAfter I have been there, I must also see Rome.\\u201d \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","22","182.04","Chapter 19","And having sent into Macedonia two of his helpers, Timothy and Erastus, he himself stayed in Asia for a while. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","23","190.437","Chapter 19","About that time there arose no little disturbance concerning the Way. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","24","195.636","Chapter 19","For a man named Demetrius, a silversmith, who made silver shrines of Artemis, brought no little business to the craftsmen. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","25","203.397","Chapter 19","These he gathered together, with the workmen in similar trades, and said, \\u201cMen, you know that from this business we have our wealth. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","26","212.543","Chapter 19","And you see and hear that not only in Ephesus but in almost all of Asia this Paul has persuaded and turned away a great many people, saying that gods made with hands are not gods. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","27","225.781","Chapter 19","And there is danger not only that this trade of ours may come into disrepute but also that the temple of the great goddess Artemis may be counted as nothing, and that she may even be deposed from her magnificence, she whom all Asia and the world worship.\\u201d \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","28","243.424","Chapter 19","When they heard this they were enraged and were crying out, \\u201cGreat is Artemis of the Ephesians!\\u201d \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","29","250.808","Chapter 19","So the city was filled with the confusion, and they rushed together into the theater, dragging with them Gaius and Aristarchus, Macedonians who were Paul\\u2019s companions in travel. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","30","261.543","Chapter 19","But when Paul wished to go in among the crowd, the disciples would not let him. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","31","266","Chapter 19","And even some of the Asiarchs, who were friends of his, sent to him and were urging him not to venture into the theater. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","32","272.728","Chapter 19","Now some cried out one thing, some another, for the assembly was in confusion, and most of them did not know why they had come together. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","33","280.768","Chapter 19","Some of the crowd prompted Alexander, whom the Jews had put forward. And Alexander, motioning with his hand, wanted to make a defense to the crowd. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","34","290.053","Chapter 19","But when they recognized that he was a Jew, for about two hours they all cried out with one voice, \\u201cGreat is Artemis of the Ephesians!\\u201d \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","35","301.066","Chapter 19","And when the town clerk had quieted the crowd, he said, \\u201cMen of Ephesus, who is there who does not know that the city of the Ephesians is temple keeper of the great Artemis, and of the sacred stone that fell from the sky? \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","36","317.411","Chapter 19","Seeing then that these things cannot be denied, you ought to be quiet and do nothing rash. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","37","323.954","Chapter 19","For you have brought these men here who are neither sacrilegious nor blasphemers of our goddess. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","38","330.728","Chapter 19","If therefore Demetrius and the craftsmen with him have a complaint against anyone, the courts are open, and there are proconsuls. Let them bring charges against one another. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","39","342.53","Chapter 19","But if you seek anything further, it shall be settled in the regular assembly. \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","40","347.954","Chapter 19","For we really are in danger of being charged with rioting today, since there is no cause that we can give to justify this commotion.\\u201d \\n\\t\\t\\t","19","Acts","104")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","41","357.477","Chapter 19","And when he had said these things, he dismissed the assembly. \\n\\t\\t\\n\\t\\t","19","Acts","104")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","1","2.914","Chapter 20","After the uproar ceased, Paul sent for the disciples, and after encouraging them, he said farewell and departed for Macedonia. \\n\\t\\t\\t","20","Acts","105")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","2","10.675","Chapter 20","When he had gone through those regions and had given them much encouragement, he came to Greece. \\n\\t\\t\\t","20","Acts","105")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","3","15.874","Chapter 20","There he spent three months, and when a plot was made against him by the Jews as he was about to set sail for Syria, he decided to return through Macedonia. \\n\\t\\t\\t","20","Acts","105")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","4","25.675","Chapter 20","Sopater the Berean, son of Pyrrhus, accompanied him; and of the Thessalonians, Aristarchus and Secundus; and Gaius of Derbe, and Timothy; and the Asians, Tychicus and Trophimus. \\n\\t\\t\\t","20","Acts","105")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","5","39.742","Chapter 20","These went on ahead and were waiting for us at Troas, \\n\\t\\t\\t","20","Acts","105")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","6","42.623","Chapter 20","but we sailed away from Philippi after the days of Unleavened Bread, and in five days we came to them at Troas, where we stayed for seven days. \\n\\t\\t\\t","20","Acts","105")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","7","52.609","Chapter 20","On the first day of the week, when we were gathered together to break bread, Paul talked with them, intending to depart on the next day, and he prolonged his speech until midnight. \\n\\t\\t\\t","20","Acts","105")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","8","62.185","Chapter 20","There were many lamps in the upper room where we were gathered. \\n\\t\\t\\t","20","Acts","105")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","9","65.437","Chapter 20","And a young man named Eutychus, sitting at the window, sank into a deep sleep as Paul talked still longer. And being overcome by sleep, he fell down from the third story and was taken up dead. \\n\\t\\t\\t","20","Acts","105")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","10","78.715","Chapter 20","But Paul went down and bent over him, and taking him in his arms, said, \\u201cDo not be alarmed, for his life is in him.\\u201d \\n\\t\\t\\t","20","Acts","105")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","11","87.954","Chapter 20","And when Paul had gone up and had broken bread and eaten, he conversed with them a long while, until daybreak, and so departed. \\n\\t\\t\\t","20","Acts","105")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","12","95.159","Chapter 20","And they took the youth away alive, and were not a little comforted. \\n\\t\\t\\t","20","Acts","105")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","13","99.424","Chapter 20","But going ahead to the ship, we set sail for Assos, intending to take Paul aboard there, for so he had arranged, intending himself to go by land. \\n\\t\\t\\t","20","Acts","105")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","14","109.358","Chapter 20","And when he met us at Assos, we took him on board and went to Mitylene. \\n\\t\\t\\t","20","Acts","105")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","15","114.715","Chapter 20","And sailing from there we came the following day opposite Chios; the next day we touched at Samos; and the day after that we went to Miletus. \\n\\t\\t\\t","20","Acts","105")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","16","123.305","Chapter 20","For Paul had decided to sail past Ephesus, so that he might not have to spend time in Asia, for he was hastening to be at Jerusalem, if possible, on the day of Pentecost. \\n\\t\\t\\t","20","Acts","105")');
