tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","10","95.477","Chapter 22","And I said, \\u2018What shall I do, Lord?\\u2019And the Lord said to me, \\u2018Rise, and go into Damascus, and there you will be told all that is appointed for you to do.\\u2019 \\n\\t\\t\\t","22","Acts","107")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","11","108.106","Chapter 22","And since I could not see because of the brightness of that light, I was led by the hand by those who were with me, and came into Damascus. \\n\\t\\t\\t","22","Acts","107")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","12","117.265","Chapter 22","\\u201cAnd one Ananias, a devout man according to the law, well spoken of by all the Jews who lived there, \\n\\t\\t\\t","22","Acts","107")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","13","124.358","Chapter 22","came to me, and standing by me said to me, \\u2018Brother Saul, receive your sight.\\u2019And at that very hour I received my sight and saw him. \\n\\t\\t\\t","22","Acts","107")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","14","136.53","Chapter 22","And he said, \\u2018The God of our fathers appointed you to know his will, to see the Righteous One and to hear a voice from his mouth; \\n\\t\\t\\t","22","Acts","107")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","15","146.795","Chapter 22","for you will be a witness for him to everyone of what you have seen and heard. \\n\\t\\t\\t","22","Acts","107")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","16","152.464","Chapter 22","And now why do you wait? Rise and be baptized and wash away your sins, calling on his name.\\u2019 \\n\\t\\t\\t","22","Acts","107")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","17","161.795","Chapter 22","\\u201cWhen I had returned to Jerusalem and was praying in the temple, I fell into a trance \\n\\t\\t\\t","22","Acts","107")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","18","167.874","Chapter 22","and saw him saying to me, \\u2018Make haste and get out of Jerusalem quickly, because they will not accept your testimony about me.\\u2019 \\n\\t\\t\\t","22","Acts","107")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","19","176.887","Chapter 22","And I said, \\u2018Lord, they themselves know that in one synagogue after another I imprisoned and beat those who believed in you. \\n\\t\\t\\t","22","Acts","107")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","20","185.702","Chapter 22","And when the blood of Stephen your witness was being shed, I myself was standing by and approving and watching over the garments of those who killed him.\\u2019 \\n\\t\\t\\t","22","Acts","107")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","21","196.49","Chapter 22","And he said to me, \\u2018Go, for I will send you far away to the Gentiles.\\u2019\\u201d \\n\\t\\t\\t","22","Acts","107")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","22","204.57","Chapter 22","Up to this word they listened to him. Then they raised their voices and said, \\u201cAway with such a fellow from the earth! For he should not be allowed to live.\\u201d \\n\\t\\t\\t","22","Acts","107")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","23","215.252","Chapter 22","And as they were shouting and throwing off their cloaks and flinging dust into the air, \\n\\t\\t\\t","22","Acts","107")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","24","220.026","Chapter 22","the tribune ordered him to be brought into the barracks, saying that he should be examined by flogging, to find out why they were shouting against him like this. \\n\\t\\t\\t","22","Acts","107")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","25","228.344","Chapter 22","But when they had stretched him out for the whips, Paul said to the centurion who was standing by, \\u201cIs it lawful for you to flog a man who is a Roman citizen and uncondemned?\\u201d \\n\\t\\t\\t","22","Acts","107")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","26","238.238","Chapter 22","When the centurion heard this, he went to the tribune and said to him, \\u201cWhat are you about to do? For this man is a Roman citizen.\\u201d \\n\\t\\t\\t","22","Acts","107")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","27","246.914","Chapter 22","So the tribune came and said to him, \\u201cTell me, are you a Roman citizen?\\u201d And he said, \\u201cYes.\\u201d \\n\\t\\t\\t","22","Acts","107")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","28","254.715","Chapter 22","The tribune answered, \\u201cI bought this citizenship for a large sum.\\u201d Paul said, \\u201cBut I am a citizen by birth.\\u201d \\n\\t\\t\\t","22","Acts","107")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","29","263.728","Chapter 22","So those who were about to examine him withdrew from him immediately, and the tribune also was afraid, for he realized that Paul was a Roman citizen and that he had bound him. \\n\\t\\t\\t","22","Acts","107")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","30","274.874","Chapter 22","But on the next day, desiring to know the real reason why he was being accused by the Jews, he unbound him and commanded the chief priests and all the council to meet, and he brought Paul down and set him before them. \\n\\t\\t\\n\\t\\t","22","Acts","107")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","1","3.437","Chapter 23","And looking intently at the council, Paul said, \\u201cBrothers, I have lived my life before God in all good conscience up to this day.\\u201d \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","2","14.159","Chapter 23","And the high priest Ananias commanded those who stood by him to strike him on the mouth. \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","3","19.265","Chapter 23","Then Paul said to him, \\u201cGod is going to strike you, you whitewashed wall! Are you sitting to judge me according to the law, and yet contrary to the law you order me to be struck?\\u201d \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","4","31.437","Chapter 23","Those who stood by said, \\u201cWould you revile God\\u2019s high priest?\\u201d \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","5","37.053","Chapter 23","And Paul said, \\u201cI did not know, brothers, that he was the high priest, for it is written, \\u2018You shall not speak evil of a ruler of your people.\\u2019\\u201d \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","6","47.503","Chapter 23","Now when Paul perceived that one part were Sadducees and the other Pharisees, he cried out in the council, \\u201cBrothers, I am a Pharisee, a son of Pharisees. It is with respect to the hope and the resurrection of the dead that I am on trial.\\u201d \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","7","65.252","Chapter 23","And when he had said this, a dissension arose between the Pharisees and the Sadducees, and the assembly was divided. \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","8","72.212","Chapter 23","For the Sadducees say that there is no resurrection, nor angel, nor spirit, but the Pharisees acknowledge them all. \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","9","79.411","Chapter 23","Then a great clamor arose, and some of the scribes of the Pharisees\\u2019 party stood up and contended sharply, \\u201cWe find nothing wrong in this man. What if a spirit or an angel spoke to him?\\u201d \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","10","94.079","Chapter 23","And when the dissension became violent, the tribune, afraid that Paul would be torn to pieces by them, commanded the soldiers to go down and take him away from among them by force and bring him into the barracks. \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","11","106.212","Chapter 23","The following night the Lord stood by him and said, \\u201cTake courage, for as you have testified to the facts about me in Jerusalem, so you must testify also in Rome.\\u201d \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","12","119.026","Chapter 23","When it was day, the Jews made a plot and bound themselves by an oath neither to eat nor drink till they had killed Paul. \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","13","127.238","Chapter 23","There were more than forty who made this conspiracy. \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","14","130.397","Chapter 23","They went to the chief priests and elders and said, \\u201cWe have strictly bound ourselves by an oath to taste no food till we have killed Paul. \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","15","139.358","Chapter 23","Now therefore you, along with the council, give notice to the tribune to bring him down to you, as though you were going to determine his case more exactly. And we are ready to kill him before he comes near.\\u201d \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","16","152.781","Chapter 23","Now the son of Paul\\u2019s sister heard of their ambush, so he went and entered the barracks and told Paul. \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","17","158.728","Chapter 23","Paul called one of the centurions and said, \\u201cTake this young man to the tribune, for he has something to tell him.\\u201d \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","18","165.649","Chapter 23","So he took him and brought him to the tribune and said, \\u201cPaul the prisoner called me and asked me to bring this young man to you, as he has something to say to you.\\u201d \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","19","175.583","Chapter 23","The tribune took him by the hand, and going aside asked him privately, \\u201cWhat is it that you have to tell me?\\u201d \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","20","182.093","Chapter 23","And he said, \\u201cThe Jews have agreed to ask you to bring Paul down to the council tomorrow, as though they were going to inquire somewhat more closely about him. \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","21","191.093","Chapter 23","But do not be persuaded by them, for more than forty of their men are lying in ambush for him, who have bound themselves by an oath neither to eat nor drink till they have killed him. And now they are ready, waiting for your consent.\\u201d \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","22","204.146","Chapter 23","So the tribune dismissed the young man, charging him, \\u201cTell no one that you have informed me of these things.\\u201d \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","23","210.781","Chapter 23","Then he called two of the centurions and said, \\u201cGet ready two hundred soldiers, with seventy horsemen and two hundred spearmen to go as far as Caesarea at the third hour of the night. \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","24","220.675","Chapter 23","Also provide mounts for Paul to ride and bring him safely to Felix the governor.\\u201d \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","25","224.715","Chapter 23","And he wrote a letter to this effect: \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","26","227.371","Chapter 23","\\u201cClaudius Lysias, to his Excellency the governor Felix, greetings. \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","27","232.106","Chapter 23","This man was seized by the Jews and was about to be killed by them when I came upon them with the soldiers and rescued him, having learned that he was a Roman citizen. \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","28","240","Chapter 23","And desiring to know the charge for which they were accusing him, I brought him down to their council. \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","29","244.636","Chapter 23","I found that he was being accused about questions of their law, but charged with nothing deserving death or imprisonment. \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","30","250.397","Chapter 23","And when it was disclosed to me that there would be a plot against the man, I sent him to you at once, ordering his accusers also to state before you what they have against him.\\u201d \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","31","259.04","Chapter 23","So the soldiers, according to their instructions, took Paul and brought him by night to Antipatris. \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","32","264.477","Chapter 23","And on the next day they returned to the barracks, letting the horsemen go on with him. \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","33","269.344","Chapter 23","When they had come to Caesarea and delivered the letter to the governor, they presented Paul also before him. \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","34","275.848","Chapter 23","On reading the letter, he asked what province he was from. And when he learned that he was from Cilicia, \\n\\t\\t\\t","23","Acts","108")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","35","282","Chapter 23","he said, \\u201cI will give you a hearing when your accusers arrive.\\u201d And he commanded him to be guarded in Herod\\u2019s praetorium. \\n\\t\\t\\n\\t\\t","23","Acts","108")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","1","3.437","Chapter 24","And after five days the high priest Ananias came down with some elders and a spokesman, one Tertullus. They laid before the governor their case against Paul. \\n\\t\\t\\t","24","Acts","109")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","2","13.331","Chapter 24","And when he had been summoned, Tertullus began to accuse him, saying: \\u201cSince through you we enjoy much peace, and since by your foresight, most excellent Felix, reforms are being made for this nation, \\n\\t\\t\\t","24","Acts","109")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","3","27.318","Chapter 24","in every way and everywhere we accept this with all gratitude. \\n\\t\\t\\t","24","Acts","109")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","4","32.013","Chapter 24","But, to detain you no further, I beg you in your kindness to hear us briefly. \\n\\t\\t\\t","24","Acts","109")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","5","38","Chapter 24","For we have found this man a plague, one who stirs up riots among all the Jews throughout the world and is a ringleader of the sect of the Nazarenes. \\n\\t\\t\\t","24","Acts","109")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","6","50.358","Chapter 24","He even tried to profane the temple, but we seized him. \\n\\t\\t\\t","24","Acts","109")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","8","55.331","Chapter 24","By examining him yourself you will be able to find out from him about everything of which we accuse him.\\u201d \\n\\t\\t\\t","24","Acts","109")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","9","55.331","Chapter 24","The Jews also joined in the charge, affirming that all these things were so. \\n\\t\\t\\t","24","Acts","109")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","10","63.132","Chapter 24","And when the governor had nodded to him to speak, Paul replied: \\u201cKnowing that for many years you have been a judge over this nation, I cheerfully make my defense. \\n\\t\\t\\t","24","Acts","109")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","11","68.093","Chapter 24","You can verify that it is not more than twelve days since I went up to worship in Jerusalem, \\n\\t\\t\\t","24","Acts","109")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","12","78.914","Chapter 24","and they did not find me disputing with anyone or stirring up a crowd, either in the temple or in the synagogues or in the city. \\n\\t\\t\\t","24","Acts","109")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","13","85.093","Chapter 24","Neither can they prove to you what they now bring up against me. \\n\\t\\t\\t","24","Acts","109")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","14","93.45","Chapter 24","But this I confess to you, that according to the Way, which they call a sect, I worship the God of our fathers, believing everything laid down by the Law and written in the Prophets, \\n\\t\\t\\t","24","Acts","109")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","15","97.821","Chapter 24","having a hope in God, which these men themselves accept, that there will be a resurrection of both the just and the unjust. \\n\\t\\t\\t","24","Acts","109")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","16","110.45","Chapter 24","So I always take pains to have a clear conscience toward both God and man. \\n\\t\\t\\t","24","Acts","109")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","17","119.318","Chapter 24","Now after several years I came to bring alms to my nation and to present offerings. \\n\\t\\t\\t","24","Acts","109")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","18","126.702","Chapter 24","While I was doing this, they found me purified in the temple, without any crowd or tumult. But some Jews from Asia\\u2014 \\n\\t\\t\\t","24","Acts","109")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","19","133.808","Chapter 24","they ought to be here before you and to make an accusation, should they have anything against me. \\n\\t\\t\\t","24","Acts","109")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","20","142.821","Chapter 24","Or else let these men themselves say what wrongdoing they found when I stood before the council, \\n\\t\\t\\t","24","Acts","109")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","21","148.384","Chapter 24","other than this one thing that I cried out while standing among them: \\u2018It is with respect to the resurrection of the dead that I am on trial before you this day.\\u2019\\u201d \\n\\t\\t\\t","24","Acts","109")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","22","154.384","Chapter 24","But Felix, having a rather accurate knowledge of the Way, put them off, saying, \\u201cWhen Lysias the tribune comes down, I will decide your case.\\u201d \\n\\t\\t\\t","24","Acts","109")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","23","166.358","Chapter 24","Then he gave orders to the centurion that he should be kept in custody but have some liberty, and that none of his friends should be prevented from attending to his needs. \\n\\t\\t\\t","24","Acts","109")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","24","177.185","Chapter 24","After some days Felix came with his wife Drusilla, who was Jewish, and he sent for Paul and heard him speak about faith in Christ Jesus. \\n\\t\\t\\t","24","Acts","109")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","25","186.702","Chapter 24","And as he reasoned about righteousness and self-control and the coming judgment, Felix was alarmed and said, \\u201cGo away for the present. When I get an opportunity I will summon you.\\u201d \\n\\t\\t\\t","24","Acts","109")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","26","195.159","Chapter 24","At the same time he hoped that money would be given him by Paul. So he sent for him often and conversed with him. \\n\\t\\t\\t","24","Acts","109")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","27","209.556","Chapter 24","When two years had elapsed, Felix was succeeded by Porcius Festus. And desiring to do the Jews a favor, Felix left Paul in prison. \\n\\t\\t\\n\\t\\t","24","Acts","109")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","1","3.795","Chapter 25","Now three days after Festus had arrived in the province, he went up to Jerusalem from Caesarea. \\n\\t\\t\\t","25","Acts","110")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","2","9.358","Chapter 25","And the chief priests and the principal men of the Jews laid out their case against Paul, and they urged him, \\n\\t\\t\\t","25","Acts","110")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","3","15.517","Chapter 25","asking as a favor against Paul that he summon him to Jerusalem\\u2014because they were planning an ambush to kill him on the way. \\n\\t\\t\\t","25","Acts","110")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","4","22.728","Chapter 25","Festus replied that Paul was being kept at Caesarea and that he himself intended to go there shortly. \\n\\t\\t\\t","25","Acts","110")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","5","29.45","Chapter 25","\\u201cSo,\\u201d said he, \\u201clet the men of authority among you go down with me, and if there is anything wrong about the man, let them bring charges against him.\\u201d \\n\\t\\t\\t","25","Acts","110")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","6","38.358","Chapter 25","After he stayed among them not more than eight or ten days, he went down to Caesarea. And the next day he took his seat on the tribunal and ordered Paul to be brought. \\n\\t\\t\\t","25","Acts","110")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","7","47.358","Chapter 25","When he had arrived, the Jews who had come down from Jerusalem stood around him, bringing many and serious charges against him that they could not prove. \\n\\t\\t\\t","25","Acts","110")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","8","56.278","Chapter 25","Paul argued in his defense, \\u201cNeither against the law of the Jews, nor against the temple, nor against Caesar have I committed any offense.\\u201d \\n\\t\\t\\t","25","Acts","110")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","9","68.318","Chapter 25","But Festus, wishing to do the Jews a favor, said to Paul, \\u201cDo you wish to go up to Jerusalem and there be tried on these charges before me?\\u201d \\n\\t\\t\\t","25","Acts","110")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","10","77.768","Chapter 25","But Paul said, \\u201cI am standing before Caesar\\u2019s tribunal, where I ought to be tried. To the Jews I have done no wrong, as you yourself know very well. \\n\\t\\t\\t","25","Acts","110")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","11","89.821","Chapter 25","If then I am a wrongdoer and have committed anything for which I deserve to die, I do not seek to escape death. But if there is nothing to their charges against me, no one can give me up to them. I appeal to Caesar.\\u201d \\n\\t\\t\\t","25","Acts","110")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","12","107.344","Chapter 25","Then Festus, when he had conferred with his council, answered, \\u201cTo Caesar you have appealed; to Caesar you shall go.\\u201d \\n\\t\\t\\t","25","Acts","110")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","13","117.079","Chapter 25","Now when some days had passed, Agrippa the king and Bernice arrived at Caesarea and greeted Festus. \\n\\t\\t\\t","25","Acts","110")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","14","123.543","Chapter 25","And as they stayed there many days, Festus laid Paul\\u2019s case before the king, saying, \\u201cThere is a man left prisoner by Felix, \\n\\t\\t\\t","25","Acts","110")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","15","131.675","Chapter 25","and when I was at Jerusalem, the chief priests and the elders of the Jews laid out their case against him, asking for a sentence of condemnation against him. \\n\\t\\t\\t","25","Acts","110")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","16","140.132","Chapter 25","I answered them that it was not the custom of the Romans to give up anyone before the accused met the accusers face to face and had opportunity to make his defense concerning the charge laid against him. \\n\\t\\t\\t","25","Acts","110")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","17","152.066","Chapter 25","So when they came together here, I made no delay, but on the next day took my seat on the tribunal and ordered the man to be brought. \\n\\t\\t\\t","25","Acts","110")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","18","160.397","Chapter 25","When the accusers stood up, they brought no charge in his case of such evils as I supposed. \\n\\t\\t\\t","25","Acts","110")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","19","165.702","Chapter 25","Rather they had certain points of dispute with him about their own religion and about a certain Jesus, who was dead, but whom Paul asserted to be alive. \\n\\t\\t\\t","25","Acts","110")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","20","175.728","Chapter 25","Being at a loss how to investigate these questions, I asked whether he wanted to go to Jerusalem and be tried there regarding them. \\n\\t\\t\\t","25","Acts","110")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","21","183.344","Chapter 25","But when Paul had appealed to be kept in custody for the decision of the emperor, I ordered him to be held until I could send him to Caesar.\\u201d \\n\\t\\t\\t","25","Acts","110")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","22","191.662","Chapter 25","Then Agrippa said to Festus, \\u201cI would like to hear the man myself.\\u201d \\u201cTomorrow,\\u201d said he, \\u201cyou will hear him.\\u201d \\n\\t\\t\\t","25","Acts","110")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","23","200.45","Chapter 25","So on the next day Agrippa and Bernice came with great pomp, and they entered the audience hall with the military tribunes and the prominent men of the city. Then, at the command of Festus, Paul was brought in. \\n\\t\\t\\t","25","Acts","110")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","24","213.411","Chapter 25","And Festus said, \\u201cKing Agrippa and all who are present with us, you see this man about whom the whole Jewish people petitioned me, both in Jerusalem and here, shouting that he ought not to live any longer. \\n\\t\\t\\t","25","Acts","110")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","25","230.702","Chapter 25","But I found that he had done nothing deserving death. And as he himself appealed to the emperor, I decided to go ahead and send him. \\n\\t\\t\\t","25","Acts","110")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","26","239.808","Chapter 25","But I have nothing definite to write to my lord about him. Therefore I have brought him before you all, and especially before you, King Agrippa, so that, after we have examined him, I may have something to write. \\n\\t\\t\\t","25","Acts","110")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","27","254.914","Chapter 25","For it seems to me unreasonable, in sending a prisoner, not to indicate the charges against him.\\u201d \\n\\t\\t\\n\\t\\t","25","Acts","110")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","1","3.291","Chapter 26","So Agrippa said to Paul, \\u201cYou have permission to speak for yourself.\\u201d Then Paul stretched out his hand and made his defense: \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","2","12.305","Chapter 26","\\u201cI consider myself fortunate that it is before you, King Agrippa, I am going to make my defense today against all the accusations of the Jews, \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","3","23.49","Chapter 26","especially because you are familiar with all the customs and controversies of the Jews. Therefore I beg you to listen to me patiently. \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","4","34.636","Chapter 26","\\u201cMy manner of life from my youth, spent from the beginning among my own nation and in Jerusalem, is known by all the Jews. \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","5","44.252","Chapter 26","They have known for a long time, if they are willing to testify, that according to the strictest party of our religion I have lived as a Pharisee. \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","6","54.477","Chapter 26","And now I stand here on trial because of my hope in the promise made by God to our fathers, \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","7","62.596","Chapter 26","to which our twelve tribes hope to attain, as they earnestly worship night and day. And for this hope I am accused by Jews, O king! \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","8","73.874","Chapter 26","Why is it thought incredible by any of you that God raises the dead? \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","9","79.093","Chapter 26","\\u201cI myself was convinced that I ought to do many things in opposing the name of Jesus of Nazareth. \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","10","86.013","Chapter 26","And I did so in Jerusalem. I not only locked up many of the saints in prison after receiving authority from the chief priests, but when they were put to death I cast my vote against them. \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","11","99.477","Chapter 26","And I punished them often in all the synagogues and tried to make them blaspheme, and in raging fury against them I persecuted them even to foreign cities. \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","12","111.821","Chapter 26","\\u201cIn this connection I journeyed to Damascus with the authority and commission of the chief priests. \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","13","120","Chapter 26","At midday, O king, I saw on the way a light from heaven, brighter than the sun, that shone around me and those who journeyed with me. \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","14","131.278","Chapter 26","And when we had all fallen to the ground, I heard a voice saying to me in the Hebrew language, \\u2018Saul, Saul, why are you persecuting me? It is hard for you to kick against the goads.\\u2019 \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","15","147.49","Chapter 26","And I said, \\u2018Who are you, Lord?\\u2019And the Lord said, \\u2018I am Jesus whom you are persecuting. \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","16","156.225","Chapter 26","But rise and stand upon your feet, for I have appeared to you for this purpose, to appoint you as a servant and witness to the things in which you have seen me and to those in which I will appear to you, \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","17","169.318","Chapter 26","delivering you from your people and from the Gentiles\\u2014to whom I am sending you \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","18","174.093","Chapter 26","to open their eyes, so that they may turn from darkness to light and from the power of Satan to God, that they may receive forgiveness of sins and a place among those who are sanctified by faith in me.\\u2019 \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","19","187.927","Chapter 26","\\u201cTherefore, O King Agrippa, I was not disobedient to the heavenly vision, \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","20","194.887","Chapter 26","but declared first to those in Damascus, then in Jerusalem and throughout all the region of Judea, and also to the Gentiles, that they should repent and turn to God, performing deeds in keeping with their repentance. \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","21","209.424","Chapter 26","For this reason the Jews seized me in the temple and tried to kill me. \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","22","215.185","Chapter 26","To this day I have had the help that comes from God, and so I stand here testifying both to small and great, saying nothing but what the prophets and Moses said would come to pass: \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","23","228.291","Chapter 26","that the Christ must suffer and that, by being the first to rise from the dead, he would proclaim light both to our people and to the Gentiles.\\u201d \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","24","239.662","Chapter 26","And as he was saying these things in his defense, Festus said with a loud voice, \\u201cPaul, you are out of your mind; your great learning is driving you out of your mind.\\u201d \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","25","252.609","Chapter 26","But Paul said, \\u201cI am not out of my mind, most excellent Festus, but I am speaking true and rational words. \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","26","261.305","Chapter 26","For the king knows about these things, and to him I speak boldly. For I am persuaded that none of these things has escaped his notice, for this has not been done in a corner. \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","27","273.053","Chapter 26","King Agrippa, do you believe the prophets? I know that you believe.\\u201d \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","28","279.914","Chapter 26","And Agrippa said to Paul, \\u201cIn a short time would you persuade me to be a Christian?\\u201d \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","29","287.49","Chapter 26","And Paul said, \\u201cWhether short or long, I would to God that not only you but also all who hear me this day might become such as I am\\u2014except for these chains.\\u201d \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","30","299.98","Chapter 26","Then the king rose, and the governor and Bernice and those who were sitting with them. \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","31","304.715","Chapter 26","And when they had withdrawn, they said to one another, \\u201cThis man is doing nothing to deserve death or imprisonment.\\u201d \\n\\t\\t\\t","26","Acts","111")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","32","313.821","Chapter 26","And Agrippa said to Festus, \\u201cThis man could have been set free if he had not appealed to Caesar.\\u201d \\n\\t\\t\\n\\t\\t","26","Acts","111")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","1","4.066","Chapter 27","And when it was decided that we should sail for Italy, they delivered Paul and some other prisoners to a centurion of the Augustan Cohort named Julius. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","2","12.596","Chapter 27","And embarking in a ship of Adramyttium, which was about to sail to the ports along the coast of Asia, we put to sea, accompanied by Aristarchus, a Macedonian from Thessalonica. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","3","25.358","Chapter 27","The next day we put in at Sidon. And Julius treated Paul kindly and gave him leave to go to his friends and be cared for. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","4","32.649","Chapter 27","And putting out to sea from there we sailed under the lee of Cyprus, because the winds were against us. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","5","39.344","Chapter 27","And when we had sailed across the open sea along the coast of Cilicia and Pamphylia, we came to Myra in Lycia. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","6","46.755","Chapter 27","There the centurion found a ship of Alexandria sailing for Italy and put us on board. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","7","52.623","Chapter 27","We sailed slowly for a number of days and arrived with difficulty off Cnidus, and as the wind did not allow us to go farther, we sailed under the lee of Crete off Salmone. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","8","64.159","Chapter 27","Coasting along it with difficulty, we came to a place called Fair Havens, near which was the city of Lasea. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","9","71.199","Chapter 27","Since much time had passed, and the voyage was now dangerous because even the Fast was already over, Paul advised them, \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","10","78.702","Chapter 27","saying, \\u201cSirs, I perceive that the voyage will be with injury and much loss, not only of the cargo and the ship, but also of our lives.\\u201d \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","11","89.755","Chapter 27","But the centurion paid more attention to the pilot and to the owner of the ship than to what Paul said. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","12","95.278","Chapter 27","And because the harbor was not suitable to spend the winter in, the majority decided to put out to sea from there, on the chance that somehow they could reach Phoenix, a harbor of Crete, facing both southwest and northwest, and spend the winter there. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","13","110.887","Chapter 27","Now when the south wind blew gently, supposing that they had obtained their purpose, they weighed anchor and sailed along Crete, close to the shore. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","14","120.225","Chapter 27","But soon a tempestuous wind, called the northeaster, struck down from the land. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","15","125.503","Chapter 27","And when the ship was caught and could not face the wind, we gave way to it and were driven along. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","16","131.291","Chapter 27","Running under the lee of a small island called Cauda, we managed with difficulty to secure the ship\\u2019s boat. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","17","138","Chapter 27","After hoisting it up, they used supports to undergird the ship. Then, fearing that they would run aground on the Syrtis, they lowered the gear, and thus they were driven along. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","18","148.808","Chapter 27","Since we were violently storm-tossed, they began the next day to jettison the cargo. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","19","153.821","Chapter 27","And on the third day they threw the ship\\u2019s tackle overboard with their own hands. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","20","158.238","Chapter 27","When neither sun nor stars appeared for many days, and no small tempest lay on us, all hope of our being saved was at last abandoned. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","21","167.954","Chapter 27","Since they had been without food for a long time, Paul stood up among them and said, \\u201cMen, you should have listened to me and not have set sail from Crete and incurred this injury and loss. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","22","180.464","Chapter 27","Yet now I urge you to take heart, for there will be no loss of life among you, but only of the ship. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","23","187.861","Chapter 27","For this very night there stood before me an angel of the God to whom I belong and whom I worship, \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","24","194.887","Chapter 27","and he said, \\u2018Do not be afraid, Paul; you must stand before Caesar. And behold, God has granted you all those who sail with you.\\u2019 \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","25","205.106","Chapter 27","So take heart, men, for I have faith in God that it will be exactly as I have been told. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","26","211.556","Chapter 27","But we must run aground on some island.\\u201d \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","27","216.331","Chapter 27","When the fourteenth night had come, as we were being driven across the Adriatic Sea, about midnight the sailors suspected that they were nearing land. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","28","225.437","Chapter 27","So they took a sounding and found twenty fathoms. A little farther on they took a sounding again and found fifteen fathoms. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","29","232.715","Chapter 27","And fearing that we might run on the rocks, they let down four anchors from the stern and prayed for day to come. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","30","239.689","Chapter 27","And as the sailors were seeking to escape from the ship, and had lowered the ship\\u2019s boat into the sea under pretense of laying out anchors from the bow, \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","31","248.132","Chapter 27","Paul said to the centurion and the soldiers, \\u201cUnless these men stay in the ship, you cannot be saved.\\u201d \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","32","255.106","Chapter 27","Then the soldiers cut away the ropes of the ship\\u2019s boat and let it go. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","33","259.079","Chapter 27","As day was about to dawn, Paul urged them all to take some food, saying, \\u201cToday is the fourteenth day that you have continued in suspense and without food, having taken nothing. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","34","271.662","Chapter 27","Therefore I urge you to take some food. For it will give you strength, for not a hair is to perish from the head of any of you.\\u201d \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","35","279.861","Chapter 27","And when he had said these things, he took bread, and giving thanks to God in the presence of all he broke it and began to eat. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","36","287.159","Chapter 27","Then they all were encouraged and ate some food themselves. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","37","290.675","Chapter 27","(We were in all 276 persons in the ship.) \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","38","294.517","Chapter 27","And when they had eaten enough, they lightened the ship, throwing out the wheat into the sea. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","39","300.874","Chapter 27","Now when it was day, they did not recognize the land, but they noticed a bay with a beach, on which they planned if possible to run the ship ashore. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","40","309.477","Chapter 27","So they cast off the anchors and left them in the sea, at the same time loosening the ropes that tied the rudders. Then hoisting the foresail to the wind they made for the beach. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","41","319.689","Chapter 27","But striking a reef, they ran the vessel aground. The bow stuck and remained immovable, and the stern was being broken up by the surf. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","42","328.755","Chapter 27","The soldiers\\u2019 plan was to kill the prisoners, lest any should swim away and escape. \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","43","333.689","Chapter 27","But the centurion, wishing to save Paul, kept them from carrying out their plan. He ordered those who could swim to jump overboard first and make for the land, \\n\\t\\t\\t","27","Acts","112")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","44","342.768","Chapter 27","and the rest on planks or on pieces of the ship. And so it was that all were brought safely to land. \\n\\t\\t\\n\\t\\t","27","Acts","112")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","1","3.106","Chapter 28","After we were brought safely through, we then learned that the island was called Malta. \\n\\t\\t\\t","28","Acts","113")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","2","8.649","Chapter 28","The native people showed us unusual kindness, for they kindled a fire and welcomed us all, because it had begun to rain and was cold. \\n\\t\\t\\t","28","Acts","113")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","3","16.689","Chapter 28","When Paul had gathered a bundle of sticks and put them on the fire, a viper came out because of the heat and fastened on his hand. \\n\\t\\t\\t","28","Acts","113")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","4","24.026","Chapter 28","When the native people saw the creature hanging from his hand, they said to one another, \\u201cNo doubt this man is a murderer. Though he has escaped from the sea, Justice has not allowed him to live.\\u201d \\n\\t\\t\\t","28","Acts","113")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","5","38.093","Chapter 28","He, however, shook off the creature into the fire and suffered no harm. \\n\\t\\t\\t","28","Acts","113")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","6","42.464","Chapter 28","They were waiting for him to swell up or suddenly fall down dead. But when they had waited a long time and saw no misfortune come to him, they changed their minds and said that he was a god. \\n\\t\\t\\t","28","Acts","113")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","7","54.768","Chapter 28","Now in the neighborhood of that place were lands belonging to the chief man of the island, named Publius, who received us and entertained us hospitably for three days. \\n\\t\\t\\t","28","Acts","113")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","8","64.384","Chapter 28","It happened that the father of Publius lay sick with fever and dysentery. And Paul visited him and prayed, and putting his hands on him healed him. \\n\\t\\t\\t","28","Acts","113")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","9","73.901","Chapter 28","And when this had taken place, the rest of the people on the island who had diseases also came and were cured. \\n\\t\\t\\t","28","Acts","113")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","10","80.358","Chapter 28","They also honored us greatly, and when we were about to sail, they put on board whatever we needed. \\n\\t\\t\\t","28","Acts","113")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","11","87.371","Chapter 28","After three months we set sail in a ship that had wintered in the island, a ship of Alexandria, with the twin gods as a figurehead. \\n\\t\\t\\t","28","Acts","113")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","12","95.675","Chapter 28","Putting in at Syracuse, we stayed there for three days. \\n\\t\\t\\t","28","Acts","113")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","13","99.861","Chapter 28","And from there we made a circuit and arrived at Rhegium. And after one day a south wind sprang up, and on the second day we came to Puteoli. \\n\\t\\t\\t","28","Acts","113")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","14","108.768","Chapter 28","There we found brothers and were invited to stay with them for seven days. And so we came to Rome. \\n\\t\\t\\t","28","Acts","113")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","15","115.093","Chapter 28","And the brothers there, when they heard about us, came as far as the Forum of Appius and Three Taverns to meet us. On seeing them, Paul thanked God and took courage. \\n\\t\\t\\t","28","Acts","113")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","16","125.583","Chapter 28","And when we came into Rome, Paul was allowed to stay by himself, with the soldier that guarded him. \\n\\t\\t\\t","28","Acts","113")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","17","131.53","Chapter 28","After three days he called together the local leaders of the Jews, and when they had gathered, he said to them, \\u201cBrothers, though I had done nothing against our people or the customs of our fathers, yet I was delivered as a prisoner from Jerusalem into the hands of the Romans. \\n\\t\\t\\t","28","Acts","113")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","18","148.848","Chapter 28","When they had examined me, they wished to set me at liberty, because there was no reason for the death penalty in my case. \\n\\t\\t\\t","28","Acts","113")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","19","156.649","Chapter 28","But because the Jews objected, I was compelled to appeal to Caesar\\u2014though I had no charge to bring against my nation. \\n\\t\\t\\t","28","Acts","113")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","20","164.821","Chapter 28","For this reason, therefore, I have asked to see you and speak with you, since it is because of the hope of Israel that I am wearing this chain.\\u201d \\n\\t\\t\\t","28","Acts","113")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","21","174.397","Chapter 28","And they said to him, \\u201cWe have received no letters from Judea about you, and none of the brothers coming here has reported or spoken any evil about you. \\n\\t\\t\\t","28","Acts","113")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","22","183.914","Chapter 28","But we desire to hear from you what your views are, for with regard to this sect we know that everywhere it is spoken against.\\u201d \\n\\t\\t\\t","28","Acts","113")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","23","193.437","Chapter 28","When they had appointed a day for him, they came to him at his lodging in greater numbers. From morning till evening he expounded to them, testifying to the kingdom of God and trying to convince them about Jesus both from the Law of Moses and from the Prophets. \\n\\t\\t\\t","28","Acts","113")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","24","208.901","Chapter 28","And some were convinced by what he said, but others disbelieved. \\n\\t\\t\\t","28","Acts","113")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","25","213.265","Chapter 28","And disagreeing among themselves, they departed after Paul had made one statement: \\u201cThe Holy Spirit was right in saying to your fathers through Isaiah the prophet: \\n\\t\\t\\t","28","Acts","113")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","26","224.371","Chapter 28","\\u201c\\u2018Go to this people, and say, You will indeed hear but never understand, and you will indeed see but never perceive. \\n\\t\\t\\t","28","Acts","113")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("59","Acts","27","235.093","Chapter 28","For this people\\u2019s heart has grown dull, and with their ears they can barely hear, and their eyes they have closed; lest they should see with their eyes and hear with their ears and understand with their heart and turn, and I would heal them.\\u2019 \\n\\t\\t\\t","28","Acts","113")');
