tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","31","236.768","Chapter 3","Do we then overthrow the law by this faith? By no means! On the contrary, we uphold the law. \\n\\t\\t\\n\\t\\t","3","Romans","115")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","1","2.821","Chapter 4","What then shall we say was gained by Abraham, our forefather according to the flesh? \\n\\t\\t\\t","4","Romans","116")');
