tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","6","40.079","Chapter 4","just as David also speaks of the blessing of the one to whom God counts righteousness apart from works: \\n\\t\\t\\t","4","Romans","116")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","7","47.225","Chapter 4","\\u201cBlessed are those whose lawless deeds are forgiven, and whose sins are covered; \\n\\t\\t\\t","4","Romans","116")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","8","53.543","Chapter 4","blessed is the man against whom the Lord will not count his sin.\\u201d \\n\\t\\t\\t","4","Romans","116")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","9","58.609","Chapter 4","Is this blessing then only for the circumcised, or also for the uncircumcised? We say that faith was counted to Abraham as righteousness. \\n\\t\\t\\t","4","Romans","116")');
