tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","11","79.49","Chapter 4","He received the sign of circumcision as a seal of the righteousness that he had by faith while he was still uncircumcised. The purpose was to make him the father of all who believe without being circumcised, so that righteousness would be counted to them as well, \\n\\t\\t\\t","4","Romans","116")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","12","98.623","Chapter 4","and to make him the father of the circumcised who are not merely circumcised but who also walk in the footsteps of the faith that our father Abraham had before he was circumcised. \\n\\t\\t\\t","4","Romans","116")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","13","112","Chapter 4","For the promise to Abraham and his offspring that he would be heir of the world did not come through the law but through the righteousness of faith. \\n\\t\\t\\t","4","Romans","116")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","14","121.424","Chapter 4","For if it is the adherents of the law who are to be the heirs, faith is null and the promise is void. \\n\\t\\t\\t","4","Romans","116")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","15","131.318","Chapter 4","For the law brings wrath, but where there is no law there is no transgression. \\n\\t\\t\\t","4","Romans","116")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","16","137.914","Chapter 4","That is why it depends on faith, in order that the promise may rest on grace and be guaranteed to all his offspring\\u2014not only to the adherent of the law but also to the one who shares the faith of Abraham, who is the father of us all, \\n\\t\\t\\t","4","Romans","116")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","17","155.331","Chapter 4","as it is written, \\u201cI have made you the father of many nations\\u201d\\u2014in the presence of the God in whom he believed, who gives life to the dead and calls into existence the things that do not exist. \\n\\t\\t\\t","4","Romans","116")');
