tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","21","202.649","Chapter 4","fully convinced that God was able to do what he had promised. \\n\\t\\t\\t","4","Romans","116")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","22","207.715","Chapter 4","That is why his faith was \\u201ccounted to him as righteousness.\\u201d \\n\\t\\t\\t","4","Romans","116")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","23","211.702","Chapter 4","But the words \\u201cit was counted to him\\u201d were not written for his sake alone, \\n\\t\\t\\t","4","Romans","116")');
