tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","1","2.874","Chapter 5","Therefore, since we have been justified by faith, we have peace with God through our Lord Jesus Christ. \\n\\t\\t\\t","5","Romans","117")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","2","12.079","Chapter 5","Through him we have also obtained access by faith into this grace in which we stand, and we rejoice in hope of the glory of God. \\n\\t\\t\\t","5","Romans","117")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","3","23.543","Chapter 5","More than that, we rejoice in our sufferings, knowing that suffering produces endurance, \\n\\t\\t\\t","5","Romans","117")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","4","30.742","Chapter 5","and endurance produces character, and character produces hope, \\n\\t\\t\\t","5","Romans","117")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","5","35.477","Chapter 5","and hope does not put us to shame, because God\\u2019s love has been poured into our hearts through the Holy Spirit who has been given to us. \\n\\t\\t\\t","5","Romans","117")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","6","45.967","Chapter 5","For while we were still weak, at the right time Christ died for the ungodly. \\n\\t\\t\\t","5","Romans","117")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","7","52.94","Chapter 5","For one will scarcely die for a righteous person\\u2014though perhaps for a good person one would dare even to die\\u2014 \\n\\t\\t\\t","5","Romans","117")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","8","61.066","Chapter 5","but God shows his love for us in that while we were still sinners, Christ died for us. \\n\\t\\t\\t","5","Romans","117")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","9","68.768","Chapter 5","Since, therefore, we have now been justified by his blood, much more shall we be saved by him from the wrath of God. \\n\\t\\t\\t","5","Romans","117")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","10","79.185","Chapter 5","For if while we were enemies we were reconciled to God by the death of his Son, much more, now that we are reconciled, shall we be saved by his life. \\n\\t\\t\\t","5","Romans","117")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","11","90.887","Chapter 5","More than that, we also rejoice in God through our Lord Jesus Christ, through whom we have now received reconciliation. \\n\\t\\t\\t","5","Romans","117")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","12","100.649","Chapter 5","Therefore, just as sin came into the world through one man, and death through sin, and so death spread to all men because all sinned\\u2014 \\n\\t\\t\\t","5","Romans","117")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","13","111.146","Chapter 5","for sin indeed was in the world before the law was given, but sin is not counted where there is no law. \\n\\t\\t\\t","5","Romans","117")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","14","118.252","Chapter 5","Yet death reigned from Adam to Moses, even over those whose sinning was not like the transgression of Adam, who was a type of the one who was to come. \\n\\t\\t\\t","5","Romans","117")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","15","129.437","Chapter 5","But the free gift is not like the trespass. For if many died through one man\\u2019s trespass, much more have the grace of God and the free gift by the grace of that one man Jesus Christ abounded for many. \\n\\t\\t\\t","5","Romans","117")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","16","145.225","Chapter 5","And the free gift is not like the result of that one man\\u2019s sin. For the judgment following one trespass brought condemnation, but the free gift following many trespasses brought justification. \\n\\t\\t\\t","5","Romans","117")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","17","160.742","Chapter 5","For if, because of one man\\u2019s trespass, death reigned through that one man, much more will those who receive the abundance of grace and the free gift of righteousness reign in life through the one man Jesus Christ. \\n\\t\\t\\t","5","Romans","117")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","18","177.967","Chapter 5","Therefore, as one trespass led to condemnation for all men, so one act of righteousness leads to justification and life for all men. \\n\\t\\t\\t","5","Romans","117")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","19","189.94","Chapter 5","For as by the one man\\u2019s disobedience the many were made sinners, so by the one man\\u2019s obedience the many will be made righteous. \\n\\t\\t\\t","5","Romans","117")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","20","200.265","Chapter 5","Now the law came in to increase the trespass, but where sin increased, grace abounded all the more, \\n\\t\\t\\t","5","Romans","117")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","21","208.199","Chapter 5","so that, as sin reigned in death, grace also might reign through righteousness leading to eternal life through Jesus Christ our Lord. \\n\\t\\t\\n\\t\\t","5","Romans","117")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","1","2.781","Chapter 6","What shall we say then? Are we to continue in sin that grace may abound? \\n\\t\\t\\t","6","Romans","118")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","2","9.199","Chapter 6","By no means! How can we who died to sin still live in it? \\n\\t\\t\\t","6","Romans","118")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","3","15.927","Chapter 6","Do you not know that all of us who have been baptized into Christ Jesus were baptized into his death? \\n\\t\\t\\t","6","Romans","118")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","4","23.861","Chapter 6","We were buried therefore with him by baptism into death, in order that, just as Christ was raised from the dead by the glory of the Father, we too might walk in newness of life. \\n\\t\\t\\t","6","Romans","118")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","5","37.106","Chapter 6","For if we have been united with him in a death like his, we shall certainly be united with him in a resurrection like his. \\n\\t\\t\\t","6","Romans","118")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","6","46.397","Chapter 6","We know that our old self was crucified with him in order that the body of sin might be brought to nothing, so that we would no longer be enslaved to sin. \\n\\t\\t\\t","6","Romans","118")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","7","57.437","Chapter 6","For one who has died has been set free from sin. \\n\\t\\t\\t","6","Romans","118")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","8","62.821","Chapter 6","Now if we have died with Christ, we believe that we will also live with him. \\n\\t\\t\\t","6","Romans","118")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","9","68.675","Chapter 6","We know that Christ, being raised from the dead, will never die again; death no longer has dominion over him. \\n\\t\\t\\t","6","Romans","118")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","10","76.623","Chapter 6","For the death he died he died to sin, once for all, but the life he lives he lives to God. \\n\\t\\t\\t","6","Romans","118")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","11","84.57","Chapter 6","So you also must consider yourselves dead to sin and alive to God in Christ Jesus. \\n\\t\\t\\t","6","Romans","118")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","12","92","Chapter 6","Let not sin therefore reign in your mortal body, to make you obey its passions. \\n\\t\\t\\t","6","Romans","118")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","13","98.543","Chapter 6","Do not present your members to sin as instruments for unrighteousness, but present yourselves to God as those who have been brought from death to life, and your members to God as instruments for righteousness. \\n\\t\\t\\t","6","Romans","118")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","14","112.238","Chapter 6","For sin will have no dominion over you, since you are not under law but under grace. \\n\\t\\t\\t","6","Romans","118")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","15","118.517","Chapter 6","What then? Are we to sin because we are not under law but under grace? By no means! \\n\\t\\t\\t","6","Romans","118")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","16","125.291","Chapter 6","Do you not know that if you present yourselves to anyone as obedient slaves, you are slaves of the one whom you obey, either of sin, which leads to death, or of obedience, which leads to righteousness? \\n\\t\\t\\t","6","Romans","118")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","17","139.967","Chapter 6","But thanks be to God, that you who were once slaves of sin have become obedient from the heart to the standard of teaching to which you were committed, \\n\\t\\t\\t","6","Romans","118")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","18","150.053","Chapter 6","and, having been set free from sin, have become slaves of righteousness. \\n\\t\\t\\t","6","Romans","118")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","19","155.53","Chapter 6","I am speaking in human terms, because of your natural limitations. For just as you once presented your members as slaves to impurity and to lawlessness leading to more lawlessness, so now present your members as slaves to righteousness leading to sanctification. \\n\\t\\t\\t","6","Romans","118")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","20","176.278","Chapter 6","For when you were slaves of sin, you were free in regard to righteousness. \\n\\t\\t\\t","6","Romans","118")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","21","181.662","Chapter 6","But what fruit were you getting at that time from the things of which you are now ashamed? For the end of those things is death. \\n\\t\\t\\t","6","Romans","118")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","22","188.861","Chapter 6","But now that you have been set free from sin and have become slaves of God, the fruit you get leads to sanctification and its end, eternal life. \\n\\t\\t\\t","6","Romans","118")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","23","199.358","Chapter 6","For the wages of sin is death, but the free gift of God is eternal life in Christ Jesus our Lord. \\n\\t\\t\\n\\t\\t","6","Romans","118")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","1","2.649","Chapter 7","Or do you not know, brothers\\u2014for I am speaking to those who know the law\\u2014that the law is binding on a person only as long as he lives? \\n\\t\\t\\t","7","Romans","119")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","2","12.861","Chapter 7","For a married woman is bound by law to her husband while he lives, but if her husband dies she is released from the law of marriage. \\n\\t\\t\\t","7","Romans","119")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","3","22.238","Chapter 7","Accordingly, she will be called an adulteress if she lives with another man while her husband is alive. But if her husband dies, she is free from that law, and if she marries another man she is not an adulteress. \\n\\t\\t\\t","7","Romans","119")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","4","37.291","Chapter 7","Likewise, my brothers, you also have died to the law through the body of Christ, so that you may belong to another, to him who has been raised from the dead, in order that we may bear fruit for God. \\n\\t\\t\\t","7","Romans","119")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","5","50.98","Chapter 7","For while we were living in the flesh, our sinful passions, aroused by the law, were at work in our members to bear fruit for death. \\n\\t\\t\\t","7","Romans","119")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","6","60.278","Chapter 7","But now we are released from the law, having died to that which held us captive, so that we serve in the new way of the Spirit and not in the old way of the written code. \\n\\t\\t\\t","7","Romans","119")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","7","73.781","Chapter 7","What then shall we say? That the law is sin? By no means! Yet if it had not been for the law, I would not have known sin. For I would not have known what it is to covet if the law had not said, \\u201cYou shall not covet.\\u201d \\n\\t\\t\\t","7","Romans","119")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","8","92.689","Chapter 7","But sin, seizing an opportunity through the commandment, produced in me all kinds of covetousness. For apart from the law, sin lies dead. \\n\\t\\t\\t","7","Romans","119")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","9","104.106","Chapter 7","I was once alive apart from the law, but when the commandment came, sin came alive and I died. \\n\\t\\t\\t","7","Romans","119")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","10","112.517","Chapter 7","The very commandment that promised life proved to be death to me. \\n\\t\\t\\t","7","Romans","119")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","11","117.623","Chapter 7","For sin, seizing an opportunity through the commandment, deceived me and through it killed me. \\n\\t\\t\\t","7","Romans","119")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","12","124.768","Chapter 7","So the law is holy, and the commandment is holy and righteous and good. \\n\\t\\t\\t","7","Romans","119")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","13","130.212","Chapter 7","Did that which is good, then, bring death to me? By no means! It was sin, producing death in me through what is good, in order that sin might be shown to be sin, and through the commandment might become sinful beyond measure. \\n\\t\\t\\t","7","Romans","119")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","14","146.278","Chapter 7","For we know that the law is spiritual, but I am of the flesh, sold under sin. \\n\\t\\t\\t","7","Romans","119")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","15","152.318","Chapter 7","For I do not understand my own actions. For I do not do what I want, but I do the very thing I hate. \\n\\t\\t\\t","7","Romans","119")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","16","160.808","Chapter 7","Now if I do what I do not want, I agree with the law, that it is good. \\n\\t\\t\\t","7","Romans","119")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","17","167.132","Chapter 7","So now it is no longer I who do it, but sin that dwells within me. \\n\\t\\t\\t","7","Romans","119")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","18","172.702","Chapter 7","For I know that nothing good dwells in me, that is, in my flesh. For I have the desire to do what is right, but not the ability to carry it out. \\n\\t\\t\\t","7","Romans","119")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","19","183.57","Chapter 7","For I do not do the good I want, but the evil I do not want is what I keep on doing. \\n\\t\\t\\t","7","Romans","119")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","20","190.397","Chapter 7","Now if I do what I do not want, it is no longer I who do it, but sin that dwells within me. \\n\\t\\t\\t","7","Romans","119")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","21","199.119","Chapter 7","So I find it to be a law that when I want to do right, evil lies close at hand. \\n\\t\\t\\t","7","Romans","119")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","22","205.821","Chapter 7","For I delight in the law of God, in my inner being, \\n\\t\\t\\t","7","Romans","119")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","23","209.954","Chapter 7","but I see in my members another law waging war against the law of my mind and making me captive to the law of sin that dwells in my members. \\n\\t\\t\\t","7","Romans","119")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","24","219.331","Chapter 7","Wretched man that I am! Who will deliver me from this body of death? \\n\\t\\t\\t","7","Romans","119")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","25","226.026","Chapter 7","Thanks be to God through Jesus Christ our Lord! So then, I myself serve the law of God with my mind, but with my flesh I serve the law of sin. \\n\\t\\t\\n\\t\\t","7","Romans","119")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","1","2.649","Chapter 8","There is therefore now no condemnation for those who are in Christ Jesus. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","2","9.053","Chapter 8","For the law of the Spirit of life has set you free in Christ Jesus from the law of sin and death. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","3","16.344","Chapter 8","For God has done what the law, weakened by the flesh, could not do. By sending his own Son in the likeness of sinful flesh and for sin, he condemned sin in the flesh, \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","4","29.026","Chapter 8","in order that the righteous requirement of the law might be fulfilled in us, who walk not according to the flesh but according to the Spirit. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","5","38.132","Chapter 8","For those who live according to the flesh set their minds on the things of the flesh, but those who live according to the Spirit set their minds on the things of the Spirit. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","6","49.093","Chapter 8","For to set the mind on the flesh is death, but to set the mind on the Spirit is life and peace. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","7","56.702","Chapter 8","For the mind that is set on the flesh is hostile to God, for it does not submit to God\\u2019s law; indeed, it cannot. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","8","66.132","Chapter 8","Those who are in the flesh cannot please God. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","9","70.954","Chapter 8","You, however, are not in the flesh but in the Spirit, if in fact the Spirit of God dwells in you. Anyone who does not have the Spirit of Christ does not belong to him. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","10","82.742","Chapter 8","But if Christ is in you, although the body is dead because of sin, the Spirit is life because of righteousness. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","11","91.053","Chapter 8","If the Spirit of him who raised Jesus from the dead dwells in you, he who raised Christ Jesus from the dead will also give life to your mortal bodies through his Spirit who dwells in you. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","12","103.689","Chapter 8","So then, brothers, we are debtors, not to the flesh, to live according to the flesh. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","13","110.649","Chapter 8","For if you live according to the flesh you will die, but if by the Spirit you put to death the deeds of the body, you will live. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","14","118.636","Chapter 8","For all who are led by the Spirit of God are sons of God. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","15","123.517","Chapter 8","For you did not receive the spirit of slavery to fall back into fear, but you have received the Spirit of adoption as sons, by whom we cry, \\u201cAbba! Father!\\u201d \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","16","135.411","Chapter 8","The Spirit himself bears witness with our spirit that we are children of God, \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","17","142.424","Chapter 8","and if children, then heirs\\u2014heirs of God and fellow heirs with Christ, provided we suffer with him in order that we may also be glorified with him. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","18","152.609","Chapter 8","For I consider that the sufferings of this present time are not worth comparing with the glory that is to be revealed to us. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","19","161.53","Chapter 8","For the creation waits with eager longing for the revealing of the sons of God. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","20","168.305","Chapter 8","For the creation was subjected to futility, not willingly, but because of him who subjected it, in hope \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","21","175.517","Chapter 8","that the creation itself will be set free from its bondage to corruption and obtain the freedom of the glory of the children of God. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","22","184.291","Chapter 8","For we know that the whole creation has been groaning together in the pains of childbirth until now. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","23","191.397","Chapter 8","And not only the creation, but we ourselves, who have the firstfruits of the Spirit, groan inwardly as we wait eagerly for adoption as sons, the redemption of our bodies. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","24","204.265","Chapter 8","For in this hope we were saved. Now hope that is seen is not hope. For who hopes for what he sees? \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","25","214.199","Chapter 8","But if we hope for what we do not see, we wait for it with patience. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","26","219.954","Chapter 8","Likewise the Spirit helps us in our weakness. For we do not know what to pray for as we ought, but the Spirit himself intercedes for us with groanings too deep for words. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","27","232.675","Chapter 8","And he who searches hearts knows what is the mind of the Spirit, because the Spirit intercedes for the saints according to the will of God. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","28","242.159","Chapter 8","And we know that for those who love God all things work together for good, for those who are called according to his purpose. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","29","251.808","Chapter 8","For those whom he foreknew he also predestined to be conformed to the image of his Son, in order that he might be the firstborn among many brothers. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","30","262.583","Chapter 8","And those whom he predestined he also called, and those whom he called he also justified, and those whom he justified he also glorified. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","31","274.159","Chapter 8","What then shall we say to these things? If God is for us, who can be against us? \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","32","281.556","Chapter 8","He who did not spare his own Son but gave him up for us all, how will he not also with him graciously give us all things? \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","33","292.556","Chapter 8","Who shall bring any charge against God\\u2019s elect? It is God who justifies. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","34","298.914","Chapter 8","Who is to condemn? Christ Jesus is the one who died\\u2014more than that, who was raised\\u2014who is at the right hand of God, who indeed is interceding for us. \\n\\t\\t\\t","8","Romans","120")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("60","Rom","35","311.781","Chapter 8","Who shall separate us from the love of Christ? Shall tribulation, or distress, or persecution, or famine, or nakedness, or danger, or sword? \\n\\t\\t\\t","8","Romans","120")');
