tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","25","182.026","Chapter 1","For the foolishness of God is wiser than men, and the weakness of God is stronger than men. \\n\\t\\t\\t","1","1 Corinthians","128")');
