tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","29","211","Chapter 1","so that no human being might boast in the presence of God. \\n\\t\\t\\t","1","1 Corinthians","128")');
