tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","1","3.358","Chapter 2","And I, when I came to you, brothers, did not come proclaiming to you the testimony of God with lofty speech or wisdom. \\n\\t\\t\\t","2","1 Corinthians","129")');
