tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","3","17.742","Chapter 2","And I was with you in weakness and in fear and much trembling, \\n\\t\\t\\t","2","1 Corinthians","129")');
