tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","5","29.106","Chapter 2","that your faith might not rest in the wisdom of men but in the power of God. \\n\\t\\t\\t","2","1 Corinthians","129")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","6","34.914","Chapter 2","Yet among the mature we do impart wisdom, although it is not a wisdom of this age or of the rulers of this age, who are doomed to pass away. \\n\\t\\t\\t","2","1 Corinthians","129")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","7","42.94","Chapter 2","But we impart a secret and hidden wisdom of God, which God decreed before the ages for our glory. \\n\\t\\t\\t","2","1 Corinthians","129")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","8","49.49","Chapter 2","None of the rulers of this age understood this, for if they had, they would not have crucified the Lord of glory. \\n\\t\\t\\t","2","1 Corinthians","129")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","9","54.834","Chapter 2","But, as it is written, \\u201cWhat no eye has seen, nor ear heard, nor the heart of man imagined, what God has prepared for those who love him\\u201d\\u2014 \\n\\t\\t\\t","2","1 Corinthians","129")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","10","63.291","Chapter 2","these things God has revealed to us through the Spirit. For the Spirit searches everything, even the depths of God. \\n\\t\\t\\t","2","1 Corinthians","129")');
