tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","13","89.477","Chapter 2","And we impart this in words not taught by human wisdom but taught by the Spirit, interpreting spiritual truths to those who are spiritual. \\n\\t\\t\\t","2","1 Corinthians","129")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","14","98.159","Chapter 2","The natural person does not accept the things of the Spirit of God, for they are folly to him, and he is not able to understand them because they are spiritually discerned. \\n\\t\\t\\t","2","1 Corinthians","129")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","15","108.013","Chapter 2","The spiritual person judges all things, but is himself to be judged by no one. \\n\\t\\t\\t","2","1 Corinthians","129")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","16","114","Chapter 2","\\u201cFor who has understood the mind of the Lord so as to instruct him?\\u201d But we have the mind of Christ. \\n\\t\\t\\n\\t\\t","2","1 Corinthians","129")');

