tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","5","38.477","Chapter 3","What then is Apollos? What is Paul? Servants through whom you believed, as the Lord assigned to each. \\n\\t\\t\\t","3","1 Corinthians","130")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","6","47.172","Chapter 3","I planted, Apollos watered, but God gave the growth. \\n\\t\\t\\t","3","1 Corinthians","130")');
