tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","14","108.04","Chapter 3","If the work that anyone has built on the foundation survives, he will receive a reward. \\n\\t\\t\\t","3","1 Corinthians","130")');
