tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","16","122.212","Chapter 3","Do you not know that you are God\\u2019s temple and that God\\u2019s Spirit dwells in you? \\n\\t\\t\\t","3","1 Corinthians","130")');
