tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","21","157.914","Chapter 3","So let no one boast in men. For all things are yours, \\n\\t\\t\\t","3","1 Corinthians","130")');
