tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","23","171.795","Chapter 3","and you are Christ\\u2019s, and Christ is God\\u2019s. \\n\\t\\t\\n\\t\\t","3","1 Corinthians","130")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","1","3.291","Chapter 4","This is how one should regard us, as servants of Christ and stewards of the mysteries of God. \\n\\t\\t\\t","4","1 Corinthians","131")');
