tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","3","13.238","Chapter 4","But with me it is a very small thing that I should be judged by you or by any human court. In fact, I do not even judge myself. \\n\\t\\t\\t","4","1 Corinthians","131")');
