tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","8","70.954","Chapter 4","Already you have all you want! Already you have become rich! Without us you have become kings! And would that you did reign, so that we might share the rule with you! \\n\\t\\t\\t","4","1 Corinthians","131")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","9","84.199","Chapter 4","For I think that God has exhibited us apostles as last of all, like men sentenced to death, because we have become a spectacle to the world, to angels, and to men. \\n\\t\\t\\t","4","1 Corinthians","131")');
