tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","11","109.728","Chapter 4","To the present hour we hunger and thirst, we are poorly dressed and buffeted and homeless, \\n\\t\\t\\t","4","1 Corinthians","131")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","12","115.954","Chapter 4","and we labor, working with our own hands. When reviled, we bless; when persecuted, we endure; \\n\\t\\t\\t","4","1 Corinthians","131")');
