tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","14","93.702","Chapter 16","Let all that you do be done in love. \\n\\t\\t\\t","16","1 Corinthians","143")');
