tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("61","1Cor","24","149.914","Chapter 16","My love be with you all in Christ Jesus. Amen. \\n\\n\\t\\t\\n\\t","16","1 Corinthians","143")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","1","1.689","Chapter 1","Paul, an apostle of Christ Jesus by the will of God, and Timothy our brother, To the church of God that is at Corinth, with all the saints who are in the whole of Achaia: \\n\\t\\t\\t","1","2 Corinthians","143")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","2","16.781","Chapter 1","Grace to you and peace from God our Father and the Lord Jesus Christ. \\n\\t\\t\\t","1","2 Corinthians","143")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","3","22.543","Chapter 1","Blessed be the God and Father of our Lord Jesus Christ, the Father of mercies and God of all comfort, \\n\\t\\t\\t","1","2 Corinthians","143")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","4","29.185","Chapter 1","who comforts us in all our affliction, so that we may be able to comfort those who are in any affliction, with the comfort with which we ourselves are comforted by God. \\n\\t\\t\\t","1","2 Corinthians","143")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","5","39.543","Chapter 1","For as we share abundantly in Christ\\u2019s sufferings, so through Christ we share abundantly in comfort too. \\n\\t\\t\\t","1","2 Corinthians","143")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","6","47.675","Chapter 1","If we are afflicted, it is for your comfort and salvation; and if we are comforted, it is for your comfort, which you experience when you patiently endure the same sufferings that we suffer. \\n\\t\\t\\t","1","2 Corinthians","143")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","7","59.146","Chapter 1","Our hope for you is unshaken, for we know that as you share in our sufferings, you will also share in our comfort. \\n\\t\\t\\t","1","2 Corinthians","143")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","8","67.265","Chapter 1","For we do not want you to be ignorant, brothers, of the affliction we experienced in Asia. For we were so utterly burdened beyond our strength that we despaired of life itself. \\n\\t\\t\\t","1","2 Corinthians","143")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","9","76.927","Chapter 1","Indeed, we felt that we had received the sentence of death. But that was to make us rely not on ourselves but on God who raises the dead. \\n\\t\\t\\t","1","2 Corinthians","143")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","10","85.238","Chapter 1","He delivered us from such a deadly peril, and he will deliver us. On him we have set our hope that he will deliver us again. \\n\\t\\t\\t","1","2 Corinthians","143")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","11","92.901","Chapter 1","You also must help us by prayer, so that many will give thanks on our behalf for the blessing granted us through the prayers of many. \\n\\t\\t\\t","1","2 Corinthians","143")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","12","100.384","Chapter 1","For our boast is this, the testimony of our conscience, that we behaved in the world with simplicity and godly sincerity, not by earthly wisdom but by the grace of God, and supremely so toward you. \\n\\t\\t\\t","1","2 Corinthians","143")');
