tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","12","99.675","Chapter 6","You are not restricted by us, but you are restricted in your own affections. \\n\\t\\t\\t","6","2 Corinthians","148")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","13","105.477","Chapter 6","In return (I speak as to children) widen your hearts also. \\n\\t\\t\\t","6","2 Corinthians","148")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","14","110.636","Chapter 6","Do not be unequally yoked with unbelievers. For what partnership has righteousness with lawlessness? Or what fellowship has light with darkness? \\n\\t\\t\\t","6","2 Corinthians","148")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","15","120.252","Chapter 6","What accord has Christ with Belial? Or what portion does a believer share with an unbeliever? \\n\\t\\t\\t","6","2 Corinthians","148")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","16","127.212","Chapter 6","What agreement has the temple of God with idols? For we are the temple of the living God; as God said, \\u201cI will make my dwelling among them and walk among them, and I will be their God, and they shall be my people. \\n\\t\\t\\t","6","2 Corinthians","148")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","17","143.742","Chapter 6","Therefore go out from their midst, and be separate from them, says the Lord, and touch no unclean thing; then I will welcome you, \\n\\t\\t\\t","6","2 Corinthians","148")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","18","152.384","Chapter 6","and I will be a father to you, and you shall be sons and daughters to me, says the Lord Almighty.\\u201d \\n\\t\\t\\n\\t\\t","6","2 Corinthians","148")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","1","2.914","Chapter 7","Since we have these promises, beloved, let us cleanse ourselves from every defilement of body and spirit, bringing holiness to completion in the fear of God. \\n\\t\\t\\t","7","2 Corinthians","149")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","2","14.49","Chapter 7","Make room in your hearts for us. We have wronged no one, we have corrupted no one, we have taken advantage of no one. \\n\\t\\t\\t","7","2 Corinthians","149")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","3","22.662","Chapter 7","I do not say this to condemn you, for I said before that you are in our hearts, to die together and to live together. \\n\\t\\t\\t","7","2 Corinthians","149")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","4","30.464","Chapter 7","I am acting with great boldness toward you; I have great pride in you; I am filled with comfort. In all our affliction, I am overflowing with joy. \\n\\t\\t\\t","7","2 Corinthians","149")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","5","41.609","Chapter 7","For even when we came into Macedonia, our bodies had no rest, but we were afflicted at every turn\\u2014fighting without and fear within. \\n\\t\\t\\t","7","2 Corinthians","149")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","6","52.477","Chapter 7","But God, who comforts the downcast, comforted us by the coming of Titus, \\n\\t\\t\\t","7","2 Corinthians","149")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","7","58.517","Chapter 7","and not only by his coming but also by the comfort with which he was comforted by you, as he told us of your longing, your mourning, your zeal for me, so that I rejoiced still more. \\n\\t\\t\\t","7","2 Corinthians","149")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","8","71.742","Chapter 7","For even if I made you grieve with my letter, I do not regret it\\u2014though I did regret it, for I see that that letter grieved you, though only for a while. \\n\\t\\t\\t","7","2 Corinthians","149")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","9","82.702","Chapter 7","As it is, I rejoice, not because you were grieved, but because you were grieved into repenting. For you felt a godly grief, so that you suffered no loss through us. \\n\\t\\t\\t","7","2 Corinthians","149")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","10","95.291","Chapter 7","For godly grief produces a repentance that leads to salvation without regret, whereas worldly grief produces death. \\n\\t\\t\\t","7","2 Corinthians","149")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","11","103.689","Chapter 7","For see what earnestness this godly grief has produced in you, but also what eagerness to clear yourselves, what indignation, what fear, what longing, what zeal, what punishment! At every point you have proved yourselves innocent in the matter. \\n\\t\\t\\t","7","2 Corinthians","149")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","12","122.649","Chapter 7","So although I wrote to you, it was not for the sake of the one who did the wrong, nor for the sake of the one who suffered the wrong, but in order that your earnestness for us might be revealed to you in the sight of God. \\n\\t\\t\\t","7","2 Corinthians","149")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","13","135.318","Chapter 7","Therefore we are comforted. And besides our own comfort, we rejoiced still more at the joy of Titus, because his spirit has been refreshed by you all. \\n\\t\\t\\t","7","2 Corinthians","149")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","14","144.927","Chapter 7","For whatever boasts I made to him about you, I was not put to shame. But just as everything we said to you was true, so also our boasting before Titus has proved true. \\n\\t\\t\\t","7","2 Corinthians","149")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","15","155.98","Chapter 7","And his affection for you is even greater, as he remembers the obedience of you all, how you received him with fear and trembling. \\n\\t\\t\\t","7","2 Corinthians","149")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","16","164.212","Chapter 7","I rejoice, because I have perfect confidence in you. \\n\\t\\t\\n\\t\\t","7","2 Corinthians","149")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","1","3.119","Chapter 8","We want you to know, brothers, about the grace of God that has been given among the churches of Macedonia, \\n\\t\\t\\t","8","2 Corinthians","150")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","2","10.305","Chapter 8","for in a severe test of affliction, their abundance of joy and their extreme poverty have overflowed in a wealth of generosity on their part. \\n\\t\\t\\t","8","2 Corinthians","150")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","3","18.901","Chapter 8","For they gave according to their means, as I can testify, and beyond their means, of their own accord, \\n\\t\\t\\t","8","2 Corinthians","150")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","4","26.013","Chapter 8","begging us earnestly for the favor of taking part in the relief of the saints\\u2014 \\n\\t\\t\\t","8","2 Corinthians","150")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","5","30.45","Chapter 8","and this, not as we expected, but they gave themselves first to the Lord and then by the will of God to us. \\n\\t\\t\\t","8","2 Corinthians","150")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","6","38.305","Chapter 8","Accordingly, we urged Titus that as he had started, so he should complete among you this act of grace. \\n\\t\\t\\t","8","2 Corinthians","150")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","7","45.914","Chapter 8","But as you excel in everything\\u2014in faith, in speech, in knowledge, in all earnestness, and in our love for you\\u2014see that you excel in this act of grace also. \\n\\t\\t\\t","8","2 Corinthians","150")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","8","56.967","Chapter 8","I say this not as a command, but to prove by the earnestness of others that your love also is genuine. \\n\\t\\t\\t","8","2 Corinthians","150")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","9","64.397","Chapter 8","For you know the grace of our Lord Jesus Christ, that though he was rich, yet for your sake he became poor, so that you by his poverty might become rich. \\n\\t\\t\\t","8","2 Corinthians","150")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","10","74.53","Chapter 8","And in this matter I give my judgment: this benefits you, who a year ago started not only to do this work but also to desire to do it. \\n\\t\\t\\t","8","2 Corinthians","150")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","11","85.026","Chapter 8","So now finish doing it as well, so that your readiness in desiring it may be matched by your completing it out of what you have. \\n\\t\\t\\t","8","2 Corinthians","150")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","12","94.132","Chapter 8","For if the readiness is there, it is acceptable according to what a person has, not according to what he does not have. \\n\\t\\t\\t","8","2 Corinthians","150")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","13","101.927","Chapter 8","For I do not mean that others should be eased and you burdened, but that as a matter of fairness \\n\\t\\t\\t","8","2 Corinthians","150")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","14","107.728","Chapter 8","your abundance at the present time should supply their need, so that their abundance may supply your need, that there may be fairness. \\n\\t\\t\\t","8","2 Corinthians","150")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","15","115.344","Chapter 8","As it is written, \\u201cWhoever gathered much had nothing left over, and whoever gathered little had no lack.\\u201d \\n\\t\\t\\t","8","2 Corinthians","150")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","16","122.954","Chapter 8","But thanks be to God, who put into the heart of Titus the same earnest care I have for you. \\n\\t\\t\\t","8","2 Corinthians","150")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","17","129.649","Chapter 8","For he not only accepted our appeal, but being himself very earnest he is going to you of his own accord. \\n\\t\\t\\t","8","2 Corinthians","150")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","18","137.265","Chapter 8","With him we are sending the brother who is famous among all the churches for his preaching of the gospel. \\n\\t\\t\\t","8","2 Corinthians","150")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","19","143.53","Chapter 8","And not only that, but he has been appointed by the churches to travel with us as we carry out this act of grace that is being ministered by us, for the glory of the Lord himself and to show our good will. \\n\\t\\t\\t","8","2 Corinthians","150")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","20","156.397","Chapter 8","We take this course so that no one should blame us about this generous gift that is being administered by us, \\n\\t\\t\\t","8","2 Corinthians","150")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","21","163.371","Chapter 8","for we aim at what is honorable not only in the Lord\\u2019s sight but also in the sight of man. \\n\\t\\t\\t","8","2 Corinthians","150")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","22","169.583","Chapter 8","And with them we are sending our brother whom we have often tested and found earnest in many matters, but who is now more earnest than ever because of his great confidence in you. \\n\\t\\t\\t","8","2 Corinthians","150")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","23","179.808","Chapter 8","As for Titus, he is my partner and fellow worker for your benefit. And as for our brothers, they are messengers of the churches, the glory of Christ. \\n\\t\\t\\t","8","2 Corinthians","150")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","24","189.927","Chapter 8","So give proof before the churches of your love and of our boasting about you to these men. \\n\\t\\t\\n\\t\\t","8","2 Corinthians","150")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","1","3.662","Chapter 9","Now it is superfluous for me to write to you about the ministry for the saints, \\n\\t\\t\\t","9","2 Corinthians","151")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","2","8.901","Chapter 9","for I know your readiness, of which I boast about you to the people of Macedonia, saying that Achaia has been ready since last year. And your zeal has stirred up most of them. \\n\\t\\t\\t","9","2 Corinthians","151")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","3","20.291","Chapter 9","But I am sending the brothers so that our boasting about you may not prove empty in this matter, so that you may be ready, as I said you would be. \\n\\t\\t\\t","9","2 Corinthians","151")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","4","29.119","Chapter 9","Otherwise, if some Macedonians come with me and find that you are not ready, we would be humiliated\\u2014to say nothing of you\\u2014for being so confident. \\n\\t\\t\\t","9","2 Corinthians","151")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","5","38.954","Chapter 9","So I thought it necessary to urge the brothers to go on ahead to you and arrange in advance for the gift you have promised, so that it may be ready as a willing gift, not as an exaction. \\n\\t\\t\\t","9","2 Corinthians","151")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","6","50.053","Chapter 9","The point is this: whoever sows sparingly will also reap sparingly, and whoever sows bountifully will also reap bountifully. \\n\\t\\t\\t","9","2 Corinthians","151")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","7","59.901","Chapter 9","Each one must give as he has decided in his heart, not reluctantly or under compulsion, for God loves a cheerful giver. \\n\\t\\t\\t","9","2 Corinthians","151")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","8","68.358","Chapter 9","And God is able to make all grace abound to you, so that having all sufficiency in all things at all times, you may abound in every good work. \\n\\t\\t\\t","9","2 Corinthians","151")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","9","77.132","Chapter 9","As it is written, \\u201cHe has distributed freely, he has given to the poor; his righteousness endures forever.\\u201d \\n\\t\\t\\t","9","2 Corinthians","151")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","10","85.861","Chapter 9","He who supplies seed to the sower and bread for food will supply and multiply your seed for sowing and increase the harvest of your righteousness. \\n\\t\\t\\t","9","2 Corinthians","151")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","11","96.265","Chapter 9","You will be enriched in every way to be generous in every way, which through us will produce thanksgiving to God. \\n\\t\\t\\t","9","2 Corinthians","151")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","12","104.305","Chapter 9","For the ministry of this service is not only supplying the needs of the saints but is also overflowing in many thanksgivings to God. \\n\\t\\t\\t","9","2 Corinthians","151")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","13","112.795","Chapter 9","By their approval of this service, they will glorify God because of your submission flowing from your confession of the gospel of Christ, and the generosity of your contribution for them and for all others, \\n\\t\\t\\t","9","2 Corinthians","151")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","14","124.728","Chapter 9","while they long for you and pray for you, because of the surpassing grace of God upon you. \\n\\t\\t\\t","9","2 Corinthians","151")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","15","130.583","Chapter 9","Thanks be to God for his inexpressible gift! \\n\\t\\t\\n\\t\\t","9","2 Corinthians","151")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","1","3.252","Chapter 10","I, Paul, myself entreat you, by the meekness and gentleness of Christ\\u2014I who am humble when face to face with you, but bold toward you when I am away!\\u2014 \\n\\t\\t\\t","10","2 Corinthians","152")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","2","15.185","Chapter 10","I beg of you that when I am present I may not have to show boldness with such confidence as I count on showing against some who suspect us of walking according to the flesh. \\n\\t\\t\\t","10","2 Corinthians","152")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","3","27.132","Chapter 10","For though we walk in the flesh, we are not waging war according to the flesh. \\n\\t\\t\\t","10","2 Corinthians","152")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","4","32.517","Chapter 10","For the weapons of our warfare are not of the flesh but have divine power to destroy strongholds. \\n\\t\\t\\t","10","2 Corinthians","152")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","5","39.887","Chapter 10","We destroy arguments and every lofty opinion raised against the knowledge of God, and take every thought captive to obey Christ, \\n\\t\\t\\t","10","2 Corinthians","152")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","6","48.954","Chapter 10","being ready to punish every disobedience, when your obedience is complete. \\n\\t\\t\\t","10","2 Corinthians","152")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","7","54.291","Chapter 10","Look at what is before your eyes. If anyone is confident that he is Christ\\u2019s, let him remind himself that just as he is Christ\\u2019s, so also are we. \\n\\t\\t\\t","10","2 Corinthians","152")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","8","65.066","Chapter 10","For even if I boast a little too much of our authority, which the Lord gave for building you up and not for destroying you, I will not be ashamed. \\n\\t\\t\\t","10","2 Corinthians","152")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","9","75.053","Chapter 10","I do not want to appear to be frightening you with my letters. \\n\\t\\t\\t","10","2 Corinthians","152")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","10","79.053","Chapter 10","For they say, \\u201cHis letters are weighty and strong, but his bodily presence is weak, and his speech of no account.\\u201d \\n\\t\\t\\t","10","2 Corinthians","152")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","11","86.477","Chapter 10","Let such a person understand that what we say by letter when absent, we do when present. \\n\\t\\t\\t","10","2 Corinthians","152")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","12","93.397","Chapter 10","Not that we dare to classify or compare ourselves with some of those who are commending themselves. But when they measure themselves by one another and compare themselves with one another, they are without understanding. \\n\\t\\t\\t","10","2 Corinthians","152")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","13","106.026","Chapter 10","But we will not boast beyond limits, but will boast only with regard to the area of influence God assigned to us, to reach even to you. \\n\\t\\t\\t","10","2 Corinthians","152")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","14","115.781","Chapter 10","For we are not overextending ourselves, as though we did not reach you. For we were the first to come all the way to you with the gospel of Christ. \\n\\t\\t\\t","10","2 Corinthians","152")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","15","124.874","Chapter 10","We do not boast beyond limit in the labors of others. But our hope is that as your faith increases, our area of influence among you may be greatly enlarged, \\n\\t\\t\\t","10","2 Corinthians","152")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","16","135.278","Chapter 10","so that we may preach the gospel in lands beyond you, without boasting of work already done in another\\u2019s area of influence. \\n\\t\\t\\t","10","2 Corinthians","152")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","17","144.013","Chapter 10","\\u201cLet the one who boasts, boast in the Lord.\\u201d \\n\\t\\t\\t","10","2 Corinthians","152")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","18","148","Chapter 10","For it is not the one who commends himself who is approved, but the one whom the Lord commends. \\n\\t\\t\\n\\t\\t","10","2 Corinthians","152")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","1","3.57","Chapter 11","I wish you would bear with me in a little foolishness. Do bear with me! \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","2","9.146","Chapter 11","For I feel a divine jealousy for you, since I betrothed you to one husband, to present you as a pure virgin to Christ. \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","3","16.795","Chapter 11","But I am afraid that as the serpent deceived Eve by his cunning, your thoughts will be led astray from a sincere and pure devotion to Christ. \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","4","25.583","Chapter 11","For if someone comes and proclaims another Jesus than the one we proclaimed, or if you receive a different spirit from the one you received, or if you accept a different gospel from the one you accepted, you put up with it readily enough. \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","5","40.768","Chapter 11","Indeed, I consider that I am not in the least inferior to these super-apostles. \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","6","47.04","Chapter 11","Even if I am unskilled in speaking, I am not so in knowledge; indeed, in every way we have made this plain to you in all things. \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","7","56.053","Chapter 11","Or did I commit a sin in humbling myself so that you might be exalted, because I preached God\\u2019s gospel to you free of charge? \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","8","63.94","Chapter 11","I robbed other churches by accepting support from them in order to serve you. \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","9","69.649","Chapter 11","And when I was with you and was in need, I did not burden anyone, for the brothers who came from Macedonia supplied my need. So I refrained and will refrain from burdening you in any way. \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","10","82.278","Chapter 11","As the truth of Christ is in me, this boasting of mine will not be silenced in the regions of Achaia. \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","11","89.57","Chapter 11","And why? Because I do not love you? God knows I do! \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","12","94.225","Chapter 11","And what I do I will continue to do, in order to undermine the claim of those who would like to claim that in their boasted mission they work on the same terms as we do. \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","13","105.093","Chapter 11","For such men are false apostles, deceitful workmen, disguising themselves as apostles of Christ. \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","14","112.556","Chapter 11","And no wonder, for even Satan disguises himself as an angel of light. \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","15","117.94","Chapter 11","So it is no surprise if his servants, also, disguise themselves as servants of righteousness. Their end will correspond to their deeds. \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","16","126.675","Chapter 11","I repeat, let no one think me foolish. But even if you do, accept me as a fool, so that I too may boast a little. \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","17","135.278","Chapter 11","What I am saying with this boastful confidence, I say not with the Lord\\u2019s authority but as a fool. \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","18","142.649","Chapter 11","Since many boast according to the flesh, I too will boast. \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","19","147.53","Chapter 11","For you gladly bear with fools, being wise yourselves! \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","20","151.715","Chapter 11","For you bear it if someone makes slaves of you, or devours you, or takes advantage of you, or puts on airs, or strikes you in the face. \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","21","160.675","Chapter 11","To my shame, I must say, we were too weak for that! But whatever anyone else dares to boast of\\u2014I am speaking as a fool\\u2014I also dare to boast of that. \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","22","172.238","Chapter 11","Are they Hebrews? So am I. Are they Israelites? So am I. Are they offspring of Abraham? So am I. \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","23","182.132","Chapter 11","Are they servants of Christ? I am a better one\\u2014I am talking like a madman\\u2014with far greater labors, far more imprisonments, with countless beatings, and often near death. \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","24","194.808","Chapter 11","Five times I received at the hands of the Jews the forty lashes less one. \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","25","201.305","Chapter 11","Three times I was beaten with rods. Once I was stoned. Three times I was shipwrecked; a night and a day I was adrift at sea; \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","26","210.821","Chapter 11","on frequent journeys, in danger from rivers, danger from robbers, danger from my own people, danger from Gentiles, danger in the city, danger in the wilderness, danger at sea, danger from false brothers; \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","27","226.106","Chapter 11","in toil and hardship, through many a sleepless night, in hunger and thirst, often without food,in cold and exposure. \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","28","235.066","Chapter 11","And, apart from other things, there is the daily pressure on me of my anxiety for all the churches. \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","29","241.503","Chapter 11","Who is weak, and I am not weak? Who is made to fall, and I am not indignant? \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","30","247.901","Chapter 11","If I must boast, I will boast of the things that show my weakness. \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","31","253.437","Chapter 11","The God and Father of the Lord Jesus, he who is blessed forever, knows that I am not lying. \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","32","260.119","Chapter 11","At Damascus, the governor under King Aretas was guarding the city of Damascus in order to seize me, \\n\\t\\t\\t","11","2 Corinthians","153")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","33","266.715","Chapter 11","but I was let down in a basket through a window in the wall and escaped his hands. \\n\\t\\t\\n\\t\\t","11","2 Corinthians","153")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","1","2.927","Chapter 12","I must go on boasting. Though there is nothing to be gained by it, I will go on to visions and revelations of the Lord. \\n\\t\\t\\t","12","2 Corinthians","154")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","2","11.795","Chapter 12","I know a man in Christ who fourteen years ago was caught up to the third heaven\\u2014whether in the body or out of the body I do not know, God knows. \\n\\t\\t\\t","12","2 Corinthians","154")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","3","21.927","Chapter 12","And I know that this man was caught up into paradise\\u2014whether in the body or out of the body I do not know, God knows\\u2014 \\n\\t\\t\\t","12","2 Corinthians","154")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","4","29.45","Chapter 12","and he heard things that cannot be told, which man may not utter. \\n\\t\\t\\t","12","2 Corinthians","154")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","5","33.768","Chapter 12","On behalf of this man I will boast, but on my own behalf I will not boast, except of my weaknesses. \\n\\t\\t\\t","12","2 Corinthians","154")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","6","42.172","Chapter 12","Though if I should wish to boast, I would not be a fool, for I would be speaking the truth. But I refrain from it, so that no one may think more of me than he sees in me or hears from me. \\n\\t\\t\\t","12","2 Corinthians","154")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","7","54.53","Chapter 12","So to keep me from becoming conceited because of the surpassing greatness of the revelations, a thorn was given me in the flesh, a messenger of Satan to harass me, to keep me from becoming conceited. \\n\\t\\t\\t","12","2 Corinthians","154")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","8","67.662","Chapter 12","Three times I pleaded with the Lord about this, that it should leave me. \\n\\t\\t\\t","12","2 Corinthians","154")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","9","72.768","Chapter 12","But he said to me, \\u201cMy grace is sufficient for you, for my power is made perfect in weakness.\\u201d Therefore I will boast all the more gladly of my weaknesses, so that the power of Christ may rest upon me. \\n\\t\\t\\t","12","2 Corinthians","154")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","10","86.848","Chapter 12","For the sake of Christ, then, I am content with weaknesses, insults, hardships, persecutions, and calamities. For when I am weak, then I am strong. \\n\\t\\t\\t","12","2 Corinthians","154")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","11","98.278","Chapter 12","I have been a fool! You forced me to it, for I ought to have been commended by you. For I was not at all inferior to these super-apostles, even though I am nothing. \\n\\t\\t\\t","12","2 Corinthians","154")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","12","111.649","Chapter 12","The signs of a true apostle were performed among you with utmost patience, with signs and wonders and mighty works. \\n\\t\\t\\t","12","2 Corinthians","154")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","13","120.013","Chapter 12","For in what were you less favored than the rest of the churches, except that I myself did not burden you? Forgive me this wrong! \\n\\t\\t\\t","12","2 Corinthians","154")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","14","128.411","Chapter 12","Here for the third time I am ready to come to you. And I will not be a burden, for I seek not what is yours but you. For children are not obligated to save up for their parents, but parents for their children. \\n\\t\\t\\t","12","2 Corinthians","154")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","15","143.543","Chapter 12","I will most gladly spend and be spent for your souls. If I love you more, am I to be loved less? \\n\\t\\t\\t","12","2 Corinthians","154")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","16","151.45","Chapter 12","But granting that I myself did not burden you, I was crafty, you say, and got the better of you by deceit. \\n\\t\\t\\t","12","2 Corinthians","154")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","17","158.689","Chapter 12","Did I take advantage of you through any of those whom I sent to you? \\n\\t\\t\\t","12","2 Corinthians","154")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","18","163.755","Chapter 12","I urged Titus to go, and sent the brother with him. Did Titus take advantage of you? Did we not act in the same spirit? Did we not take the same steps? \\n\\t\\t\\t","12","2 Corinthians","154")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","19","174.755","Chapter 12","Have you been thinking all along that we have been defending ourselves to you? It is in the sight of God that we have been speaking in Christ, and all for your upbuilding, beloved. \\n\\t\\t\\t","12","2 Corinthians","154")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","20","186.689","Chapter 12","For I fear that perhaps when I come I may find you not as I wish, and that you may find me not as you wish\\u2014that perhaps there may be quarreling, jealousy, anger, hostility, slander, gossip, conceit, and disorder. \\n\\t\\t\\t","12","2 Corinthians","154")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","21","203.821","Chapter 12","I fear that when I come again my God may humble me before you, and I may have to mourn over many of those who sinned earlier and have not repented of the impurity, sexual immorality, and sensuality that they have practiced. \\n\\t\\t\\n\\t\\t","12","2 Corinthians","154")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","1","4.596","Chapter 13","This is the third time I am coming to you. Every charge must be established by the evidence of two or three witnesses. \\n\\t\\t\\t","13","2 Corinthians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","2","12.159","Chapter 13","I warned those who sinned before and all the others, and I warn them now while absent, as I did when present on my second visit, that if I come again I will not spare them\\u2014 \\n\\t\\t\\t","13","2 Corinthians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","3","24.199","Chapter 13","since you seek proof that Christ is speaking in me. He is not weak in dealing with you, but is powerful among you. \\n\\t\\t\\t","13","2 Corinthians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","4","32.04","Chapter 13","For he was crucified in weakness, but lives by the power of God. For we also are weak in him, but in dealing with you we will live with him by the power of God. \\n\\t\\t\\t","13","2 Corinthians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","5","45.596","Chapter 13","Examine yourselves, to see whether you are in the faith. Test yourselves. Or do you not realize this about yourselves, that Jesus Christ is in you?\\u2014unless indeed you fail to meet the test! \\n\\t\\t\\t","13","2 Corinthians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","6","59","Chapter 13","I hope you will find out that we have not failed the test. \\n\\t\\t\\t","13","2 Corinthians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","7","62.623","Chapter 13","But we pray to God that you may not do wrong\\u2014not that we may appear to have met the test, but that you may do what is right, though we may seem to have failed. \\n\\t\\t\\t","13","2 Corinthians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","8","72.477","Chapter 13","For we cannot do anything against the truth, but only for the truth. \\n\\t\\t\\t","13","2 Corinthians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","9","77.318","Chapter 13","For we are glad when we are weak and you are strong. Your restoration is what we pray for. \\n\\t\\t\\t","13","2 Corinthians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","10","84.199","Chapter 13","For this reason I write these things while I am away from you, that when I come I may not have to be severe in my use of the authority that the Lord has given me for building up and not for tearing down. \\n\\t\\t\\t","13","2 Corinthians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","11","96.954","Chapter 13","Finally, brothers, rejoice. Aim for restoration, comfort one another, agree with one another, live in peace; and the God of love and peace will be with you. \\n\\t\\t\\t","13","2 Corinthians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","12","112.397","Chapter 13","Greet one another with a holy kiss. \\n\\t\\t\\t","13","2 Corinthians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","13","114.742","Chapter 13","All the saints greet you. \\n\\t\\t\\t","13","2 Corinthians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("62","2Cor","14","117","Chapter 13","The grace of the Lord Jesus Christ and the love of God and the fellowship of the Holy Spirit be with you all. \\n\\n\\t\\t\\n\\t","13","2 Corinthians","155")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","1","0.265","Chapter 1","Paul, an apostle\\u2014not from men nor through man, but through Jesus Christ and God the Father, who raised him from the dead\\u2014 \\n\\t\\t\\t","1","Galatians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","2","15.079","Chapter 1","and all the brothers who are with me, To the churches of Galatia: \\n\\t\\t\\t","1","Galatians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","3","20.464","Chapter 1","Grace to you and peace from God our Father and the Lord Jesus Christ, \\n\\t\\t\\t","1","Galatians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","4","25.477","Chapter 1","who gave himself for our sins to deliver us from the present evil age, according to the will of our God and Father, \\n\\t\\t\\t","1","Galatians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","5","33.702","Chapter 1","to whom be the glory forever and ever. Amen. \\n\\t\\t\\t","1","Galatians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","6","39.225","Chapter 1","I am astonished that you are so quickly deserting him who called you in the grace of Christ and are turning to a different gospel\\u2014 \\n\\t\\t\\t","1","Galatians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","7","49.437","Chapter 1","not that there is another one, but there are some who trouble you and want to distort the gospel of Christ. \\n\\t\\t\\t","1","Galatians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","8","56.596","Chapter 1","But even if we or an angel from heaven should preach to you a gospel contrary to the one we preached to you, let him be accursed. \\n\\t\\t\\t","1","Galatians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","9","66.159","Chapter 1","As we have said before, so now I say again: If anyone is preaching to you a gospel contrary to the one you received, let him be accursed. \\n\\t\\t\\t","1","Galatians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","10","77.675","Chapter 1","For am I now seeking the approval of man, or of God? Or am I trying to please man? If I were still trying to please man, I would not be a servant of Christ. \\n\\t\\t\\t","1","Galatians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","11","89.517","Chapter 1","For I would have you know, brothers, that the gospel that was preached by me is not man\\u2019s gospel. \\n\\t\\t\\t","1","Galatians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","12","96.715","Chapter 1","For I did not receive it from any man, nor was I taught it, but I received it through a revelation of Jesus Christ. \\n\\t\\t\\t","1","Galatians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","13","104.795","Chapter 1","For you have heard of my former life in Judaism, how I persecuted the church of God violently and tried to destroy it. \\n\\t\\t\\t","1","Galatians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","14","113.252","Chapter 1","And I was advancing in Judaism beyond many of my own age among my people, so extremely zealous was I for the traditions of my fathers. \\n\\t\\t\\t","1","Galatians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","15","122.636","Chapter 1","But when he who had set me apart before I was born, and who called me by his grace, \\n\\t\\t\\t","1","Galatians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","16","128.848","Chapter 1","was pleased to reveal his Son to me, in order that I might preach him among the Gentiles, I did not immediately consult with anyone; \\n\\t\\t\\t","1","Galatians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","17","137.397","Chapter 1","nor did I go up to Jerusalem to those who were apostles before me, but I went away into Arabia, and returned again to Damascus. \\n\\t\\t\\t","1","Galatians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","18","146.265","Chapter 1","Then after three years I went up to Jerusalem to visit Cephas and remained with him fifteen days. \\n\\t\\t\\t","1","Galatians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","19","153.331","Chapter 1","But I saw none of the other apostles except James the Lord\\u2019s brother. \\n\\t\\t\\t","1","Galatians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","20","157.742","Chapter 1","(In what I am writing to you, before God, I do not lie!) \\n\\t\\t\\t","1","Galatians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","21","161.503","Chapter 1","Then I went into the regions of Syria and Cilicia. \\n\\t\\t\\t","1","Galatians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","22","164.98","Chapter 1","And I was still unknown in person to the churches of Judea that are in Christ. \\n\\t\\t\\t","1","Galatians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","23","169.954","Chapter 1","They only were hearing it said, \\u201cHe who used to persecute us is now preaching the faith he once tried to destroy.\\u201d \\n\\t\\t\\t","1","Galatians","155")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","24","177.662","Chapter 1","And they glorified God because of me. \\n\\t\\t\\n\\t\\t","1","Galatians","155")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","1","0.252","Chapter 2","Then after fourteen years I went up again to Jerusalem with Barnabas, taking Titus along with me. \\n\\t\\t\\t","2","Galatians","156")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","2","10.424","Chapter 2","I went up because of a revelation and set before them (though privately before those who seemed influential) the gospel that I proclaim among the Gentiles, in order to make sure I was not running or had not run in vain. \\n\\t\\t\\t","2","Galatians","156")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","3","24.172","Chapter 2","But even Titus, who was with me, was not forced to be circumcised, though he was a Greek. \\n\\t\\t\\t","2","Galatians","156")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","4","29.967","Chapter 2","Yet because of false brothers secretly brought in\\u2014who slipped in to spy out our freedom that we have in Christ Jesus, so that they might bring us into slavery\\u2014 \\n\\t\\t\\t","2","Galatians","156")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","5","40.238","Chapter 2","to them we did not yield in submission even for a moment, so that the truth of the gospel might be preserved for you. \\n\\t\\t\\t","2","Galatians","156")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","6","47.159","Chapter 2","And from those who seemed to be influential (what they were makes no difference to me; God shows no partiality)\\u2014those, I say, who seemed influential added nothing to me. \\n\\t\\t\\t","2","Galatians","156")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","7","59.04","Chapter 2","On the contrary, when they saw that I had been entrusted with the gospel to the uncircumcised, just as Peter had been entrusted with the gospel to the circumcised \\n\\t\\t\\t","2","Galatians","156")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","8","68.331","Chapter 2","(for he who worked through Peter for his apostolic ministry to the circumcised worked also through me for mine to the Gentiles), \\n\\t\\t\\t","2","Galatians","156")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","9","77.291","Chapter 2","and when James and Cephas and John, who seemed to be pillars, perceived the grace that was given to me, they gave the right hand of fellowship to Barnabas and me, that we should go to the Gentiles and they to the circumcised. \\n\\t\\t\\t","2","Galatians","156")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","10","92.066","Chapter 2","Only, they asked us to remember the poor, the very thing I was eager to do. \\n\\t\\t\\t","2","Galatians","156")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","11","97.119","Chapter 2","But when Cephas came to Antioch, I opposed him to his face, because he stood condemned. \\n\\t\\t\\t","2","Galatians","156")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","12","103.53","Chapter 2","For before certain men came from James, he was eating with the Gentiles; but when they came he drew back and separated himself, fearing the circumcision party. \\n\\t\\t\\t","2","Galatians","156")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","13","114.49","Chapter 2","And the rest of the Jews acted hypocritically along with him, so that even Barnabas was led astray by their hypocrisy. \\n\\t\\t\\t","2","Galatians","156")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","14","121.689","Chapter 2","But when I saw that their conduct was not in step with the truth of the gospel, I said to Cephas before them all, \\u201cIf you, though a Jew, live like a Gentile and not like a Jew, how can you force the Gentiles to live like Jews?\\u201d \\n\\t\\t\\t","2","Galatians","156")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","15","138.358","Chapter 2","We ourselves are Jews by birth and not Gentile sinners; \\n\\t\\t\\t","2","Galatians","156")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","16","142.914","Chapter 2","yet we know that a person is not justified by works of the law but through faith in Jesus Christ, so we also have believed in Christ Jesus, in order to be justified by faith in Christ and not by works of the law, because by works of the law no one will be justified. \\n\\t\\t\\t","2","Galatians","156")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","17","160.887","Chapter 2","But if, in our endeavor to be justified in Christ, we too were found to be sinners, is Christ then a servant of sin? Certainly not! \\n\\t\\t\\t","2","Galatians","156")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","18","171.887","Chapter 2","For if I rebuild what I tore down, I prove myself to be a transgressor. \\n\\t\\t\\t","2","Galatians","156")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","19","178.026","Chapter 2","For through the law I died to the law, so that I might live to God. \\n\\t\\t\\t","2","Galatians","156")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","20","183.384","Chapter 2","I have been crucified with Christ. It is no longer I who live, but Christ who lives in me. And the life I now live in the flesh I live by faith in the Son of God, who loved me and gave himself for me. \\n\\t\\t\\t","2","Galatians","156")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","21","198.662","Chapter 2","I do not nullify the grace of God, for if righteousness were through the law, then Christ died for no purpose. \\n\\t\\t\\n\\t\\t","2","Galatians","156")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","1","2.662","Chapter 3","O foolish Galatians! Who has bewitched you? It was before your eyes that Jesus Christ was publicly portrayed as crucified. \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","2","14.371","Chapter 3","Let me ask you only this: Did you receive the Spirit by works of the law or by hearing with faith? \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","3","22.358","Chapter 3","Are you so foolish? Having begun by the Spirit, are you now being perfected by the flesh? \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","4","29.331","Chapter 3","Did you suffer so many things in vain\\u2014if indeed it was in vain? \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","5","34.477","Chapter 3","Does he who supplies the Spirit to you and works miracles among you do so by works of the law, or by hearing with faith\\u2014 \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","6","43.808","Chapter 3","just as Abraham \\u201cbelieved God, and it was counted to him as righteousness\\u201d? \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","7","49.848","Chapter 3","Know then that it is those of faith who are the sons of Abraham. \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","8","55.013","Chapter 3","And the Scripture, foreseeing that God would justify the Gentiles by faith, preached the gospel beforehand to Abraham, saying, \\u201cIn you shall all the nations be blessed.\\u201d \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","9","66.795","Chapter 3","So then, those who are of faith are blessed along with Abraham, the man of faith. \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","10","72.689","Chapter 3","For all who rely on works of the law are under a curse; for it is written, \\u201cCursed be everyone who does not abide by all things written in the Book of the Law, and do them.\\u201d \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","11","84.49","Chapter 3","Now it is evident that no one is justified before God by the law, for \\u201cThe righteous shall live by faith.\\u201d \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","12","93.675","Chapter 3","But the law is not of faith, rather \\u201cThe one who does them shall live by them.\\u201d \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","13","101.477","Chapter 3","Christ redeemed us from the curse of the law by becoming a curse for us\\u2014for it is written, \\u201cCursed is everyone who is hanged on a tree\\u201d\\u2014 \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","14","113.053","Chapter 3","so that in Christ Jesus the blessing of Abraham might come to the Gentiles, so that we might receive the promised Spirit through faith. \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","15","123.45","Chapter 3","To give a human example, brothers: even with a man-made covenant, no one annuls it or adds to it once it has been ratified. \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","16","132.914","Chapter 3","Now the promises were made to Abraham and to his offspring. It does not say, \\u201cAnd to offsprings,\\u201d referring to many, but referring to one, \\u201cAnd to your offspring,\\u201d who is Christ. \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","17","147.225","Chapter 3","This is what I mean: the law, which came 430 years afterward, does not annul a covenant previously ratified by God, so as to make the promise void. \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","18","160.278","Chapter 3","For if the inheritance comes by the law, it no longer comes by promise; but God gave it to Abraham by a promise. \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","19","169.57","Chapter 3","Why then the law? It was added because of transgressions, until the offspring should come to whom the promise had been made, and it was put in place through angels by an intermediary. \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","20","182.238","Chapter 3","Now an intermediary implies more than one, but God is one. \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","21","188.146","Chapter 3","Is the law then contrary to the promises of God? Certainly not! For if a law had been given that could give life, then righteousness would indeed be by the law. \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","22","200.543","Chapter 3","But the Scripture imprisoned everything under sin, so that the promise by faith in Jesus Christ might be given to those who believe. \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","23","209.503","Chapter 3","Now before faith came, we were held captive under the law, imprisoned until the coming faith would be revealed. \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","24","217.901","Chapter 3","So then, the law was our guardian until Christ came, in order that we might be justified by faith. \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","25","226.079","Chapter 3","But now that faith has come, we are no longer under a guardian, \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","26","231.556","Chapter 3","for in Christ Jesus you are all sons of God, through faith. \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","27","236.848","Chapter 3","For as many of you as were baptized into Christ have put on Christ. \\n\\t\\t\\t","3","Galatians","157")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","28","243.04","Chapter 3","There is neither Jew nor Greek, there is neither slave nor free, there is no male and female, for you are all one in Christ Jesus. \\n\\t\\t\\t","3","Galatians","157")');
