tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","6","41.609","Chapter 4","And because you are sons, God has sent the Spirit of his Son into our hearts, crying, \\u201cAbba! Father!\\u201d \\n\\t\\t\\t","4","Galatians","158")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","7","52.517","Chapter 4","So you are no longer a slave, but a son, and if a son, then an heir through God. \\n\\t\\t\\t","4","Galatians","158")');
