tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","11","88.967","Chapter 4","I am afraid I may have labored over you in vain. \\n\\t\\t\\t","4","Galatians","158")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","12","92.914","Chapter 4","Brothers, I entreat you, become as I am, for I also have become as you are. You did me no wrong. \\n\\t\\t\\t","4","Galatians","158")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","13","103.464","Chapter 4","You know it was because of a bodily ailment that I preached the gospel to you at first, \\n\\t\\t\\t","4","Galatians","158")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","14","108.57","Chapter 4","and though my condition was a trial to you, you did not scorn or despise me, but received me as an angel of God, as Christ Jesus. \\n\\t\\t\\t","4","Galatians","158")');
