tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","16","127.57","Chapter 4","Have I then become your enemy by telling you the truth? \\n\\t\\t\\t","4","Galatians","158")');
