tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","20","153.066","Chapter 4","I wish I could be present with you now and change my tone, for I am perplexed about you. \\n\\t\\t\\t","4","Galatians","158")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","21","159.702","Chapter 4","Tell me, you who desire to be under the law, do you not listen to the law? \\n\\t\\t\\t","4","Galatians","158")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","22","165.689","Chapter 4","For it is written that Abraham had two sons, one by a slave woman and one by a free woman. \\n\\t\\t\\t","4","Galatians","158")');
