tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","26","202.755","Chapter 4","But the Jerusalem above is free, and she is our mother. \\n\\t\\t\\t","4","Galatians","158")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","27","207.954","Chapter 4","For it is written, \\u201cRejoice, O barren one who does not bear; break forth and cry aloud, you who are not in labor! For the children of the desolate one will be more than those of the one who has a husband.\\u201d \\n\\t\\t\\t","4","Galatians","158")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","28","223.146","Chapter 4","Now you, brothers, like Isaac, are children of promise. \\n\\t\\t\\t","4","Galatians","158")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","29","228.901","Chapter 4","But just as at that time he who was born according to the flesh persecuted him who was born according to the Spirit, so also it is now. \\n\\t\\t\\t","4","Galatians","158")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","30","241.066","Chapter 4","But what does the Scripture say? \\u201cCast out the slave woman and her son, for the son of the slave woman shall not inherit with the son of the free woman.\\u201d \\n\\t\\t\\t","4","Galatians","158")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","31","251.742","Chapter 4","So, brothers, we are not children of the slave but of the free woman. \\n\\t\\t\\n\\t\\t","4","Galatians","158")');

