tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","4","34.093","Chapter 5","You are severed from Christ, you who would be justified by the law; you have fallen away from grace. \\n\\t\\t\\t","5","Galatians","159")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","5","43.238","Chapter 5","For through the Spirit, by faith, we ourselves eagerly wait for the hope of righteousness. \\n\\t\\t\\t","5","Galatians","159")');
