tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","7","63.53","Chapter 5","You were running well. Who hindered you from obeying the truth? \\n\\t\\t\\t","5","Galatians","159")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","8","68.768","Chapter 5","This persuasion is not from him who calls you. \\n\\t\\t\\t","5","Galatians","159")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","9","72.861","Chapter 5","A little leaven leavens the whole lump. \\n\\t\\t\\t","5","Galatians","159")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","10","76.437","Chapter 5","I have confidence in the Lord that you will take no other view than mine, and the one who is troubling you will bear the penalty, whoever he is. \\n\\t\\t\\t","5","Galatians","159")');
