tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","12","98.079","Chapter 5","I wish those who unsettle you would emasculate themselves! \\n\\t\\t\\t","5","Galatians","159")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("63","Gal","13","102.808","Chapter 5","For you were called to freedom, brothers. Only do not use your freedom as an opportunity for the flesh, but through love serve one another. \\n\\t\\t\\t","5","Galatians","159")');
