tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("66","Col","14","112.94","Chapter 4","Luke the beloved physician greets you, as does Demas. \\n\\t\\t\\t","4","Colossians","171")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("66","Col","15","117.821","Chapter 4","Give my greetings to the brothers at Laodicea, and to Nympha and the church in her house. \\n\\t\\t\\t","4","Colossians","171")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("66","Col","16","123.53","Chapter 4","And when this letter has been read among you, have it also read in the church of the Laodiceans; and see that you also read the letter from Laodicea. \\n\\t\\t\\t","4","Colossians","171")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("66","Col","17","132.265","Chapter 4","And say to Archippus, \\u201cSee that you fulfill the ministry that you have received in the Lord.\\u201d \\n\\t\\t\\t","4","Colossians","171")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("66","Col","18","138.026","Chapter 4","I, Paul, write this greeting with my own hand. Remember my chains. Grace be with you. \\n\\n\\t\\t\\n\\t","4","Colossians","171")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","1","5","Chapter 1","Paul, Silvanus, and Timothy, To the church of the Thessalonians in God the Father and the Lord Jesus Christ: Grace to you and peace. \\n\\t\\t\\t","1","1 Thessalonians","171")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","2","18.291","Chapter 1","We give thanks to God always for all of you, constantly mentioning you in our prayers, \\n\\t\\t\\t","1","1 Thessalonians","171")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","3","23.954","Chapter 1","remembering before our God and Father your work of faith and labor of love and steadfastness of hope in our Lord Jesus Christ. \\n\\t\\t\\t","1","1 Thessalonians","171")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","4","33.013","Chapter 1","For we know, brothers loved by God, that he has chosen you, \\n\\t\\t\\t","1","1 Thessalonians","171")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","5","36.821","Chapter 1","because our gospel came to you not only in word, but also in power and in the Holy Spirit and with full conviction. You know what kind of men we proved to be among you for your sake. \\n\\t\\t\\t","1","1 Thessalonians","171")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","6","47.649","Chapter 1","And you became imitators of us and of the Lord, for you received the word in much affliction, with the joy of the Holy Spirit, \\n\\t\\t\\t","1","1 Thessalonians","171")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","7","55.265","Chapter 1","so that you became an example to all the believers in Macedonia and in Achaia. \\n\\t\\t\\t","1","1 Thessalonians","171")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","8","60.318","Chapter 1","For not only has the word of the Lord sounded forth from you in Macedonia and Achaia, but your faith in God has gone forth everywhere, so that we need not say anything. \\n\\t\\t\\t","1","1 Thessalonians","171")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","9","71.185","Chapter 1","For they themselves report concerning us the kind of reception we had among you, and how you turned to God from idols to serve the living and true God, \\n\\t\\t\\t","1","1 Thessalonians","171")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","10","80.662","Chapter 1","and to wait for his Son from heaven, whom he raised from the dead, Jesus who delivers us from the wrath to come. \\n\\t\\t\\n\\t\\t","1","1 Thessalonians","171")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","1","5.106","Chapter 2","For you yourselves know, brothers, that our coming to you was not in vain. \\n\\t\\t\\t","2","1 Thessalonians","172")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","2","9.291","Chapter 2","But though we had already suffered and been shamefully treated at Philippi, as you know, we had boldness in our God to declare to you the gospel of God in the midst of much conflict. \\n\\t\\t\\t","2","1 Thessalonians","172")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","3","21.715","Chapter 2","For our appeal does not spring from error or impurity or any attempt to deceive, \\n\\t\\t\\t","2","1 Thessalonians","172")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","4","27.702","Chapter 2","but just as we have been approved by God to be entrusted with the gospel, so we speak, not to please man, but to please God who tests our hearts. \\n\\t\\t\\t","2","1 Thessalonians","172")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","5","38.371","Chapter 2","For we never came with words of flattery, as you know, nor with a pretext for greed\\u2014God is witness. \\n\\t\\t\\t","2","1 Thessalonians","172")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","6","44.596","Chapter 2","Nor did we seek glory from people, whether from you or from others, though we could have made demands as apostles of Christ. \\n\\t\\t\\t","2","1 Thessalonians","172")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","7","51.397","Chapter 2","But we were gentle among you, like a nursing mother taking care of her own children. \\n\\t\\t\\t","2","1 Thessalonians","172")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","8","56.358","Chapter 2","So, being affectionately desirous of you, we were ready to share with you not only the gospel of God but also our own selves, because you had become very dear to us. \\n\\t\\t\\t","2","1 Thessalonians","172")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","9","67.106","Chapter 2","For you remember, brothers, our labor and toil: we worked night and day, that we might not be a burden to any of you, while we proclaimed to you the gospel of God. \\n\\t\\t\\t","2","1 Thessalonians","172")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","10","77.199","Chapter 2","You are witnesses, and God also, how holy and righteous and blameless was our conduct toward you believers. \\n\\t\\t\\t","2","1 Thessalonians","172")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","11","84.477","Chapter 2","For you know how, like a father with his children, \\n\\t\\t\\t","2","1 Thessalonians","172")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","12","87.861","Chapter 2","we exhorted each one of you and encouraged you and charged you to walk in a manner worthy of God, who calls you into his own kingdom and glory. \\n\\t\\t\\t","2","1 Thessalonians","172")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","13","97","Chapter 2","And we also thank God constantly for this, that when you received the word of God, which you heard from us, you accepted it not as the word of men but as what it really is, the word of God, which is at work in you believers. \\n\\t\\t\\t","2","1 Thessalonians","172")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","14","110.146","Chapter 2","For you, brothers, became imitators of the churches of God in Christ Jesus that are in Judea. For you suffered the same things from your own countrymen as they did from the Jews, \\n\\t\\t\\t","2","1 Thessalonians","172")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","15","121.252","Chapter 2","who killed both the Lord Jesus and the prophets, and drove us out, and displease God and oppose all mankind \\n\\t\\t\\t","2","1 Thessalonians","172")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","16","128.742","Chapter 2","by hindering us from speaking to the Gentiles that they might be saved\\u2014so as always to fill up the measure of their sins. But God\\u2019s wrath has come upon them at last! \\n\\t\\t\\t","2","1 Thessalonians","172")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","17","141.397","Chapter 2","But since we were torn away from you, brothers, for a short time, in person not in heart, we endeavored the more eagerly and with great desire to see you face to face, \\n\\t\\t\\t","2","1 Thessalonians","172")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","18","150.702","Chapter 2","because we wanted to come to you\\u2014I, Paul, again and again\\u2014but Satan hindered us. \\n\\t\\t\\t","2","1 Thessalonians","172")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","19","156.715","Chapter 2","For what is our hope or joy or crown of boasting before our Lord Jesus at his coming? Is it not you? \\n\\t\\t\\t","2","1 Thessalonians","172")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","20","164.318","Chapter 2","For you are our glory and joy. \\n\\t\\t\\n\\t\\t","2","1 Thessalonians","172")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","1","4.596","Chapter 3","Therefore when we could bear it no longer, we were willing to be left behind at Athens alone, \\n\\t\\t\\t","3","1 Thessalonians","173")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","2","10.49","Chapter 3","and we sent Timothy, our brother and God\\u2019s coworker in the gospel of Christ, to establish and exhort you in your faith, \\n\\t\\t\\t","3","1 Thessalonians","173")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","3","17.093","Chapter 3","that no one be moved by these afflictions. For you yourselves know that we are destined for this. \\n\\t\\t\\t","3","1 Thessalonians","173")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","4","23.079","Chapter 3","For when we were with you, we kept telling you beforehand that we were to suffer affliction, just as it has come to pass, and just as you know. \\n\\t\\t\\t","3","1 Thessalonians","173")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","5","32","Chapter 3","For this reason, when I could bear it no longer, I sent to learn about your faith, for fear that somehow the tempter had tempted you and our labor would be in vain. \\n\\t\\t\\t","3","1 Thessalonians","173")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","6","41.887","Chapter 3","But now that Timothy has come to us from you, and has brought us the good news of your faith and love and reported that you always remember us kindly and long to see us, as we long to see you\\u2014 \\n\\t\\t\\t","3","1 Thessalonians","173")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","7","52.795","Chapter 3","for this reason, brothers, in all our distress and affliction we have been comforted about you through your faith. \\n\\t\\t\\t","3","1 Thessalonians","173")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","8","58.781","Chapter 3","For now we live, if you are standing fast in the Lord. \\n\\t\\t\\t","3","1 Thessalonians","173")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","9","62.596","Chapter 3","For what thanksgiving can we return to God for you, for all the joy that we feel for your sake before our God, \\n\\t\\t\\t","3","1 Thessalonians","173")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","10","69.424","Chapter 3","as we pray most earnestly night and day that we may see you face to face and supply what is lacking in your faith? \\n\\t\\t\\t","3","1 Thessalonians","173")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","11","76.437","Chapter 3","Now may our God and Father himself, and our Lord Jesus, direct our way to you, \\n\\t\\t\\t","3","1 Thessalonians","173")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","12","82.755","Chapter 3","and may the Lord make you increase and abound in love for one another and for all, as we do for you, \\n\\t\\t\\t","3","1 Thessalonians","173")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","13","90.225","Chapter 3","so that he may establish your hearts blameless in holiness before our God and Father, at the coming of our Lord Jesus with all his saints. \\n\\t\\t\\n\\t\\t","3","1 Thessalonians","173")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","1","4.132","Chapter 4","Finally, then, brothers, we ask and urge you in the Lord Jesus, that as you received from us how you ought to walk and to please God, just as you are doing, that you do so more and more. \\n\\t\\t\\t","4","1 Thessalonians","174")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","2","17.874","Chapter 4","For you know what instructions we gave you through the Lord Jesus. \\n\\t\\t\\t","4","1 Thessalonians","174")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","3","22.291","Chapter 4","For this is the will of God, your sanctification: that you abstain from sexual immorality; \\n\\t\\t\\t","4","1 Thessalonians","174")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","4","28.742","Chapter 4","that each one of you know how to control his own body in holiness and honor, \\n\\t\\t\\t","4","1 Thessalonians","174")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","5","34.596","Chapter 4","not in the passion of lust like the Gentiles who do not know God; \\n\\t\\t\\t","4","1 Thessalonians","174")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","6","38.914","Chapter 4","that no one transgress and wrong his brother in this matter, because the Lord is an avenger in all these things, as we told you beforehand and solemnly warned you. \\n\\t\\t\\t","4","1 Thessalonians","174")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","7","50.755","Chapter 4","For God has not called us for impurity, but in holiness. \\n\\t\\t\\t","4","1 Thessalonians","174")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","8","54.57","Chapter 4","Therefore whoever disregards this, disregards not man but God, who gives his Holy Spirit to you. \\n\\t\\t\\t","4","1 Thessalonians","174")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","9","60.649","Chapter 4","Now concerning brotherly love you have no need for anyone to write to you, for you yourselves have been taught by God to love one another, \\n\\t\\t\\t","4","1 Thessalonians","174")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","10","69.517","Chapter 4","for that indeed is what you are doing to all the brothers throughout Macedonia. But we urge you, brothers, to do this more and more, \\n\\t\\t\\t","4","1 Thessalonians","174")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","11","77.821","Chapter 4","and to aspire to live quietly, and to mind your own affairs, and to work with your hands, as we instructed you, \\n\\t\\t\\t","4","1 Thessalonians","174")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","12","84.887","Chapter 4","so that you may walk properly before outsiders and be dependent on no one. \\n\\t\\t\\t","4","1 Thessalonians","174")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","13","90.053","Chapter 4","But we do not want you to be uninformed, brothers, about those who are asleep, that you may not grieve as others do who have no hope. \\n\\t\\t\\t","4","1 Thessalonians","174")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","14","98.636","Chapter 4","For since we believe that Jesus died and rose again, even so, through Jesus, God will bring with him those who have fallen asleep. \\n\\t\\t\\t","4","1 Thessalonians","174")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","15","108.477","Chapter 4","For this we declare to you by a word from the Lord, that we who are alive, who are left until the coming of the Lord, will not precede those who have fallen asleep. \\n\\t\\t\\t","4","1 Thessalonians","174")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","16","119.53","Chapter 4","For the Lord himself will descend from heaven with a cry of command, with the voice of an archangel, and with the sound of the trumpet of God. And the dead in Christ will rise first. \\n\\t\\t\\t","4","1 Thessalonians","174")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","17","132.172","Chapter 4","Then we who are alive, who are left, will be caught up together with them in the clouds to meet the Lord in the air, and so we will always be with the Lord. \\n\\t\\t\\t","4","1 Thessalonians","174")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","18","142.662","Chapter 4","Therefore encourage one another with these words. \\n\\t\\t\\n\\t\\t","4","1 Thessalonians","174")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","1","3.94","Chapter 5","Now concerning the times and the seasons, brothers, you have no need to have anything written to you. \\n\\t\\t\\t","5","1 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","2","10.358","Chapter 5","For you yourselves are fully aware that the day of the Lord will come like a thief in the night. \\n\\t\\t\\t","5","1 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","3","15.503","Chapter 5","While people are saying, \\u201cThere is peace and security,\\u201d then sudden destruction will come upon them as labor pains come upon a pregnant woman, and they will not escape. \\n\\t\\t\\t","5","1 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","4","29.861","Chapter 5","But you are not in darkness, brothers, for that day to surprise you like a thief. \\n\\t\\t\\t","5","1 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","5","34.093","Chapter 5","For you are all children of light, children of the day. We are not of the night or of the darkness. \\n\\t\\t\\t","5","1 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","6","39.702","Chapter 5","So then let us not sleep, as others do, but let us keep awake and be sober. \\n\\t\\t\\t","5","1 Thessalonians","175")');
