tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","9","61.808","Chapter 5","For God has not destined us for wrath, but to obtain salvation through our Lord Jesus Christ, \\n\\t\\t\\t","5","1 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","10","69.384","Chapter 5","who died for us so that whether we are awake or asleep we might live with him. \\n\\t\\t\\t","5","1 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","11","75.689","Chapter 5","Therefore encourage one another and build one another up, just as you are doing. \\n\\t\\t\\t","5","1 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","12","82.053","Chapter 5","We ask you, brothers, to respect those who labor among you and are over you in the Lord and admonish you, \\n\\t\\t\\t","5","1 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","13","87.768","Chapter 5","and to esteem them very highly in love because of their work. Be at peace among yourselves. \\n\\t\\t\\t","5","1 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","14","93.57","Chapter 5","And we urge you, brothers, admonish the idle, encourage the fainthearted, help the weak, be patient with them all. \\n\\t\\t\\t","5","1 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","15","103.424","Chapter 5","See that no one repays anyone evil for evil, but always seek to do good to one another and to everyone. \\n\\t\\t\\t","5","1 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","16","111.45","Chapter 5","Rejoice always, \\n\\t\\t\\t","5","1 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","17","113.675","Chapter 5","pray without ceasing, \\n\\t\\t\\t","5","1 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","18","115.543","Chapter 5","give thanks in all circumstances; for this is the will of God in Christ Jesus for you. \\n\\t\\t\\t","5","1 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","19","122.225","Chapter 5","Do not quench the Spirit. \\n\\t\\t\\t","5","1 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","20","124.503","Chapter 5","Do not despise prophecies, \\n\\t\\t\\t","5","1 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","21","126.821","Chapter 5","but test everything; hold fast what is good. \\n\\t\\t\\t","5","1 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","22","131.146","Chapter 5","Abstain from every form of evil. \\n\\t\\t\\t","5","1 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","23","134.305","Chapter 5","Now may the God of peace himself sanctify you completely, and may your whole spirit and soul and body be kept blameless at the coming of our Lord Jesus Christ. \\n\\t\\t\\t","5","1 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","24","146.053","Chapter 5","He who calls you is faithful; he will surely do it. \\n\\t\\t\\t","5","1 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","25","150.689","Chapter 5","Brothers, pray for us. \\n\\t\\t\\t","5","1 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","26","153.106","Chapter 5","Greet all the brothers with a holy kiss. \\n\\t\\t\\t","5","1 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","27","155.755","Chapter 5","I put you under oath before the Lord to have this letter read to all the brothers. \\n\\t\\t\\t","5","1 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("67","1Thess","28","161.106","Chapter 5","The grace of our Lord Jesus Christ be with you. \\n\\n\\t\\t\\n\\t","5","1 Thessalonians","175")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","1","5.795","Chapter 1","Paul, Silvanus, and Timothy, To the church of the Thessalonians in God our Father and the Lord Jesus Christ: \\n\\t\\t\\t","1","2 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","2","14.437","Chapter 1","Grace to you and peace from God our Father and the Lord Jesus Christ. \\n\\t\\t\\t","1","2 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","3","19.132","Chapter 1","We ought always to give thanks to God for you, brothers, as is right, because your faith is growing abundantly, and the love of every one of you for one another is increasing. \\n\\t\\t\\t","1","2 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","4","29.252","Chapter 1","Therefore we ourselves boast about you in the churches of God for your steadfastness and faith in all your persecutions and in the afflictions that you are enduring. \\n\\t\\t\\t","1","2 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","5","38.861","Chapter 1","This is evidence of the righteous judgment of God, that you may be considered worthy of the kingdom of God, for which you are also suffering\\u2014 \\n\\t\\t\\t","1","2 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","6","47.132","Chapter 1","since indeed God considers it just to repay with affliction those who afflict you, \\n\\t\\t\\t","1","2 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","7","52.57","Chapter 1","and to grant relief to you who are afflicted as well as to us, when the Lord Jesus is revealed from heaven with his mighty angels \\n\\t\\t\\t","1","2 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","8","60.887","Chapter 1","in flaming fire, inflicting vengeance on those who do not know God and on those who do not obey the gospel of our Lord Jesus. \\n\\t\\t\\t","1","2 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","9","70.04","Chapter 1","They will suffer the punishment of eternal destruction, away from the presence of the Lord and from the glory of his might, \\n\\t\\t\\t","1","2 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","10","78.305","Chapter 1","when he comes on that day to be glorified in his saints, and to be marveled at among all who have believed, because our testimony to you was believed. \\n\\t\\t\\t","1","2 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","11","87.874","Chapter 1","To this end we always pray for you, that our God may make you worthy of his calling and may fulfill every resolve for good and every work of faith by his power, \\n\\t\\t\\t","1","2 Thessalonians","175")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","12","99.066","Chapter 1","so that the name of our Lord Jesus may be glorified in you, and you in him, according to the grace of our God and the Lord Jesus Christ. \\n\\t\\t\\n\\t\\t","1","2 Thessalonians","175")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","1","4.596","Chapter 2","Now concerning the coming of our Lord Jesus Christ and our being gathered together to him, we ask you, brothers, \\n\\t\\t\\t","2","2 Thessalonians","176")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","2","12.397","Chapter 2","not to be quickly shaken in mind or alarmed, either by a spirit or a spoken word, or a letter seeming to be from us, to the effect that the day of the Lord has come. \\n\\t\\t\\t","2","2 Thessalonians","176")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","3","23.146","Chapter 2","Let no one deceive you in any way. For that day will not come, unless the rebellion comes first, and the man of lawlessness is revealed, the son of destruction, \\n\\t\\t\\t","2","2 Thessalonians","176")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","4","33.689","Chapter 2","who opposes and exalts himself against every so-called god or object of worship, so that he takes his seat in the temple of God, proclaiming himself to be God. \\n\\t\\t\\t","2","2 Thessalonians","176")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","5","44.702","Chapter 2","Do you not remember that when I was still with you I told you these things? \\n\\t\\t\\t","2","2 Thessalonians","176")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","6","49.45","Chapter 2","And you know what is restraining him now so that he may be revealed in his time. \\n\\t\\t\\t","2","2 Thessalonians","176")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","7","54.649","Chapter 2","For the mystery of lawlessness is already at work. Only he who now restrains it will do so until he is out of the way. \\n\\t\\t\\t","2","2 Thessalonians","176")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","8","63.94","Chapter 2","And then the lawless one will be revealed, whom the Lord Jesus will kill with the breath of his mouth and bring to nothing by the appearance of his coming. \\n\\t\\t\\t","2","2 Thessalonians","176")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","9","74.026","Chapter 2","The coming of the lawless one is by the activity of Satan with all power and false signs and wonders, \\n\\t\\t\\t","2","2 Thessalonians","176")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","10","81.265","Chapter 2","and with all wicked deception for those who are perishing, because they refused to love the truth and so be saved. \\n\\t\\t\\t","2","2 Thessalonians","176")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","11","89.066","Chapter 2","Therefore God sends them a strong delusion, so that they may believe what is false, \\n\\t\\t\\t","2","2 Thessalonians","176")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","12","94.967","Chapter 2","in order that all may be condemned who did not believe the truth but had pleasure in unrighteousness. \\n\\t\\t\\t","2","2 Thessalonians","176")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","13","101.834","Chapter 2","But we ought always to give thanks to God for you, brothers beloved by the Lord, because God chose you as the firstfruits to be saved, through sanctification by the Spirit and belief in the truth. \\n\\t\\t\\t","2","2 Thessalonians","176")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","14","116.464","Chapter 2","To this he called you through our gospel, so that you may obtain the glory of our Lord Jesus Christ. \\n\\t\\t\\t","2","2 Thessalonians","176")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","15","124.04","Chapter 2","So then, brothers, stand firm and hold to the traditions that you were taught by us, either by our spoken word or by our letter. \\n\\t\\t\\t","2","2 Thessalonians","176")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","16","134.159","Chapter 2","Now may our Lord Jesus Christ himself, and God our Father, who loved us and gave us eternal comfort and good hope through grace, \\n\\t\\t\\t","2","2 Thessalonians","176")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","17","144.159","Chapter 2","comfort your hearts and establish them in every good work and word. \\n\\t\\t\\n\\t\\t","2","2 Thessalonians","176")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","1","4.742","Chapter 3","Finally, brothers, pray for us, that the word of the Lord may speed ahead and be honored, as happened among you, \\n\\t\\t\\t","3","2 Thessalonians","177")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","2","12.57","Chapter 3","and that we may be delivered from wicked and evil men. For not all have faith. \\n\\t\\t\\t","3","2 Thessalonians","177")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","3","17.305","Chapter 3","But the Lord is faithful. He will establish you and guard you against the evil one. \\n\\t\\t\\t","3","2 Thessalonians","177")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","4","22.503","Chapter 3","And we have confidence in the Lord about you, that you are doing and will do the things that we command. \\n\\t\\t\\t","3","2 Thessalonians","177")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","5","28.331","Chapter 3","May the Lord direct your hearts to the love of God and to the steadfastness of Christ. \\n\\t\\t\\t","3","2 Thessalonians","177")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","6","34.503","Chapter 3","Now we command you, brothers, in the name of our Lord Jesus Christ, that you keep away from any brother who is walking in idleness and not in accord with the tradition that you received from us. \\n\\t\\t\\t","3","2 Thessalonians","177")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","7","45.927","Chapter 3","For you yourselves know how you ought to imitate us, because we were not idle when we were with you, \\n\\t\\t\\t","3","2 Thessalonians","177")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","8","51.623","Chapter 3","nor did we eat anyone\\u2019s bread without paying for it, but with toil and labor we worked night and day, that we might not be a burden to any of you. \\n\\t\\t\\t","3","2 Thessalonians","177")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","9","62.106","Chapter 3","It was not because we do not have that right, but to give you in ourselves an example to imitate. \\n\\t\\t\\t","3","2 Thessalonians","177")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","10","70.093","Chapter 3","For even when we were with you, we would give you this command: If anyone is not willing to work, let him not eat. \\n\\t\\t\\t","3","2 Thessalonians","177")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","11","78.066","Chapter 3","For we hear that some among you walk in idleness, not busy at work, but busybodies. \\n\\t\\t\\t","3","2 Thessalonians","177")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","12","84.887","Chapter 3","Now such persons we command and encourage in the Lord Jesus Christ to do their work quietly and to earn their own living. \\n\\t\\t\\t","3","2 Thessalonians","177")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","13","93.411","Chapter 3","As for you, brothers, do not grow weary in doing good. \\n\\t\\t\\t","3","2 Thessalonians","177")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","14","97.781","Chapter 3","If anyone does not obey what we say in this letter, take note of that person, and have nothing to do with him, that he may be ashamed. \\n\\t\\t\\t","3","2 Thessalonians","177")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","15","104.768","Chapter 3","Do not regard him as an enemy, but warn him as a brother. \\n\\t\\t\\t","3","2 Thessalonians","177")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","16","109.159","Chapter 3","Now may the Lord of peace himself give you peace at all times in every way. The Lord be with you all. \\n\\t\\t\\t","3","2 Thessalonians","177")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","17","117.146","Chapter 3","I, Paul, write this greeting with my own hand. This is the sign of genuineness in every letter of mine; it is the way I write. \\n\\t\\t\\t","3","2 Thessalonians","177")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("68","2Thess","18","126.331","Chapter 3","The grace of our Lord Jesus Christ be with you all. \\n\\n\\t\\t\\n\\t","3","2 Thessalonians","177")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("69","1Tim","1","4.728","Chapter 1","Paul, an apostle of Christ Jesus by command of God our Savior and of Christ Jesus our hope, \\n\\t\\t\\t","1","1 Timothy","177")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("69","1Tim","2","12.53","Chapter 1","To Timothy, my true child in the faith: Grace, mercy, and peace from God the Father and Christ Jesus our Lord. \\n\\t\\t\\t","1","1 Timothy","177")');
