tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","8","77","Chapter 7","In the one case tithes are received by mortal men, but in the other case, by one of whom it is testified that he lives. \\n\\t\\t\\t","7","Hebrews","193")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","9","86.874","Chapter 7","One might even say that Levi himself, who receives tithes, paid tithes through Abraham, \\n\\t\\t\\t","7","Hebrews","193")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","10","94.278","Chapter 7","for he was still in the loins of his ancestor when Melchizedek met him. \\n\\t\\t\\t","7","Hebrews","193")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","11","99.57","Chapter 7","Now if perfection had been attainable through the Levitical priesthood (for under it the people received the law), what further need would there have been for another priest to arise after the order of Melchizedek, rather than one named after the order of Aaron? \\n\\t\\t\\t","7","Hebrews","193")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","12","118.053","Chapter 7","For when there is a change in the priesthood, there is necessarily a change in the law as well. \\n\\t\\t\\t","7","Hebrews","193")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","13","125.265","Chapter 7","For the one of whom these things are spoken belonged to another tribe, from which no one has ever served at the altar. \\n\\t\\t\\t","7","Hebrews","193")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","14","134.185","Chapter 7","For it is evident that our Lord was descended from Judah, and in connection with that tribe Moses said nothing about priests. \\n\\t\\t\\t","7","Hebrews","193")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","15","143.344","Chapter 7","This becomes even more evident when another priest arises in the likeness of Melchizedek, \\n\\t\\t\\t","7","Hebrews","193")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","16","149.503","Chapter 7","who has become a priest, not on the basis of a legal requirement concerning bodily descent, but by the power of an indestructible life. \\n\\t\\t\\t","7","Hebrews","193")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","17","160.225","Chapter 7","For it is witnessed of him, \\u201cYou are a priest forever, after the order of Melchizedek.\\u201d \\n\\t\\t\\t","7","Hebrews","193")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","18","167.662","Chapter 7","For on the one hand, a former commandment is set aside because of its weakness and uselessness \\n\\t\\t\\t","7","Hebrews","193")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","19","174.503","Chapter 7","(for the law made nothing perfect); but on the other hand, a better hope is introduced, through which we draw near to God. \\n\\t\\t\\t","7","Hebrews","193")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","20","185.053","Chapter 7","And it was not without an oath. For those who formerly became priests were made such without an oath, \\n\\t\\t\\t","7","Hebrews","193")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","21","192.305","Chapter 7","but this one was made a priest with an oath by the one who said to him: \\u201cThe Lord has sworn and will not change his mind, \\u2018You are a priest forever.\\u2019\\u201d \\n\\t\\t\\t","7","Hebrews","193")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","22","204.146","Chapter 7","This makes Jesus the guarantor of a better covenant. \\n\\t\\t\\t","7","Hebrews","193")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","23","208.596","Chapter 7","The former priests were many in number, because they were prevented by death from continuing in office, \\n\\t\\t\\t","7","Hebrews","193")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","24","215.874","Chapter 7","but he holds his priesthood permanently, because he continues forever. \\n\\t\\t\\t","7","Hebrews","193")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","25","221.742","Chapter 7","Consequently, he is able to save to the uttermost those who draw near to God through him, since he always lives to make intercession for them. \\n\\t\\t\\t","7","Hebrews","193")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","26","233.887","Chapter 7","For it was indeed fitting that we should have such a high priest, holy, innocent, unstained, separated from sinners, and exalted above the heavens. \\n\\t\\t\\t","7","Hebrews","193")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","27","246.305","Chapter 7","He has no need, like those high priests, to offer sacrifices daily, first for his own sins and then for those of the people, since he did this once for all when he offered up himself. \\n\\t\\t\\t","7","Hebrews","193")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","28","261.503","Chapter 7","For the law appoints men in their weakness as high priests, but the word of the oath, which came later than the law, appoints a Son who has been made perfect forever. \\n\\t\\t\\n\\t\\t","7","Hebrews","193")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","1","3.742","Chapter 8","Now the point in what we are saying is this: we have such a high priest, one who is seated at the right hand of the throne of the Majesty in heaven, \\n\\t\\t\\t","8","Hebrews","194")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","2","15.556","Chapter 8","a minister in the holy places, in the true tent that the Lord set up, not man. \\n\\t\\t\\t","8","Hebrews","194")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","3","23.238","Chapter 8","For every high priest is appointed to offer gifts and sacrifices; thus it is necessary for this priest also to have something to offer. \\n\\t\\t\\t","8","Hebrews","194")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","4","33.848","Chapter 8","Now if he were on earth, he would not be a priest at all, since there are priests who offer gifts according to the law. \\n\\t\\t\\t","8","Hebrews","194")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","5","42.026","Chapter 8","They serve a copy and shadow of the heavenly things. For when Moses was about to erect the tent, he was instructed by God, saying, \\u201cSee that you make everything according to the pattern that was shown you on the mountain.\\u201d \\n\\t\\t\\t","8","Hebrews","194")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","6","59.159","Chapter 8","But as it is, Christ has obtained a ministry that is as much more excellent than the old as the covenant he mediates is better, since it is enacted on better promises. \\n\\t\\t\\t","8","Hebrews","194")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","7","72.623","Chapter 8","For if that first covenant had been faultless, there would have been no occasion to look for a second. \\n\\t\\t\\t","8","Hebrews","194")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","8","79.57","Chapter 8","For he finds fault with them when he says: \\u201cBehold, the days are coming, declares the Lord, when I will establish a new covenant with the house of Israel and with the house of Judah, \\n\\t\\t\\t","8","Hebrews","194")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","9","91.795","Chapter 8","not like the covenant that I made with their fathers on the day when I took them by the hand to bring them out of the land of Egypt. For they did not continue in my covenant, and so I showed no concern for them, declares the Lord. \\n\\t\\t\\t","8","Hebrews","194")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","10","107.265","Chapter 8","For this is the covenant that I will make with the house of Israel after those days, declares the Lord: I will put my laws into their minds, and write them on their hearts, and I will be their God, and they shall be my people. \\n\\t\\t\\t","8","Hebrews","194")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","11","122.583","Chapter 8","And they shall not teach, each one his neighbor and each one his brother, saying, \\u2018Know the Lord,\\u2019 for they shall all know me, from the least of them to the greatest. \\n\\t\\t\\t","8","Hebrews","194")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","12","133.199","Chapter 8","For I will be merciful toward their iniquities, and I will remember their sins no more.\\u201d \\n\\t\\t\\t","8","Hebrews","194")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","13","140.344","Chapter 8","In speaking of a new covenant, he makes the first one obsolete. And what is becoming obsolete and growing old is ready to vanish away. \\n\\t\\t\\n\\t\\t","8","Hebrews","194")');

