tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","3","20.98","Chapter 9","Behind the second curtain was a second section called the Most Holy Place, \\n\\t\\t\\t","9","Hebrews","195")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","4","26.795","Chapter 9","having the golden altar of incense and the ark of the covenant covered on all sides with gold, in which was a golden urn holding the manna, and Aaron\\u2019s staff that budded, and the tablets of the covenant. \\n\\t\\t\\t","9","Hebrews","195")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","5","41.517","Chapter 9","Above it were the cherubim of glory overshadowing the mercy seat. Of these things we cannot now speak in detail. \\n\\t\\t\\t","9","Hebrews","195")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","6","50.556","Chapter 9","These preparations having thus been made, the priests go regularly into the first section, performing their ritual duties, \\n\\t\\t\\t","9","Hebrews","195")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","7","58.914","Chapter 9","but into the second only the high priest goes, and he but once a year, and not without taking blood, which he offers for himself and for the unintentional sins of the people. \\n\\t\\t\\t","9","Hebrews","195")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","8","72.887","Chapter 9","By this the Holy Spirit indicates that the way into the holy places is not yet opened as long as the first section is still standing \\n\\t\\t\\t","9","Hebrews","195")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","9","83.291","Chapter 9","(which is symbolic for the present age). According to this arrangement, gifts and sacrifices are offered that cannot perfect the conscience of the worshiper, \\n\\t\\t\\t","9","Hebrews","195")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","10","94.437","Chapter 9","but deal only with food and drink and various washings, regulations for the body imposed until the time of reformation. \\n\\t\\t\\t","9","Hebrews","195")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","11","103.768","Chapter 9","But when Christ appeared as a high priest of the good things that have come, then through the greater and more perfect tent (not made with hands, that is, not of this creation) \\n\\t\\t\\t","9","Hebrews","195")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","12","116.225","Chapter 9","he entered once for all into the holy places, not by means of the blood of goats and calves but by means of his own blood, thus securing an eternal redemption. \\n\\t\\t\\t","9","Hebrews","195")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","13","130.437","Chapter 9","For if the blood of goats and bulls, and the sprinkling of defiled persons with the ashes of a heifer, sanctify for the purification of the flesh, \\n\\t\\t\\t","9","Hebrews","195")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","14","142.132","Chapter 9","how much more will the blood of Christ, who through the eternal Spirit offered himself without blemish to God, purify our conscience from dead works to serve the living God. \\n\\t\\t\\t","9","Hebrews","195")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","15","156.212","Chapter 9","Therefore he is the mediator of a new covenant, so that those who are called may receive the promised eternal inheritance, since a death has occurred that redeems them from the transgressions committed under the first covenant. \\n\\t\\t\\t","9","Hebrews","195")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","16","173.808","Chapter 9","For where a will is involved, the death of the one who made it must be established. \\n\\t\\t\\t","9","Hebrews","195")');
