tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","18","188.662","Chapter 9","Therefore not even the first covenant was inaugurated without blood. \\n\\t\\t\\t","9","Hebrews","195")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","19","193.596","Chapter 9","For when every commandment of the law had been declared by Moses to all the people, he took the blood of calves and goats, with water and scarlet wool and hyssop, and sprinkled both the book itself and all the people, \\n\\t\\t\\t","9","Hebrews","195")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","20","209.887","Chapter 9","saying, \\u201cThis is the blood of the covenant that God commanded for you.\\u201d \\n\\t\\t\\t","9","Hebrews","195")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","21","215.834","Chapter 9","And in the same way he sprinkled with the blood both the tent and all the vessels used in worship. \\n\\t\\t\\t","9","Hebrews","195")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","22","223.503","Chapter 9","Indeed, under the law almost everything is purified with blood, and without the shedding of blood there is no forgiveness of sins. \\n\\t\\t\\t","9","Hebrews","195")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","23","234.371","Chapter 9","Thus it was necessary for the copies of the heavenly things to be purified with these rites, but the heavenly things themselves with better sacrifices than these. \\n\\t\\t\\t","9","Hebrews","195")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","24","247.225","Chapter 9","For Christ has entered, not into holy places made with hands, which are copies of the true things, but into heaven itself, now to appear in the presence of God on our behalf. \\n\\t\\t\\t","9","Hebrews","195")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","25","262.371","Chapter 9","Nor was it to offer himself repeatedly, as the high priest enters the holy places every year with blood not his own, \\n\\t\\t\\t","9","Hebrews","195")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","26","272.358","Chapter 9","for then he would have had to suffer repeatedly since the foundation of the world. But as it is, he has appeared once for all at the end of the ages to put away sin by the sacrifice of himself. \\n\\t\\t\\t","9","Hebrews","195")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","27","290.464","Chapter 9","And just as it is appointed for man to die once, and after that comes judgment, \\n\\t\\t\\t","9","Hebrews","195")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","28","297.848","Chapter 9","so Christ, having been offered once to bear the sins of many, will appear a second time, not to deal with sin but to save those who are eagerly waiting for him. \\n\\t\\t\\n\\t\\t","9","Hebrews","195")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","1","2.781","Chapter 10","For since the law has but a shadow of the good things to come instead of the true form of these realities, it can never, by the same sacrifices that are continually offered every year, make perfect those who draw near. \\n\\t\\t\\t","10","Hebrews","196")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","2","20.013","Chapter 10","Otherwise, would they not have ceased to be offered, since the worshipers, having once been cleansed, would no longer have any consciousness of sins? \\n\\t\\t\\t","10","Hebrews","196")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","3","31.623","Chapter 10","But in these sacrifices there is a reminder of sins every year. \\n\\t\\t\\t","10","Hebrews","196")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","4","37.291","Chapter 10","For it is impossible for the blood of bulls and goats to take away sins. \\n\\t\\t\\t","10","Hebrews","196")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","5","42.954","Chapter 10","Consequently, when Christ came into the world, he said, \\u201cSacrifices and offerings you have not desired, but a body have you prepared for me; \\n\\t\\t\\t","10","Hebrews","196")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","6","53.728","Chapter 10","in burnt offerings and sin offerings you have taken no pleasure. \\n\\t\\t\\t","10","Hebrews","196")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("73","Heb","7","58","Chapter 10","Then I said, \\u2018Behold, I have come to do your will, O God, as it is written of me in the scroll of the book.\\u2019\\u201d \\n\\t\\t\\t","10","Hebrews","196")');
