tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","24","177.053","Chapter 1","For he looks at himself and goes away and at once forgets what he was like. \\n\\t\\t\\t","1","James","199")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","25","182.808","Chapter 1","But the one who looks into the perfect law, the law of liberty, and perseveres, being no hearer who forgets but a doer who acts, he will be blessed in his doing. \\n\\t\\t\\t","1","James","199")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","26","195.252","Chapter 1","If anyone thinks he is religious and does not bridle his tongue but deceives his heart, this person\\u2019s religion is worthless. \\n\\t\\t\\t","1","James","199")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","27","203.437","Chapter 1","Religion that is pure and undefiled before God, the Father, is this: to visit orphans and widows in their affliction, and to keep oneself unstained from the world. \\n\\t\\t\\n\\t\\t","1","James","199")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","1","3.636","Chapter 2","My brothers, show no partiality as you hold the faith in our Lord Jesus Christ, the Lord of glory. \\n\\t\\t\\t","2","James","200")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","2","10.596","Chapter 2","For if a man wearing a gold ring and fine clothing comes into your assembly, and a poor man in shabby clothing also comes in, \\n\\t\\t\\t","2","James","200")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","3","19.199","Chapter 2","and if you pay attention to the one who wears the fine clothing and say, \\u201cYou sit here in a good place,\\u201d while you say to the poor man, \\u201cYou stand over there,\\u201d or, \\u201cSit down at my feet,\\u201d \\n\\t\\t\\t","2","James","200")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","4","34.079","Chapter 2","have you not then made distinctions among yourselves and become judges with evil thoughts? \\n\\t\\t\\t","2","James","200")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","5","40.715","Chapter 2","Listen, my beloved brothers, has not God chosen those who are poor in the world to be rich in faith and heirs of the kingdom, which he has promised to those who love him? \\n\\t\\t\\t","2","James","200")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","6","53.252","Chapter 2","But you have dishonored the poor man. Are not the rich the ones who oppress you, and the ones who drag you into court? \\n\\t\\t\\t","2","James","200")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","7","61.225","Chapter 2","Are they not the ones who blaspheme the honorable name by which you were called? \\n\\t\\t\\t","2","James","200")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","8","66.291","Chapter 2","If you really fulfill the royal law according to the Scripture, \\u201cYou shall love your neighbor as yourself,\\u201d you are doing well. \\n\\t\\t\\t","2","James","200")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","9","76.119","Chapter 2","But if you show partiality, you are committing sin and are convicted by the law as transgressors. \\n\\t\\t\\t","2","James","200")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","10","82.834","Chapter 2","For whoever keeps the whole law but fails in one point has become accountable for all of it. \\n\\t\\t\\t","2","James","200")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","11","89.556","Chapter 2","For he who said, \\u201cDo not commit adultery,\\u201d also said, \\u201cDo not murder.\\u201d If you do not commit adultery but do murder, you have become a transgressor of the law. \\n\\t\\t\\t","2","James","200")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","12","103.742","Chapter 2","So speak and so act as those who are to be judged under the law of liberty. \\n\\t\\t\\t","2","James","200")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","13","109.344","Chapter 2","For judgment is without mercy to one who has shown no mercy. Mercy triumphs over judgment. \\n\\t\\t\\t","2","James","200")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","14","117.689","Chapter 2","What good is it, my brothers, if someone says he has faith but does not have works? Can that faith save him? \\n\\t\\t\\t","2","James","200")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","15","125.795","Chapter 2","If a brother or sister is poorly clothed and lacking in daily food, \\n\\t\\t\\t","2","James","200")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","16","130.556","Chapter 2","and one of you says to them, \\u201cGo in peace, be warmed and filled,\\u201d without giving them the things needed for the body, what good is that? \\n\\t\\t\\t","2","James","200")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","17","141.106","Chapter 2","So also faith by itself, if it does not have works, is dead. \\n\\t\\t\\t","2","James","200")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","18","148.384","Chapter 2","But someone will say, \\u201cYou have faith and I have works.\\u201d Show me your faith apart from your works, and I will show you my faith by my works. \\n\\t\\t\\t","2","James","200")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","19","159.503","Chapter 2","You believe that God is one; you do well. Even the demons believe\\u2014and shudder! \\n\\t\\t\\t","2","James","200")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","20","167.503","Chapter 2","Do you want to be shown, you foolish person, that faith apart from works is useless? \\n\\t\\t\\t","2","James","200")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","21","174.093","Chapter 2","Was not Abraham our father justified by works when he offered up his son Isaac on the altar? \\n\\t\\t\\t","2","James","200")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","22","180.344","Chapter 2","You see that faith was active along with his works, and faith was completed by his works; \\n\\t\\t\\t","2","James","200")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","23","186.119","Chapter 2","and the Scripture was fulfilled that says, \\u201cAbraham believed God, and it was counted to him as righteousness\\u201d\\u2014and he was called a friend of God. \\n\\t\\t\\t","2","James","200")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","24","198.821","Chapter 2","You see that a person is justified by works and not by faith alone. \\n\\t\\t\\t","2","James","200")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","25","204.199","Chapter 2","And in the same way was not also Rahab the prostitute justified by works when she received the messengers and sent them out by another way? \\n\\t\\t\\t","2","James","200")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","26","214.94","Chapter 2","For as the body apart from the spirit is dead, so also faith apart from works is dead. \\n\\t\\t\\n\\t\\t","2","James","200")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","1","2.728","Chapter 3","Not many of you should become teachers, my brothers, for you know that we who teach will be judged with greater strictness. \\n\\t\\t\\t","3","James","201")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","2","11.702","Chapter 3","For we all stumble in many ways. And if anyone does not stumble in what he says, he is a perfect man, able also to bridle his whole body. \\n\\t\\t\\t","3","James","201")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","3","22.291","Chapter 3","If we put bits into the mouths of horses so that they obey us, we guide their whole bodies as well. \\n\\t\\t\\t","3","James","201")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","4","30.093","Chapter 3","Look at the ships also: though they are so large and are driven by strong winds, they are guided by a very small rudder wherever the will of the pilot directs. \\n\\t\\t\\t","3","James","201")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","5","41.702","Chapter 3","So also the tongue is a small member, yet it boasts of great things. How great a forest is set ablaze by such a small fire! \\n\\t\\t\\t","3","James","201")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","6","51.265","Chapter 3","And the tongue is a fire, a world of unrighteousness. The tongue is set among our members, staining the whole body, setting on fire the entire course of life,and set on fire by hell. \\n\\t\\t\\t","3","James","201")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","7","64.291","Chapter 3","For every kind of beast and bird, of reptile and sea creature, can be tamed and has been tamed by mankind, \\n\\t\\t\\t","3","James","201")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","8","71.848","Chapter 3","but no human being can tame the tongue. It is a restless evil, full of deadly poison. \\n\\t\\t\\t","3","James","201")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","9","79.927","Chapter 3","With it we bless our Lord and Father, and with it we curse people who are made in the likeness of God. \\n\\t\\t\\t","3","James","201")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","10","87.49","Chapter 3","From the same mouth come blessing and cursing. My brothers, these things ought not to be so. \\n\\t\\t\\t","3","James","201")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","11","95.305","Chapter 3","Does a spring pour forth from the same opening both fresh and salt water? \\n\\t\\t\\t","3","James","201")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","12","100.874","Chapter 3","Can a fig tree, my brothers, bear olives, or a grapevine produce figs? Neither can a salt pond yield fresh water. \\n\\t\\t\\t","3","James","201")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","13","110.848","Chapter 3","Who is wise and understanding among you? By his good conduct let him show his works in the meekness of wisdom. \\n\\t\\t\\t","3","James","201")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","14","119.397","Chapter 3","But if you have bitter jealousy and selfish ambition in your hearts, do not boast and be false to the truth. \\n\\t\\t\\t","3","James","201")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","15","129.013","Chapter 3","This is not the wisdom that comes down from above, but is earthly, unspiritual, demonic. \\n\\t\\t\\t","3","James","201")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","16","137.424","Chapter 3","For where jealousy and selfish ambition exist, there will be disorder and every vile practice. \\n\\t\\t\\t","3","James","201")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","17","145.411","Chapter 3","But the wisdom from above is first pure, then peaceable, gentle, open to reason, full of mercy and good fruits, impartial and sincere. \\n\\t\\t\\t","3","James","201")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","18","159.066","Chapter 3","And a harvest of righteousness is sown in peace by those who make peace. \\n\\t\\t\\n\\t\\t","3","James","201")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","1","2.649","Chapter 4","What causes quarrels and what causes fights among you? Is it not this, that your passions are at war within you? \\n\\t\\t\\t","4","James","202")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","2","13.331","Chapter 4","You desire and do not have, so you murder. You covet and cannot obtain, so you fight and quarrel. You do not have, because you do not ask. \\n\\t\\t\\t","4","James","202")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","3","25.636","Chapter 4","You ask and do not receive, because you ask wrongly, to spend it on your passions. \\n\\t\\t\\t","4","James","202")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","4","33.57","Chapter 4","You adulterous people! Do you not know that friendship with the world is enmity with God? Therefore whoever wishes to be a friend of the world makes himself an enemy of God. \\n\\t\\t\\t","4","James","202")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","5","47.132","Chapter 4","Or do you suppose it is to no purpose that the Scripture says, \\u201cHe yearns jealously over the spirit that he has made to dwell in us\\u201d? \\n\\t\\t\\t","4","James","202")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","6","56.742","Chapter 4","But he gives more grace. Therefore it says, \\u201cGod opposes the proud, but gives grace to the humble.\\u201d \\n\\t\\t\\t","4","James","202")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","7","66.596","Chapter 4","Submit yourselves therefore to God. Resist the devil, and he will flee from you. \\n\\t\\t\\t","4","James","202")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","8","73.702","Chapter 4","Draw near to God, and he will draw near to you. Cleanse your hands, you sinners, and purify your hearts, you double-minded. \\n\\t\\t\\t","4","James","202")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","9","83.821","Chapter 4","Be wretched and mourn and weep. Let your laughter be turned to mourning and your joy to gloom. \\n\\t\\t\\t","4","James","202")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","10","91.623","Chapter 4","Humble yourselves before the Lord, and he will exalt you. \\n\\t\\t\\t","4","James","202")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","11","96.596","Chapter 4","Do not speak evil against one another, brothers. The one who speaks against a brother or judges his brother, speaks evil against the law and judges the law. But if you judge the law, you are not a doer of the law but a judge. \\n\\t\\t\\t","4","James","202")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","12","113.755","Chapter 4","There is only one lawgiver and judge, he who is able to save and to destroy. But who are you to judge your neighbor? \\n\\t\\t\\t","4","James","202")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","13","123.331","Chapter 4","Come now, you who say, \\u201cToday or tomorrow we will go into such and such a town and spend a year there and trade and make a profit\\u201d\\u2014 \\n\\t\\t\\t","4","James","202")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","14","132.755","Chapter 4","yet you do not know what tomorrow will bring. What is your life? For you are a mist that appears for a little time and then vanishes. \\n\\t\\t\\t","4","James","202")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","15","143.159","Chapter 4","Instead you ought to say, \\u201cIf the Lord wills, we will live and do this or that.\\u201d \\n\\t\\t\\t","4","James","202")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","16","149.384","Chapter 4","As it is, you boast in your arrogance. All such boasting is evil. \\n\\t\\t\\t","4","James","202")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","17","155.278","Chapter 4","So whoever knows the right thing to do and fails to do it, for him it is sin. \\n\\t\\t\\n\\t\\t","4","James","202")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","1","3.066","Chapter 5","Come now, you rich, weep and howl for the miseries that are coming upon you. \\n\\t\\t\\t","5","James","203")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","2","9.795","Chapter 5","Your riches have rotted and your garments are moth-eaten. \\n\\t\\t\\t","5","James","203")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","3","14.331","Chapter 5","Your gold and silver have corroded, and their corrosion will be evidence against you and will eat your flesh like fire. You have laid up treasure in the last days. \\n\\t\\t\\t","5","James","203")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","4","26.305","Chapter 5","Behold, the wages of the laborers who mowed your fields, which you kept back by fraud, are crying out against you, and the cries of the harvesters have reached the ears of the Lord of hosts. \\n\\t\\t\\t","5","James","203")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","5","40.834","Chapter 5","You have lived on the earth in luxury and in self-indulgence. You have fattened your hearts in a day of slaughter. \\n\\t\\t\\t","5","James","203")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","6","49.238","Chapter 5","You have condemned and murdered the righteous person. He does not resist you. \\n\\t\\t\\t","5","James","203")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","7","55.424","Chapter 5","Be patient, therefore, brothers, until the coming of the Lord. See how the farmer waits for the precious fruit of the earth, being patient about it, until it receives the early and the late rains. \\n\\t\\t\\t","5","James","203")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","8","69.265","Chapter 5","You also, be patient. Establish your hearts, for the coming of the Lord is at hand. \\n\\t\\t\\t","5","James","203")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("74","Jas","9","76.728","Chapter 5","Do not grumble against one another, brothers, so that you may not be judged; behold, the Judge is standing at the door. \\n\\t\\t\\t","5","James","203")');
