tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("75","1Pet","5","40.49","Chapter 4","but they will give account to him who is ready to judge the living and the dead. \\n\\t\\t\\t","4","1 Peter","206")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("75","1Pet","6","46.212","Chapter 4","For this is why the gospel was preached even to those who are dead, that though judged in the flesh the way people are, they might live in the spirit the way God does. \\n\\t\\t\\t","4","1 Peter","206")');
