tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("75","1Pet","10","75.874","Chapter 4","As each has received a gift, use it to serve one another, as good stewards of God\\u2019s varied grace: \\n\\t\\t\\t","4","1 Peter","206")');
