tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("75","1Pet","12","103.742","Chapter 4","Beloved, do not be surprised at the fiery trial when it comes upon you to test you, as though something strange were happening to you. \\n\\t\\t\\t","4","1 Peter","206")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("75","1Pet","13","114.199","Chapter 4","But rejoice insofar as you share Christ\\u2019s sufferings, that you may also rejoice and be glad when his glory is revealed. \\n\\t\\t\\t","4","1 Peter","206")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("75","1Pet","14","123.106","Chapter 4","If you are insulted for the name of Christ, you are blessed, because the Spirit of glory and of God rests upon you. \\n\\t\\t\\t","4","1 Peter","206")');
