tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("75","1Pet","17","147.119","Chapter 4","For it is time for judgment to begin at the household of God; and if it begins with us, what will be the outcome for those who do not obey the gospel of God? \\n\\t\\t\\t","4","1 Peter","206")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("75","1Pet","18","157.94","Chapter 4","And \\u201cIf the righteous is scarcely saved, what will become of the ungodly and the sinner?\\u201d \\n\\t\\t\\t","4","1 Peter","206")');
