tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("75","1Pet","7","60.212","Chapter 5","casting all your anxieties on him, because he cares for you. \\n\\t\\t\\t","5","1 Peter","207")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("75","1Pet","8","65.252","Chapter 5","Be sober-minded; be watchful. Your adversary the devil prowls around like a roaring lion, seeking someone to devour. \\n\\t\\t\\t","5","1 Peter","207")');
