tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","1","4.371","Chapter 1","Simeon Peter, a servant and apostle of Jesus Christ, To those who have obtained a faith of equal standing with ours by the righteousness of our God and Savior Jesus Christ: \\n\\t\\t\\t","1","2 Peter","207")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","2","18.199","Chapter 1","May grace and peace be multiplied to you in the knowledge of God and of Jesus our Lord. \\n\\t\\t\\t","1","2 Peter","207")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","3","25.172","Chapter 1","His divine power has granted to us all things that pertain to life and godliness, through the knowledge of him who called us to his own glory and excellence, \\n\\t\\t\\t","1","2 Peter","207")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","4","36.212","Chapter 1","by which he has granted to us his precious and very great promises, so that through them you may become partakers of the divine nature, having escaped from the corruption that is in the world because of sinful desire. \\n\\t\\t\\t","1","2 Peter","207")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","5","50.795","Chapter 1","For this very reason, make every effort to supplement your faith with virtue, and virtue with knowledge, \\n\\t\\t\\t","1","2 Peter","207")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","6","57.94","Chapter 1","and knowledge with self-control, and self-control with steadfastness, and steadfastness with godliness, \\n\\t\\t\\t","1","2 Peter","207")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","7","65.278","Chapter 1","and godliness with brotherly affection, and brotherly affection with love. \\n\\t\\t\\t","1","2 Peter","207")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","8","71.543","Chapter 1","For if these qualities are yours and are increasing, they keep you from being ineffective or unfruitful in the knowledge of our Lord Jesus Christ. \\n\\t\\t\\t","1","2 Peter","207")');
