tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","10","90.636","Chapter 1","Therefore, brothers, be all the more diligent to make your calling and election sure, for if you practice these qualities you will never fall. \\n\\t\\t\\t","1","2 Peter","207")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","11","100.344","Chapter 1","For in this way there will be richly provided for you an entrance into the eternal kingdom of our Lord and Savior Jesus Christ. \\n\\t\\t\\t","1","2 Peter","207")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","12","110.649","Chapter 1","Therefore I intend always to remind you of these qualities, though you know them and are established in the truth that you have. \\n\\t\\t\\t","1","2 Peter","207")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","13","119.57","Chapter 1","I think it right, as long as I am in this body, to stir you up by way of reminder, \\n\\t\\t\\t","1","2 Peter","207")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","14","125.556","Chapter 1","since I know that the putting off of my body will be soon, as our Lord Jesus Christ made clear to me. \\n\\t\\t\\t","1","2 Peter","207")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","15","131.781","Chapter 1","And I will make every effort so that after my departure you may be able at any time to recall these things. \\n\\t\\t\\t","1","2 Peter","207")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","16","139.212","Chapter 1","For we did not follow cleverly devised myths when we made known to you the power and coming of our Lord Jesus Christ, but we were eyewitnesses of his majesty. \\n\\t\\t\\t","1","2 Peter","207")');
