tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","18","163.225","Chapter 1","we ourselves heard this very voice borne from heaven, for we were with him on the holy mountain. \\n\\t\\t\\t","1","2 Peter","207")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","19","170.609","Chapter 1","And we have something more sure, the prophetic word, to which you will do well to pay attention as to a lamp shining in a dark place, until the day dawns and the morning star rises in your hearts, \\n\\t\\t\\t","1","2 Peter","207")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","20","184.901","Chapter 1","knowing this first of all, that no prophecy of Scripture comes from someone\\u2019s own interpretation. \\n\\t\\t\\t","1","2 Peter","207")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","21","192.066","Chapter 1","For no prophecy was ever produced by the will of man, but men spoke from God as they were carried along by the Holy Spirit. \\n\\t\\t\\n\\t\\t","1","2 Peter","207")');

