tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","7","69.146","Chapter 2","and if he rescued righteous Lot, greatly distressed by the sensual conduct of the wicked \\n\\t\\t\\t","2","2 Peter","208")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","8","76.437","Chapter 2","(for as that righteous man lived among them day after day, he was tormenting his righteous soul over their lawless deeds that he saw and heard); \\n\\t\\t\\t","2","2 Peter","208")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","9","86.093","Chapter 2","then the Lord knows how to rescue the godly from trials, and to keep the unrighteous under punishment until the day of judgment, \\n\\t\\t\\t","2","2 Peter","208")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","10","94.914","Chapter 2","and especially those who indulge in the lust of defiling passion and despise authority. Bold and willful, they do not tremble as they blaspheme the glorious ones, \\n\\t\\t\\t","2","2 Peter","208")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","11","107.834","Chapter 2","whereas angels, though greater in might and power, do not pronounce a blasphemous judgment against them before the Lord. \\n\\t\\t\\t","2","2 Peter","208")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","12","115.543","Chapter 2","But these, like irrational animals, creatures of instinct, born to be caught and destroyed, blaspheming about matters of which they are ignorant, will also be destroyed in their destruction, \\n\\t\\t\\t","2","2 Peter","208")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","13","128.768","Chapter 2","suffering wrong as the wage for their wrongdoing. They count it pleasure to revel in the daytime. They are blots and blemishes, reveling in their deceptions,while they feast with you. \\n\\t\\t\\t","2","2 Peter","208")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","14","142.477","Chapter 2","They have eyes full of adultery, insatiable for sin. They entice unsteady souls. They have hearts trained in greed. Accursed children! \\n\\t\\t\\t","2","2 Peter","208")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","15","154.543","Chapter 2","Forsaking the right way, they have gone astray. They have followed the way of Balaam, the son of Beor, who loved gain from wrongdoing, \\n\\t\\t\\t","2","2 Peter","208")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","16","163.702","Chapter 2","but was rebuked for his own transgression; a speechless donkey spoke with human voice and restrained the prophet\\u2019s madness. \\n\\t\\t\\t","2","2 Peter","208")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","17","172.94","Chapter 2","These are waterless springs and mists driven by a storm. For them the gloom of utter darkness has been reserved. \\n\\t\\t\\t","2","2 Peter","208")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","18","182.04","Chapter 2","For, speaking loud boasts of folly, they entice by sensual passions of the flesh those who are barely escaping from those who live in error. \\n\\t\\t\\t","2","2 Peter","208")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","19","191.278","Chapter 2","They promise them freedom, but they themselves are slaves of corruption. For whatever overcomes a person, to that he is enslaved. \\n\\t\\t\\t","2","2 Peter","208")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","20","201.874","Chapter 2","For if, after they have escaped the defilements of the world through the knowledge of our Lord and Savior Jesus Christ, they are again entangled in them and overcome, the last state has become worse for them than the first. \\n\\t\\t\\t","2","2 Peter","208")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","21","215.848","Chapter 2","For it would have been better for them never to have known the way of righteousness than after knowing it to turn back from the holy commandment delivered to them. \\n\\t\\t\\t","2","2 Peter","208")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","22","225","Chapter 2","What the true proverb says has happened to them: \\u201cThe dog returns to its own vomit, and the sow, after washing herself, returns to wallow in the mire.\\u201d \\n\\t\\t\\n\\t\\t","2","2 Peter","208")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","1","3.199","Chapter 3","This is now the second letter that I am writing to you, beloved. In both of them I am stirring up your sincere mind by way of reminder, \\n\\t\\t\\t","3","2 Peter","209")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","2","12.437","Chapter 3","that you should remember the predictions of the holy prophets and the commandment of the Lord and Savior through your apostles, \\n\\t\\t\\t","3","2 Peter","209")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","3","19.265","Chapter 3","knowing this first of all, that scoffers will come in the last days with scoffing, following their own sinful desires. \\n\\t\\t\\t","3","2 Peter","209")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","4","27.437","Chapter 3","They will say, \\u201cWhere is the promise of his coming? For ever since the fathers fell asleep, all things are continuing as they were from the beginning of creation.\\u201d \\n\\t\\t\\t","3","2 Peter","209")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","5","38.49","Chapter 3","For they deliberately overlook this fact, that the heavens existed long ago, and the earth was formed out of water and through water by the word of God, \\n\\t\\t\\t","3","2 Peter","209")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","6","48.662","Chapter 3","and that by means of these the world that then existed was deluged with water and perished. \\n\\t\\t\\t","3","2 Peter","209")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","7","54.98","Chapter 3","But by the same word the heavens and earth that now exist are stored up for fire, being kept until the day of judgment and destruction of the ungodly. \\n\\t\\t\\t","3","2 Peter","209")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","8","65.662","Chapter 3","But do not overlook this one fact, beloved, that with the Lord one day is as a thousand years, and a thousand years as one day. \\n\\t\\t\\t","3","2 Peter","209")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","9","75.927","Chapter 3","The Lord is not slow to fulfill his promise as some count slowness, but is patient toward you, not wishing that any should perish, but that all should reach repentance. \\n\\t\\t\\t","3","2 Peter","209")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","10","88.146","Chapter 3","But the day of the Lord will come like a thief, and then the heavens will pass away with a roar, and the heavenly bodies will be burned up and dissolved, and the earth and the works that are done on it will be exposed. \\n\\t\\t\\t","3","2 Peter","209")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","11","102.675","Chapter 3","Since all these things are thus to be dissolved, what sort of people ought you to be in lives of holiness and godliness, \\n\\t\\t\\t","3","2 Peter","209")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","12","109.503","Chapter 3","waiting for and hastening the coming of the day of God, because of which the heavens will be set on fire and dissolved, and the heavenly bodies will melt as they burn! \\n\\t\\t\\t","3","2 Peter","209")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","13","121.159","Chapter 3","But according to his promise we are waiting for new heavens and a new earth in which righteousness dwells. \\n\\t\\t\\t","3","2 Peter","209")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","14","130.252","Chapter 3","Therefore, beloved, since you are waiting for these, be diligent to be found by him without spot or blemish, and at peace. \\n\\t\\t\\t","3","2 Peter","209")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","15","139.954","Chapter 3","And count the patience of our Lord as salvation, just as our beloved brother Paul also wrote to you according to the wisdom given him, \\n\\t\\t\\t","3","2 Peter","209")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","16","148.689","Chapter 3","as he does in all his letters when he speaks in them of these matters. There are some things in them that are hard to understand, which the ignorant and unstable twist to their own destruction, as they do the other Scriptures. \\n\\t\\t\\t","3","2 Peter","209")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","17","162.901","Chapter 3","You therefore, beloved, knowing this beforehand, take care that you are not carried away with the error of lawless people and lose your own stability. \\n\\t\\t\\t","3","2 Peter","209")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("76","2Pet","18","174.424","Chapter 3","But grow in the grace and knowledge of our Lord and Savior Jesus Christ. To him be the glory both now and to the day of eternity. Amen. \\n\\n\\t\\t\\n\\t","3","2 Peter","209")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","1","5.106","Chapter 1","That which was from the beginning, which we have heard, which we have seen with our eyes, which we looked upon and have touched with our hands, concerning the word of life\\u2014 \\n\\t\\t\\t","1","1 John","209")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","2","17.649","Chapter 1","the life was made manifest, and we have seen it, and testify to it and proclaim to you the eternal life, which was with the Father and was made manifest to us\\u2014 \\n\\t\\t\\t","1","1 John","209")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","3","29.066","Chapter 1","that which we have seen and heard we proclaim also to you, so that you too may have fellowship with us; and indeed our fellowship is with the Father and with his Son Jesus Christ. \\n\\t\\t\\t","1","1 John","209")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","4","42.437","Chapter 1","And we are writing these things so that our joy may be complete. \\n\\t\\t\\t","1","1 John","209")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","5","47.371","Chapter 1","This is the message we have heard from him and proclaim to you, that God is light, and in him is no darkness at all. \\n\\t\\t\\t","1","1 John","209")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","6","57.344","Chapter 1","If we say we have fellowship with him while we walk in darkness, we lie and do not practice the truth. \\n\\t\\t\\t","1","1 John","209")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","7","64.503","Chapter 1","But if we walk in the light, as he is in the light, we have fellowship with one another, and the blood of Jesus his Son cleanses us from all sin. \\n\\t\\t\\t","1","1 John","209")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","8","76.252","Chapter 1","If we say we have no sin, we deceive ourselves, and the truth is not in us. \\n\\t\\t\\t","1","1 John","209")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","9","82.795","Chapter 1","If we confess our sins, he is faithful and just to forgive us our sins and to cleanse us from all unrighteousness. \\n\\t\\t\\t","1","1 John","209")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","10","91.344","Chapter 1","If we say we have not sinned, we make him a liar, and his word is not in us. \\n\\t\\t\\n\\t\\t","1","1 John","209")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","1","2.821","Chapter 2","My little children, I am writing these things to you so that you may not sin. But if anyone does sin, we have an advocate with the Father, Jesus Christ the righteous. \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","2","16.066","Chapter 2","He is the propitiation for our sins, and not for ours only but also for the sins of the whole world. \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","3","23.636","Chapter 2","And by this we know that we have come to know him, if we keep his commandments. \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","4","29.53","Chapter 2","Whoever says \\u201cI know him\\u201d but does not keep his commandments is a liar, and the truth is not in him, \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","5","36.914","Chapter 2","but whoever keeps his word, in him truly the love of God is perfected. By this we may know that we are in him: \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","6","45.742","Chapter 2","whoever says he abides in him ought to walk in the same way in which he walked. \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","7","50.94","Chapter 2","Beloved, I am writing you no new commandment, but an old commandment that you had from the beginning. The old commandment is the word that you have heard. \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","8","60.927","Chapter 2","At the same time, it is a new commandment that I am writing to you, which is true in him and in you, because the darkness is passing away and the true light is already shining. \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","9","72.079","Chapter 2","Whoever says he is in the light and hates his brother is still in darkness. \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","10","77.556","Chapter 2","Whoever loves his brother abides in the light, and in him there is no cause for stumbling. \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","11","83.954","Chapter 2","But whoever hates his brother is in the darkness and walks in the darkness, and does not know where he is going, because the darkness has blinded his eyes. \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","12","93.755","Chapter 2","I am writing to you, little children, because your sins are forgiven for his name\\u2019s sake. \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","13","99.384","Chapter 2","I am writing to you, fathers, because you know him who is from the beginning. I am writing to you, young men, because you have overcome the evil one. I write to you, children, because you know the Father. \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","14","113.954","Chapter 2","I write to you, fathers, because you know him who is from the beginning. I write to you, young men, because you are strong, and the word of God abides in you, and you have overcome the evil one. \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","15","127.384","Chapter 2","Do not love the world or the things in the world. If anyone loves the world, the love of the Father is not in him. \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","16","136.437","Chapter 2","For all that is in the world\\u2014the desires of the flesh and the desires of the eyes and pride in possessions\\u2014is not from the Father but is from the world. \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","17","147.583","Chapter 2","And the world is passing away along with its desires, but whoever does the will of God abides forever. \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","18","155.437","Chapter 2","Children, it is the last hour, and as you have heard that antichrist is coming, so now many antichrists have come. Therefore we know that it is the last hour. \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","19","168.808","Chapter 2","They went out from us, but they were not of us; for if they had been of us, they would have continued with us. But they went out, that it might become plain that they all are not of us. \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","20","182.146","Chapter 2","But you have been anointed by the Holy One, and you all have knowledge. \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","21","187.106","Chapter 2","I write to you, not because you do not know the truth, but because you know it, and because no lie is of the truth. \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","22","195.424","Chapter 2","Who is the liar but he who denies that Jesus is the Christ? This is the antichrist, he who denies the Father and the Son. \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","23","205.079","Chapter 2","No one who denies the Son has the Father. Whoever confesses the Son has the Father also. \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","24","213.119","Chapter 2","Let what you heard from the beginning abide in you. If what you heard from the beginning abides in you, then you too will abide in the Son and in the Father. \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","25","224.397","Chapter 2","And this is the promise that he made to us\\u2014eternal life. \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","26","229.927","Chapter 2","I write these things to you about those who are trying to deceive you. \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","27","234.384","Chapter 2","But the anointing that you received from him abides in you, and you have no need that anyone should teach you. But as his anointing teaches you about everything, and is true, and is no lie\\u2014just as it has taught you, abide in him. \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","28","250.861","Chapter 2","And now, little children, abide in him, so that when he appears we may have confidence and not shrink from him in shame at his coming. \\n\\t\\t\\t","2","1 John","210")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","29","261.04","Chapter 2","If you know that he is righteous, you may be sure that everyone who practices righteousness has been born of him. \\n\\t\\t\\n\\t\\t","2","1 John","210")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","1","2.649","Chapter 3","See what kind of love the Father has given to us, that we should be called children of God; and so we are. The reason why the world does not know us is that it did not know him. \\n\\t\\t\\t","3","1 John","211")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","2","16.623","Chapter 3","Beloved, we are God\\u2019s children now, and what we will be has not yet appeared; but we know that when he appears we shall be like him, because we shall see him as he is. \\n\\t\\t\\t","3","1 John","211")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","3","30.093","Chapter 3","And everyone who thus hopes in him purifies himself as he is pure. \\n\\t\\t\\t","3","1 John","211")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","4","35.755","Chapter 3","Everyone who makes a practice of sinning also practices lawlessness; sin is lawlessness. \\n\\t\\t\\t","3","1 John","211")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","5","43.649","Chapter 3","You know that he appeared to take away sins, and in him there is no sin. \\n\\t\\t\\t","3","1 John","211")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","6","48.94","Chapter 3","No one who abides in him keeps on sinning; no one who keeps on sinning has either seen him or known him. \\n\\t\\t\\t","3","1 John","211")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","7","57.53","Chapter 3","Little children, let no one deceive you. Whoever practices righteousness is righteous, as he is righteous. \\n\\t\\t\\t","3","1 John","211")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","8","66.781","Chapter 3","Whoever makes a practice of sinning is of the devil, for the devil has been sinning from the beginning. The reason the Son of God appeared was to destroy the works of the devil. \\n\\t\\t\\t","3","1 John","211")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","9","77.914","Chapter 3","No one born of God makes a practice of sinning, for God\\u2019s seed abides in him, and he cannot keep on sinning because he has been born of God. \\n\\t\\t\\t","3","1 John","211")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","10","88.371","Chapter 3","By this it is evident who are the children of God, and who are the children of the devil: whoever does not practice righteousness is not of God, nor is the one who does not love his brother. \\n\\t\\t\\t","3","1 John","211")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","11","100.728","Chapter 3","For this is the message that you have heard from the beginning, that we should love one another. \\n\\t\\t\\t","3","1 John","211")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","12","106.94","Chapter 3","We should not be like Cain, who was of the evil one and murdered his brother. And why did he murder him? Because his own deeds were evil and his brother\\u2019s righteous. \\n\\t\\t\\t","3","1 John","211")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","13","118.424","Chapter 3","Do not be surprised, brothers, that the world hates you. \\n\\t\\t\\t","3","1 John","211")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","14","123.437","Chapter 3","We know that we have passed out of death into life, because we love the brothers. Whoever does not love abides in death. \\n\\t\\t\\t","3","1 John","211")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","15","131.185","Chapter 3","Everyone who hates his brother is a murderer, and you know that no murderer has eternal life abiding in him. \\n\\t\\t\\t","3","1 John","211")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","16","138.94","Chapter 3","By this we know love, that he laid down his life for us, and we ought to lay down our lives for the brothers. \\n\\t\\t\\t","3","1 John","211")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","17","147.954","Chapter 3","But if anyone has the world\\u2019s goods and sees his brother in need, yet closes his heart against him, how does God\\u2019s love abide in him? \\n\\t\\t\\t","3","1 John","211")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","18","158.318","Chapter 3","Little children, let us not love in word or talk but in deed and in truth. \\n\\t\\t\\t","3","1 John","211")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","19","164.212","Chapter 3","By this we shall know that we are of the truth and reassure our heart before him; \\n\\t\\t\\t","3","1 John","211")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","20","169.411","Chapter 3","for whenever our heart condemns us, God is greater than our heart, and he knows everything. \\n\\t\\t\\t","3","1 John","211")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","21","175.45","Chapter 3","Beloved, if our heart does not condemn us, we have confidence before God; \\n\\t\\t\\t","3","1 John","211")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","22","181.662","Chapter 3","and whatever we ask we receive from him, because we keep his commandments and do what pleases him. \\n\\t\\t\\t","3","1 John","211")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","23","188.318","Chapter 3","And this is his commandment, that we believe in the name of his Son Jesus Christ and love one another, just as he has commanded us. \\n\\t\\t\\t","3","1 John","211")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","24","197.464","Chapter 3","Whoever keeps his commandments abides in God, and God in him. And by this we know that he abides in us, by the Spirit whom he has given us. \\n\\t\\t\\n\\t\\t","3","1 John","211")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","1","3.066","Chapter 4","Beloved, do not believe every spirit, but test the spirits to see whether they are from God, for many false prophets have gone out into the world. \\n\\t\\t\\t","4","1 John","212")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","2","13.331","Chapter 4","By this you know the Spirit of God: every spirit that confesses that Jesus Christ has come in the flesh is from God, \\n\\t\\t\\t","4","1 John","212")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","3","22.384","Chapter 4","and every spirit that does not confess Jesus is not from God. This is the spirit of the antichrist, which you heard was coming and now is in the world already. \\n\\t\\t\\t","4","1 John","212")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","4","33.53","Chapter 4","Little children, you are from God and have overcome them, for he who is in you is greater than he who is in the world. \\n\\t\\t\\t","4","1 John","212")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","5","42.954","Chapter 4","They are from the world; therefore they speak from the world, and the world listens to them. \\n\\t\\t\\t","4","1 John","212")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","6","48.808","Chapter 4","We are from God. Whoever knows God listens to us; whoever is not from God does not listen to us. By this we know the Spirit of truth and the spirit of error. \\n\\t\\t\\t","4","1 John","212")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","7","61.119","Chapter 4","Beloved, let us love one another, for love is from God, and whoever loves has been born of God and knows God. \\n\\t\\t\\t","4","1 John","212")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","8","70.397","Chapter 4","Anyone who does not love does not know God, because God is love. \\n\\t\\t\\t","4","1 John","212")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","9","75","Chapter 4","In this the love of God was made manifest among us, that God sent his only Son into the world, so that we might live through him. \\n\\t\\t\\t","4","1 John","212")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","10","85.026","Chapter 4","In this is love, not that we have loved God but that he loved us and sent his Son to be the propitiation for our sins. \\n\\t\\t\\t","4","1 John","212")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","11","94.967","Chapter 4","Beloved, if God so loved us, we also ought to love one another. \\n\\t\\t\\t","4","1 John","212")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","12","100.914","Chapter 4","No one has ever seen God; if we love one another, God abides in us and his love is perfected in us. \\n\\t\\t\\t","4","1 John","212")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","13","109.132","Chapter 4","By this we know that we abide in him and he in us, because he has given us of his Spirit. \\n\\t\\t\\t","4","1 John","212")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","14","116.331","Chapter 4","And we have seen and testify that the Father has sent his Son to be the Savior of the world. \\n\\t\\t\\t","4","1 John","212")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","15","122.596","Chapter 4","Whoever confesses that Jesus is the Son of God, God abides in him, and he in God. \\n\\t\\t\\t","4","1 John","212")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","16","129.424","Chapter 4","So we have come to know and to believe the love that God has for us. God is love, and whoever abides in love abides in God, and God abides in him. \\n\\t\\t\\t","4","1 John","212")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","17","142.291","Chapter 4","By this is love perfected with us, so that we may have confidence for the day of judgment, because as he is so also are we in this world. \\n\\t\\t\\t","4","1 John","212")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","18","153.57","Chapter 4","There is no fear in love, but perfect love casts out fear. For fear has to do with punishment, and whoever fears has not been perfected in love. \\n\\t\\t\\t","4","1 John","212")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","19","164.623","Chapter 4","We love because he first loved us. \\n\\t\\t\\t","4","1 John","212")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","20","168.013","Chapter 4","If anyone says, \\u201cI love God,\\u201d and hates his brother, he is a liar; for he who does not love his brother whom he has seen cannot love God whom he has not seen. \\n\\t\\t\\t","4","1 John","212")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","21","179.98","Chapter 4","And this commandment we have from him: whoever loves God must also love his brother. \\n\\t\\t\\n\\t\\t","4","1 John","212")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","1","4","Chapter 5","Everyone who believes that Jesus is the Christ has been born of God, and everyone who loves the Father loves whoever has been born of him. \\n\\t\\t\\t","5","1 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","2","13.371","Chapter 5","By this we know that we love the children of God, when we love God and obey his commandments. \\n\\t\\t\\t","5","1 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","3","20","Chapter 5","For this is the love of God, that we keep his commandments. And his commandments are not burdensome. \\n\\t\\t\\t","5","1 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","4","26.609","Chapter 5","For everyone who has been born of God overcomes the world. And this is the victory that has overcome the world\\u2014our faith. \\n\\t\\t\\t","5","1 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","5","35.093","Chapter 5","Who is it that overcomes the world except the one who believes that Jesus is the Son of God? \\n\\t\\t\\t","5","1 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","6","41.318","Chapter 5","This is he who came by water and blood\\u2014Jesus Christ; not by the water only but by the water and the blood. And the Spirit is the one who testifies, because the Spirit is the truth. \\n\\t\\t\\t","5","1 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","7","55.689","Chapter 5","For there are three that testify: \\n\\t\\t\\t","5","1 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","8","58.159","Chapter 5","the Spirit and the water and the blood; and these three agree. \\n\\t\\t\\t","5","1 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","9","64.093","Chapter 5","If we receive the testimony of men, the testimony of God is greater, for this is the testimony of God that he has borne concerning his Son. \\n\\t\\t\\t","5","1 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","10","74.503","Chapter 5","Whoever believes in the Son of God has the testimony in himself. Whoever does not believe God has made him a liar, because he has not believed in the testimony that God has borne concerning his Son. \\n\\t\\t\\t","5","1 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","11","88.265","Chapter 5","And this is the testimony, that God gave us eternal life, and this life is in his Son. \\n\\t\\t\\t","5","1 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","12","95.57","Chapter 5","Whoever has the Son has life; whoever does not have the Son of God does not have life. \\n\\t\\t\\t","5","1 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","13","103.503","Chapter 5","I write these things to you who believe in the name of the Son of God that you may know that you have eternal life. \\n\\t\\t\\t","5","1 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","14","110.742","Chapter 5","And this is the confidence that we have toward him, that if we ask anything according to his will he hears us. \\n\\t\\t\\t","5","1 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","15","118.45","Chapter 5","And if we know that he hears us in whatever we ask, we know that we have the requests that we have asked of him. \\n\\t\\t\\t","5","1 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","16","126.159","Chapter 5","If anyone sees his brother committing a sin not leading to death, he shall ask, and God will give him life\\u2014to those who commit sins that do not lead to death. There is sin that leads to death; I do not say that one should pray for that. \\n\\t\\t\\t","5","1 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","17","142.728","Chapter 5","All wrongdoing is sin, but there is sin that does not lead to death. \\n\\t\\t\\t","5","1 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","18","148.583","Chapter 5","We know that everyone who has been born of God does not keep on sinning, but he who was born of God protects him, and the evil one does not touch him. \\n\\t\\t\\t","5","1 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","19","159.675","Chapter 5","We know that we are from God, and the whole world lies in the power of the evil one. \\n\\t\\t\\t","5","1 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","20","165.808","Chapter 5","And we know that the Son of God has come and has given us understanding, so that we may know him who is true; and we are in him who is true, in his Son Jesus Christ. He is the true God and eternal life. \\n\\t\\t\\t","5","1 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("77","1John","21","182","Chapter 5","Little children, keep yourselves from idols. \\n\\n\\t\\t\\n\\t","5","1 John","213")');

tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("78","2John","1","3.093","Chapter 1","The elder to the elect lady and her children, whom I love in truth, and not only I, but also all who know the truth, \\n\\t\\t\\t","1","2 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("78","2John","2","11.503","Chapter 1","because of the truth that abides in us and will be with us forever: \\n\\t\\t\\t","1","2 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("78","2John","3","15.834","Chapter 1","Grace, mercy, and peace will be with us, from God the Father and from Jesus Christ the Father\\u2019s Son, in truth and love. \\n\\t\\t\\t","1","2 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("78","2John","4","26.238","Chapter 1","I rejoiced greatly to find some of your children walking in the truth, just as we were commanded by the Father. \\n\\t\\t\\t","1","2 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("78","2John","5","32.781","Chapter 1","And now I ask you, dear lady\\u2014not as though I were writing you a new commandment, but the one we have had from the beginning\\u2014that we love one another. \\n\\t\\t\\t","1","2 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("78","2John","6","42.874","Chapter 1","And this is love, that we walk according to his commandments; this is the commandment, just as you have heard from the beginning, so that you should walk in it. \\n\\t\\t\\t","1","2 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("78","2John","7","52.808","Chapter 1","For many deceivers have gone out into the world, those who do not confess the coming of Jesus Christ in the flesh. Such a one is the deceiver and the antichrist. \\n\\t\\t\\t","1","2 John","213")');
tx.executeSql('INSERT INTO VERSES (order_no,book_s_title,verse_no,verse_start,chapter_text,verse_text,chapter_no,book,paragraph) VALUES("78","2John","8","64.265","Chapter 1","Watch yourselves, so that you may not lose what we have worked for, but may win a full reward. \\n\\t\\t\\t","1","2 John","213")');
